INSERT INTO `berita` VALUES (1,'Tentang Ubaya','<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/asset/images/ubaya_2.png\" alt=\"Ubaya\" width=\"402\" height=\"120\" /><br><br>\n<p><strong>Universitas Surabaya</strong><span>&nbsp;yang sering disingkat dengan nama&nbsp;</span><strong>Ubaya</strong><span>, lahir pada tanggal 11 Maret 1968 dengan tiga fakultas yaitu Fakultas Farmasi, Hukum dan Ekonomi. Pada saat ini Ubaya sudah memiliki 8 fakultas dengan 20 program studi. Jumlah total mahasiswa Ubaya pada saat ini berjumlah sekitar 12.000 mahasiswa yang berasal dari berbagai daerah di Indonesia.</span><br /><span>&nbsp;</span><br /><span>Kampus Ubaya sendiri berlokasi di tiga tempat. Dua kampus pertama berlokasi di Surabaya dan digunakan sebagai tempat kegiatan belajar mengajar, sedang kampus ketiga terletak di Trawas, sebuah daerah pegunungan yang digunakan sebagai Outdoor Campus. Total luas total kampus I dan II yang berada di Surabaya lebih kurang 14 hektar atau 140.000 m2, sedang kampus III seluas 30 hektar. Pendidikan yang berkualitas dan lulusan Ubaya yang mudah mencari kerja menjadi salah satu daya tarik siswa SMA untuk melanjutkan pendidikan di Ubaya.</span><br /><span>Seluruh tenaga edukatif dan pimpinan Ubaya bertekad untuk tetap menjaga kualitas pendidikan ini. Sebagai hasilnya, pada saat ini semua program studi di Ubaya yang telah diakreditasi mendapat nilai A (Sangat Baik) dari Badan Akreditasi Nasional.</span><br /><span>&nbsp;</span><br /><span>Siswa-siswa yang berprestasi mendapat berbagai kemudahan dan fasilitas di&nbsp;</span><strong>Ubaya</strong><span>. Salah satu contoh kemudahan yang ditawarkan&nbsp;</span><strong>Ubaya</strong><span>&nbsp;terhadap siswa-siswa berprestasi adalah kesempatan untuk menjadi mahasiswa&nbsp;</span><strong>Ubaya</strong><span>&nbsp;tanpa melalui Tes Potensi Akademik (TPA) dan penetapan Uang Sumbangan Pendidikan yang relatif rendah. Kesempatan menjadi mahasiswa&nbsp;</span><strong>Ubaya</strong><span>&nbsp;tanpa melalui tes masuk ini dapat dilakukan di periode penerimaan JPMK (Jalur Penelusuran Minat dan Kemampuan). Bagi siswa yang lain, Ubaya juga memberikan kesempatan untuk menjadi mahasiswa&nbsp;</span><strong>Ubaya</strong><span>&nbsp;melalui Tes Potensi Akademik. Hasil tes ini akan menentukan besarnya nilai penetapan Uang Sumbangan Pendidikan calon mahasiswa. Seluruh calon mahasiswa akan dinyatakan diterima sebagai mahasiswa&nbsp;</span><strong>Ubaya</strong><span>&nbsp;setelah memenuhi semua persyaratan yang ditetapkan dan dinyatakan lulus dari SMA.</span><br /><span>&nbsp;</span><br /><span>Pengembangan sarana, prasarana dan sumber daya manusia di Ubaya dilakukan secara terus-menerus dan berkesinambungan. Dengan demikian suatu saat kelak&nbsp;</span><strong>Ubaya</strong><span>&nbsp;dapat benar-benar mewujudkan visinya untuk menjadi The First University in Heart and Mind. Universitas yang pertama diingat di hati dan pikiran masyarakat dalam segala segi bidang kehidupan.</span></p>\n<p>Info selengkapnya : <span style=\"font-size: small;\"><strong><a href=\"http://www.ubaya.ac.id\">Website resmi Universitas Surabaya</a></strong></span></p>','2014-10-12','berita'),(2,'Tentang ILPC','<h1 class=\"tengah\">Informatic Logical Programming</h1>\n<p>Jurusan Fakultas Teknik Informatika Universitas Surabaya (UBAYA) tahun ini kembali menyelenggarakan event tahunan bertajuk ILPC untuk yang ke-9 kalinya. ILPC yang merupakan singkatan dari Informatic Logical Programming Competition ini merupakan kompetisi logika dan pemrograman tingkat nasional untuk siswa SMA/sederajat se-Indonesia.</p>\n<p>Event yang telah diselenggarakan selama 8 tahun berturut-turut ini tidak hanya bertujuan untuk memperkenalkan para siswa SMA kepada dunia IT, tetapi juga untuk menguji logika siswa serta melatih&nbsp;<em>team work</em>&nbsp;mereka dalam menyelesaikan masalah pemrograman.</p>','2014-10-22','berita'),(3,'ILPC Open Registration','<p>ILPC 2015 yang merupakan ILPC ke - 9 kembali membuka pendaftarannya. Pendaftaran dapat dilakukan mulai 3 November 2014 s/d 31 Desember 2014 dan 1 Januari 2015 s/d 31 Januari 2015 via online dengan <a  href=\"http://ilpc.ifubaya.com/index.php/register\">link ini</a> atau offline dengan mengunjungi sekretariatan ILPC 2014 di TC 2.1 Ubaya Tenggilis.</p>\n<p>Segera daftarkan tim mu.</p>\n<p>\nKeterangan lebih jelas, dapat dilihat di <a href=\"http://ilpc.ifubaya.com/index.php/faq\">FAQ</a>\n</p>','2014-10-22','berita'),(4,'Hal-hal yang Harus Diperhatikan','<h2 class=\'tengah\'>Hal yang Harus Diperhatikan Selama ILPC 2015</h2>\n<hr>\n<ul>\n<li><span style=\"font-size: small;\">Saat submit jawaban jangan lupa untuk menyamakan bahasa yang dipakai dengan file yang dikirim.</span></li>\n<li><span style=\"font-size: small;\">Agar lebih aman, gunakanlah template yang telah disediakan (terdapat di website ILPC menu Downloads), anda tinggal mengubahnya sesuai kebutuhan.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><span style=\"font-size: medium;\"><strong>Bahasa Pascal</strong></span></p>\n<ul>\n<li><span style=\"font-size: small;\">Jangan menggunakan \"clrscr\".</span></li>\n<li><span style=\"font-size: small;\">Jangan menggunakan \"uses wincrt\".</span></li>\n<li><span style=\"font-size: small;\">Jangan menggunakan readln / readkey (atau sejenisnya).</span>\n<ul>\n<li><span style=\"font-size: small;\">Jika maksud dari penggunaan perintah ini adalah menghentikan program pada akhir eksekusi, maka saat submit perintah ini harus dihapus terlebih dahulu. Karena akan menghasilkan Time Limit Exceed (program akan menunggu user memberi input melalui keyboard, yang tidak akan dilakukan juri).</span></li>\n</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><span style=\"font-size: medium;\"><strong>Bahasa C/C++</strong></span></p>\n<ul>\n<li><span style=\"font-size: small;\">Jangan menggunakan void main()</span>\n<ul>\n<li><span style=\"font-size: small;\">Compiler yang juri gunakan mengharuskan fungsi main() memiliki return value berupa int, sehingga harus ditulis dengan int main().</span></li>\n</ul>\n</li>\n<li><span style=\"font-size: small;\">Jangan menggunakan getch() atau system( \"pause\" )</span>\n<ul>\n<li><span style=\"font-size: small;\">Jika maksud dari penggunaan perintah ini adalah menghentikan program pada akhir eksekusi, maka saat submit perintah ini harus dihapus terlebih dahulu. Karena getch() dapat menyebabkan Time Limit Exceed (program akan menunggu user memberi input melalui keyboard, yang tidak akan dilakukan juri) dan system( \"pause\" ) akan menyebabkan Wrong Answer (ada output tambahan \"Press any key to continue . . .\" yang tidak diharapkan).</span></li>\n</ul>\n</li>\n<li><span style=\"font-size: small;\">Jangan memanggil fungsi tanpa meng-include header yang diperlukan</span>\n<ul>\n<li><span style=\"font-size: small;\">Jika anda menggunakan IDE DevC++, maka anda harus berhati-hati karena DevC++ bisa meng-include secara default beberapa header yang diperlukan oleh program anda, tapi tidak demikian jika anda mengcompile dari command line (yang dilakukan juri). Sehingga submission yang seperti ini akan mendapatkan NO - Compile Error.</span></li>\n</ul>\n</li>\n<li><span style=\"font-size: small;\">Jangan menggunakan strrev, fflush(stdin)</span>\n<ul>\n<li><span style=\"font-size: small;\">Karena juri mengcompile dari command line, maka jika menggunakan perintah ini akan mendapatkan NO - Compile Error.</span></li>\n</ul>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><span style=\"font-size: medium;\"><strong>Bahasa Java</strong></span></p>\n<ul>\n<li><span style=\"font-size: small;\">Source code program dikumpulkan dalam sebuah file bernama Main.java . Oleh sebab itu, pastikan nama class utama adalah  class Main bukan public class Main. <u>Anda dapat membuat lebih dari 1 class didalam file tersebut.</u></span></li>\n\n<li><span style=\"font-size: small;\">Jangan menggunakan modifier public pada class yang dibuat, termasuk class utama, karena akan menyebabkan Compile Error.</span></li>\n\n<li><span style=\"font-size: small;\">Jangan menggunakan package. Jika menggunakan IDE seperti Netbeans, gunakan default package.\nKarena jika menggunakan package program bisa dicompile tapi tidak bisa dirun, sehingga akan mendapatkan NO  Runtime Error.</span></li>\n\n\n<li><span style=\"font-size: small;\">Pastikan sudah melakukan import package dan subpackages yang dibutuhkan didalam program yang anda buat. <br>\nContoh : <br>\nimport java.io.*;<br>\nimport java.util.*;\n</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><strong><span style=\"font-size: medium;\">Clarification</span></strong></p>\n<ol>\n<li><span style=\"font-size: small;\">Clarification digunakan untuk bertanya mengenai soal yang diberikan.<br /></span></li>\n<li><span style=\"font-size: small;\">Baca terlebih dahulu soal dengan teliti, pastikan kebenaran dari klarifikasi yang ditanyakan (tidak terjadi kesalahan membaca atau perhitungan).</span></li>\n<li><span style=\"font-size: small;\">Jangan menanyakan hal yang dianggap sudah umum atau sudah tertuang di dalam soal yang diberikan.</span></li>\n<li><span style=\"font-size: small;\">Jangan mengirimkan pesan / pertanyaan yang tidak sesuai atau menyimpang dengan soal yang diberikan.</span></li>\n<li><span style=\'font-size:small;\'> Panitia tidak akan menjawab apa kesalahan jawaban/solusi peserta</span></li>\n<li><span style=\"font-size: small;\">Pertanyaan / pesan yang tidak sesuai dengan dengan poin 1, 2, dan 3 akan diabaikan atau dijawab dengan \"No Comment\" karena dianggap tidak sesuai atau tidak terjadi kesalahan.</span></li>\n</ol>','2013-10-29','article'),(6,'Panduan Registrasi','<p>Peserta ILPC 2015 adalah pelajar SMA/sederajat yang sama dan belum menyelesaikan pendidikannya pada saat pelaksanaan perlombaan final. Tiap tim terdiri 2-3 orang. Tiap sekolah dapat mengirim lebih dari 1 tim, dan 1 guru pendamping. Guru pendamping harus memberikan surat keterangan dari sekolah bahwa guru tersebut adalah guru di sekolah tersebut.\n<br><br>\nPendaftaran peserta batch I dibuka mulai tanggal 3 November 2014 s/d 31 Desember 2014 dengan biaya pendaftaran Rp. 120.000,-/tim\n<br><br>\ndan batch II dibuka mulai tanggal 1 Januari 2015 s/d 31 Januari 2015 dengan biaya pendaftaran Rp. 150.000,-/tim\n<br><br>\n<strong>No. Rek BCA : 389 046 7210 a/n Hendry Salim</strong>\n<br><br>\nBerikut kami lampirkan panduan registrasi:<br><br>\n1. <a href=\"http://ilpc.ifubaya.com/asset/files/Pendaftaran Offline.rar\" target=\"_blank\">Link download panduan offline </a>\n<br>\n2. <a href=\"http://ilpc.ifubaya.com/index.php/berita/PendaftaranOnline\">Link download panduan online </a>\n</p>','2014-10-22','berita'),(8,'Program Yang Digunakan','<h2 class=\'tengah\'>Program Yang Disediakan</h2>\r\n<hr><p><span style=\"font-size: small;\">Berikut adalah program yang akan kami sediakan nantinya untuk babak semifinal dan final programming. Diharapkan peserta membiasakan diri terlebih dahulu agar tidak kesulitan di babak semifinal dan/atau final nantinya.</span></p>\r\n<p><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\"><strong>Pascal</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Free Pascal (<a href=\"http://www.freepascal.org/download.var\">http://www.freepascal.org/download.var</a>)</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\"><strong>C++</strong><br /></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Code::Blocks (<a href=\"http://www.codeblocks.org/downloads\">http://www.codeblocks.org/downloads</a>)</span></li>\r\n<li><span style=\"font-size: small;\">Dev-C++ (<a href=\"http://www.bloodshed.net/dev/devcpp.html\">http://www.bloodshed.net/dev/devcpp.html</a>)</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\"><strong>Java</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">NetBeans IDE (<a href=\"http://netbeans.org/downloads/\">http://netbeans.org/downloads/</a>)</span></li>\r\n<li><span style=\"font-size: small;\">Eclipse (<a href=\"http://www.eclipse.org/downloads/\">http://www.eclipse.org/downloads/</a>)</span></li>\r\n</ul>','2014-02-10','article');
