ial Di Dalam Faktorial. Jika 5 Faktorial (5!) adalah 5x4x3x2x1 = 120, maka 5 F&amp;F (5!!) adalah 5!x4!x3!x2!x1! = 120 x 24 x 6 x 2 x 1 = 34560. Buatlah program untuk menentukan banyaknya jumlah digit 0 yang secara berturutan mengakhiri N!! (nol di tengah tidak termasuk). Misalnya 5!! = 34560, maka jumlah digit 0 yang mengakhirinya adalah 1.\n\nFormat Input:\n\nInput diawali dengan sebuah bilangan T yang menyatakan jumlah kasus(1&lt;=T&lt;=20). Tiap kasus berisi 1 bilangan bulat N (1 ? N  ? 10000) yang menyatakan bilangan F&amp;F.\n\nFormat Output:\n\nUntuk setiap kasus output diawali dengan “Case #i: “ (tanpa petik, dimana i adalah urutan kasus), diikuti bilangan bulat yang menyatakan jumlah digit 0 berturutan yang mengakhiri N!!.\n\nContoh Input:\n\n3\n\n5\n\n12\n\n16\n\nContoh Output:\n\nCase #1: 1\n\nCase #2: 11\n\nCase #3: 21\n','','09:53:10','10:09:48',5,163,87),(143,'sample input bisa dicek?\nbagian &quot;3 1 4&quot;','Soal sudah diupdate, silahkan refresh soal','09:56:38','10:15:22',7,87,88),(144,'Koinnya apakah benar 101?','benar 101 itu tapi ada ralat contoh output :&lt;br /&gt; &lt;br /&gt; Setiawan mengambil 5&lt;br /&gt; Aloysius mengambil 5&lt;br /&gt; Setiawan mengambil 6&lt;br /&gt; Aloysius mengambil 4&lt;br /&gt; Setiawan mengambil 7&lt;br /&gt; Aloysius mengambil 3&lt;br /&gt; Setiawan mengambil 8&lt;br /&gt; Aloysius mengambil 2&lt;br /&gt; Setiawan mengambil 6&lt;br /&gt; Aloysius mengambil 4&lt;br /&gt; Setiawan mengambil 8&lt;br /&gt; Aloysius mengambil 2&lt;br /&gt; Setiawan mengambil 5&lt;br /&gt; Aloysius mengambil 5&lt;br /&gt; Setiawan mengambil 8&lt;br /&gt; Aloysius mengambil 2&lt;br /&gt; Setiawan mengambil 4&lt;br /&gt; Aloysius mengambil 6&lt;br /&gt; Setiawan mengambil 6&lt;br /&gt; Aloysius mengambil 4&lt;br /&gt; Setiawan mengambil 1&lt;br /&gt; Setiawan kalah&lt;br /&gt; Setiawan mengambil 6&lt;br /&gt; Aloysius mengambil 4&lt;br /&gt; Setiawan mengambil 4&lt;br /&gt; Aloysius mengambil 6&lt;br /&gt; Setiawan mengambil 4&lt;br /&