5,172,87),(167,'Time limit telah diubah menjadi 3 detik. Dan runtime saya 1.773 detik. Mengapa masih ditulis Time Limit Exceeded?','Jadi begini, untuk penggunaan java, memang akan memakan proses 3x daripada cpp dan pascal..&lt;br /&gt;\nDan waktu yang dikeluarkan bukan merupakan waktu compile selesai, namun waktu ketika compiler membaca program anda, dan mengetahui bahwa program tidak akan selesai dengan batas time limit yang telah ditentukan.&lt;br /&gt;\nKarena input yang digunakan cukup besar untuk dicompile. Maka dari itu perlu optimasi program yang mampu compile seoptimal mungkin dengan testcase yang cukup besar. Untuk mempercepat bisa menggunakan Buffered Reader','11:51:27','11:58:08',5,172,82),(168,'jadi kenapa pada case 2 tak ada bilangan prima\n','baca soal dengan teliti, termasuk format-format input.outputnya dan contohnya','11:57:07','12:00:09',5,93,82),(169,'tadi salah kirim maaf','','12:00:38','00:00:00',0,243,82),(170,'Bagaimana Cara Mengetahui Verdict jawaban, wrong answer,RTE , atau TLE ?','ad di my submission','12:02:42','12:14:23',5,117,86),(171,'0.998 kenapa TLE?','itu benar TLE karena program yang dijalankan lebih dari 1 detik. 0.998 merupakan waktu program yang anda submit dihentikan prosesnya. ','12:06:26','12:16:59',5,169,87),(172,'bisa tolong berikan penjelassan output dari soal g untuk sample testcase?','','12:06:57','00:00:00',0,107,88),(173,'selamat siang..\nsaya menggunakan software yg disediakan panitia yaitu code:blocks\nwaktu saya coba di komputer saya, semua program berjalan dengan baik...\ntapi kenapa hasil kami dikatakan &quot;Run Time Error&quot;?','Runtime error bisa saja karena array index out of bounds, division by zero, dll','12:10:13','12:15:22',5,111,82),(174,'Ini kalau inputnya _ (garis bawah) outputnya apa?\napa garis bawahnya hilang atau tetap ada?\nKarena diaturan java yang asli, garis bawah diperbolehkan.\nTanda $ (dollar) apakah termasuk syarat juga? di soal tidak ada.','Baca deskripsi soal lebih teliti lagi','12:15:16','12:19:47',5,137,85),(175,'Wah, Magus II gagal dalam ujian matematika! Sebagai guru yang baik, Magus I memberikan tugas pada Magus II untuk memperbaiki nilai. Tugas itu adalah menemukan bilangan- bilangan prima dalam  suatu deret bilangan yang mempunyai bilangan kuadrat pada deret yang sama. Bantulah Magus II untuk melakukannya!\nFormat Input:\n\nInput diawali suatu bilangan T yang menyatakan jumlah kasus (0&lt;T&lt;=100). Setiap kasus berisi 2 baris, dimana baris pertama berisi suatu bilangan N yang menunjukkan jumlah bilangan (0&lt;N&lt;=1000) dan baris kedua berisi N buah bilangan M(0&lt;M1&lt;M2&lt;M3&lt;……&lt;=1000) yang merupakan deret bilangan bulat. Deret tersebut terurut dari kecil ke besar dan masing-masing bilangannya dipisahkan oleh spasi.\nFormat Output:\n\nOutput terdiri dari satu baris untuk setiap kasus. Outputkan “Case #i: ” (tanpa tanda kutip) dimana i merupakan nomor kasus dimulai dari 1 sampai T diikuti jumlah bilangan prima yang memiliki bilangan kuadrat pada deret tersebut.\nContoh Input:\n\n3\n\n5\n\n1 2 3 4 9\n\n10\n\n1 2 3 5 7 11 13 14 15 17\n\n10\n\n2 3 4 5 9 11 13 25 120 122\n\n \nContoh Output:\n\nCase #1: 2\n\nCase #2: 0\n\nCase #3: 3\n\n','','12:16:07','00:00:00',0,163,82),(176,'Hari ini Akabil (adik dari Ababil, teman kita yang lucu dan menggemaskan itu) akan belajar mengenai listrik di Sekolah Dasar tempat ia bersekolah. Secara sederhana, ia belajar untuk menghubungkan terminal listrik ke lampu. Apabila terminal dialiri listrik, maka lampu yang terhubung dengan terminal tersebut akan menyala. Satu terminal dapat dihubungkan ke banyak lampu, namun satu lampu hanya bisa dihubungkan ke satu terminal dan listrik tidak bisa dialirkan langsung ke lampu. Selain hubungan antar terminal dan lampu, Akabil juga dapat menghubungkan terminal dengan terminal lainnya. Dengan hubungan ini, maka terminal dapat menyalurkan listrik satu sama lain. Sebagai contoh, apabila terminal A disambungkan ke terminal B, maka listrik yang dialirkan ke terminal A akan mengalir ke terminal B, dan sebaliknya.\n\nKarena Akabil adalah  siswa yang sangat bersemangat (seperti kakaknya), maka Akabil langsung menghubungkan N buah terminal dan sejumlah lampu yang ada di mejanya (1 &lt;= N &lt;= 10000, jumlah lampu per terminal dan jumlah semua lampu dijamin lebih kecil dari 10^10) menjadi sejumlah rangkaian. Celakanya, setelah Akabil menyelesaikan rangkaiannya, ia baru diketahui bahwa listrik hanya bisa  dialirkan ke satu terminal saja. Akabil, yang tentunya ingin menyalakan lampu sebanyak-banyaknya tanpa mengubah rangkaiannya. Oleh sebab itu Akabil meminta bantuan anda untuk mencari terminal manakah yang harus dialiri listrik sehingga jumlah lampu yang menyala maksimum.\nFormat Input:\n\nInput akan diawali oleh satu bilangan T (1 &lt;= T &lt;= 5) yang menyatakan jumlah kasus. Setiap kasus berisi dua bilangan N dan P (1 &lt;= P &lt;= 20000) yang masing-masing menyatakan jumlah terminal dan jumlah hubungan antar terminal. Baris berikutnya akan berisi N buah bilangan B, dimana B menyatakan jumlah lampu yang disambungkan ke masing-masing terminal secara berurutan. Setelah itu, P baris berikutnya akan berisi 2 angka Q dan R yang menyatakan terminal Q tersambung ke terminal R.\nFormat Output:\n\nUntuk setiap kasus output diawali dengan “Case #A: “ (tanpa tanda kutip), dimana A merupakan nomor kasus, diikuti satu bilangan yang menyatakan nomor terminal yang perlu dialiri listrik pada setiap kasus sehingga jumlah lampu yang menyala maksimum. Apabila ada lebih dari satu kemungkinan, outputkan nomor terminal yang terkecil.\n\n \nContoh Input:\n\n1\n\n5 3\n\n1 1 0 3 0\n\n1 2\n\n2 3\n\n4 5\n\n \nContoh Output:\n\nCase #1: 4','','12:16:20','00:00:00',0,163,83),(177,'Denny adalah seorang mahasiswa jurusan Teknik Informatika. Suatu hari, ia mendapat tugas mata kuliah Algoritma dan Dasar Pemrograman. Tugas tersebut terdiri dari beberapa soal, dan Denny pun segera mencoba mengerjakannya. Namun, setelah 6 hari, Denny tidak kunjung berhasil menyelesaikan sebuah soal unik, yaitu mencetak segi enam yang terdiri dari sebuah kata yang diinputkan. Sebagai teman yang baik, bantulah Denny membuat programnya karena batas pengumpulan tugas tersebut tinggal 1 hari lagi.\nFormat Input:\n\nInput diawali dengan sebuah bilangan T (1 &lt;= T &lt;= 15) yang merupakan jumlah kasus. Setiap kasus berisi sebuah kata yang tersusun atas huruf kapital dan atau angka, dengan panjang 3 sampai 20 karakter.\nFormat Output:\n\nUntuk setiap kasus output diawali dengan “Case #i:“ (tanpa petik, dimana i adalah urutan kasus), lalu baris berikutnya tampilkan pola kata sesuai kata yang diinputkan (lihat contoh input dan output untuk lebih jelasnya).\nContoh Input :\n\n3\n\nABC\n\nUBAYA\n\nILPC14\nContoh output:\n\nCase #1:\n\n  ABC\n\n ABCAB\n\nABC*ABC\n\n ABCAB\n\n  ABC\n\nCase #2:\n\n    UBAYA\n\n   UBAYAUB\n\n  UBAYAUBAY\n\n UBAYAUBAYAU\n\nUBAYA***UBAYA\n\n UBAYAUBAYAU\n\n  UBAYAUBAY\n\n   UBAYAUB\n\n    UBAYA\n\nCase #3:\n\n     ILPC14\n\n    ILPC14IL\n\n   ILPC14ILPC\n\n  ILPC14ILPC14\n\n ILPC14ILPC14IL\n\nILPC14****ILPC14\n\n ILPC14ILPC14IL\n\n  ILPC14ILPC14\n\n   ILPC14ILPC\n\n    ILPC14IL\n\n     ILPC14','','12:16:37','00:00:00',0,163,84),(178,'Dalam dunia pemrograman dikenal berbagai macam konvensi atau kesepakatan bersama tentang bagaimana cara menuliskan suatu konstanta. Secara umum, nama konstanta biasanya diawali dengan karakter huruf dan tidak mengandung karakter numerik maupun karakter spesial selain garis bawah. Pada bahasa pemrograman C#, penamaan konstanta direkomendasikan untuk mengikuti aturan Pascal yaitu hanya huruf pertama setiap kata yang ditulis dengan huruf besar dan antar kata tidak dipisahkan oleh karakter apapun. Sementara itu, dalam bahasa pemrograman Java, penamaan konstanta agak berbeda. Konstanta biasanya ditulis dalam huruf besar dan antar kata dipisahkan oleh karakter _ (garisbawah).\n\nDavin adalah seorang mahasiswa yang terbiasa dengan bahasa pemrograman C#.  Suatu hari ia mendapat project kuliah untuk membuat program dengan bahasa pemrograman Java secara berkelompok. Karena terbiasa dengan C#, ia lupa dengan gaya penamaan konstanta pada Java. Selain itu, karena mengantuk saat mengerjakan, Davin terkadang mengawali nama konstanta dengan karakter _ (garis bawah), baru kemudian diikuti karakter huruf. Tentunya hal ini dapat membingungkan teman-teman sekelompoknya yang terbiasa mengikuti gaya penamaan konstanta pada Java. Oleh sebab itu, bantulah mereka untuk memperbaiki nama konstanta yang telah dibuat Davin.\n\n \nFormat Input:\n\nBaris pertama diawali oleh bilangan bulat T (0 &lt; T &lt;= 20) yang menunjukkan banyaknya kasus.\n\nPada setiap kasus terdapat sebuah nama konstanta yang dibuat Davin, dengan panjang karakter L (0 &lt; L &lt;= 100).\n\n \nFormat Output:\n\nUntuk setiap kasus output diawali dengan “Case #i: “ (tanpa petik, dimana i adalah urutan kasus), cetak nama konstanta sesuai dengan gaya penamaan konstanta pada bahasa pemrograman Java.\n\n \nContoh Input:\n\n3\n\nApalahArtiSebuahNamaKonstanta\n\nBisaJadiKeWF\n\n_DiscountPerItem\n\n \nContoh Output:\n\nCase #1: APALAH_ARTI_SEBUAH_NAMA_KONSTANTA\n\nCase #2: BISA_JADI_KE_W_F\n\nCase #3: DISCOUNT_PER_ITEM\n\n','','12:17:28','00:00:00',0,163,85),(179,'apakah hasil dari pemfaktoran itu ditampung dalam variabel?','terserah anda','12:17:43','12:19:49',5,95,87),(180,'contoh soalnya pada bagian output apa ga salah? soalnya klo sy hitung manual jumlah nol untuk 12 itu bukan 11 tapi 30 digit','soal sudah benar','12:18:07','12:20:47',5,243,87),(181,'Di suatu daerah pedesaan yang jauh dari Surabaya diadakan lomba petak umpet, di dalam permainan ini 1 orang pemain menjadi seeker dan pemain lainnya adalah hider. Benny, mantan kontestan ILPC, merasa tertantang dan mengikuti lomba tersebut. Ternyata, tempat persembunyiannya tidak seperti petak umpet pada umumnya, dimana pemain bisa bersembunyi di segala tempat. Tempat persembunyiannya berupa sebuah box-box besar yang jumlahnya sesuai dengan peserta hider dimana 1 box hanya dapat menampung seorang hider. Jadi, secara singkat tugas seorang hider adalah menempati sebuah box untuk di tempati dan sang Seeker akan memilih box secara acak. Hider dinyatakan gugur apabila box yang ditempatinya dipilih oleh seeker.\n\nUntungnya, Benny mendapat bocoran bahwa sang seeker memilih box berdasarkan sebuah pola. Seeker akan memilih 1 box pertama, kemudian melewati 1 box setelahnya dan memilih box berikutnya (box 3). Setelah itu seeker akan melewati 2 box sesudahnya(box 5) dan seterusnya. Jika sudah melewati semua box maka perhitungan akan diputar kembali ke box pertama. Perhitungan tidak akan dilakukan pada box yang sudah terpilih.\n\nDi saat Trial, terdapat 5 kontestan. Karena Benny anak yang pintar berlogika, ia langsung dengan cepat menempati box ke-4. Seeker akan memilih secara berurutan box ke-1, ke-3, ke-2, dan ke-5 sehingga Benny yang memenangkan Trial saat itu. Akan tetapi Lomba sesungguhnya diikuti oleh banyak kontestan sehingga Benny tidak mampu menyusun strategi secara cepat. Bantulah Benny memenangkan lomba!\nFormat Input:\n\nInput diawali dengan bilangan T(1&lt;=T&lt;=50) yang merupakan jumlah kasus. Setiap kasus terdiri dari 1 bilangan bulat N (1 ? N ? 104) yang menyatakan jumlah peserta.\nFormat Output:\n\nUntuk setiap kasus output diawali dengan “Case #i: “ (tanpa petik, dimana i adalah urutan kasus), diikuti dengan sebuah bilangan bulat yang menyatakan nomor kotak yang harus ditempati Benny supaya menang.\nContoh Input:\n\n4\n\n5\n\n1\n\n2\n\n20\nContoh Output:\n\nCase #1: 4\n\nCase #2: 1\n\nCase #3: 2\n\nCase #4: 13','','12:18:28','00:00:00',0,163,86),(182,'Ada sebuah permainan  yang memiliki sebuah kelemahan, yaitu siapa yang memulai pertama dapat diprediksi akan kalah. Permainan ini dimainkan oleh 2 orang. Cara bermain permainan ini adalah setiap pemain mengambil N buah koin (1&lt;= N &lt;= 9) dari 101 buah koin yang ditumpuk secara bergiliran. Pemain yang mengambil koin terakhir akan kalah.\n\nPada suatu hari, Aloysius dan Setiawan sedang bermain permainan ini dan Setiawan selalu memenangkan permainan ini. Karena jengkel, Aloysius berpikir keras dan berusaha membuat suatu program yang membuat ia bisa mengalahkan Setiawan. Hari demi hari dia habiskan hanya untuk berpikir, bahkan dia bersumpah tidak akan makan sebelum dia berhasil. Akan tetapi, sumpahnya justru menghambat perkembangan programnya. Bantulah Aloysius untuk membuat program tersebut agar dia bisa menang melawan Setiawan.\nFormat Input:\n\nInput dimulai dengan bulat M (1&lt;= M &lt;=1000) menyatakan jumlah kasus. Setiap kasus akan berisi sejumlah bilangan N(1&lt;=N &lt;=9) yang menyatakan jumlah koin yang diambil oleh Setiawan pada gilirannya. (Diasumsikan Setiawan selalu mengambil giliran pertama).\nFormat Output:\n\n Untuk setiap giliran Setiawan outputkan 2 baris dimana baris pertama berisi “Setiawan mengambil N“ dimana N adalah jumlah koin yang diambil Setiawan dan dibaris kedua outputkan “Aloysius mengambil L” dimana L (1&lt;=L&lt;=9)adalah jumlah koin yang diambil Aloysius. Setiap kasus diakhiri dengan kalimat “Setiawan kalah” atau “Aloysius kalah”.  \nContoh input:\n\n2\n\n5\n\n6\n\n7\n\n8\n\n6\n\n8\n\n5\n\n8\n\n4\n\n6\n\n1\n\n6\n\n4\n\n4\n\n3\n\n9\n\n1\n\n9\n\n3\n\n4\n\n5\n\n1\nContoh output:\n\nSetiawan mengambil 5\n\nAloysius mengambil 5\n\nSetiawan mengambil 6\n\nAloysius mengambil 4\n\nSetiawan mengambil 7\n\nAloysius mengambil 3\n\nSetiawan mengambil 8\n\nAloysius mengambil 2\n\nSetiawan mengambil 6\n\nAloysius mengambil 4\n\nSetiawan mengambil 8\n\nAloysius mengambil 2\n\nSetiawan mengambil 5\n\nAloysius mengambil 5\n\nSetiawan mengambil 8\n\nAloysius mengambil 2\n\nSetiawan mengambil 4\n\nAloysius mengambil 6\n\nSetiawan mengambil 6\n\nAloysius mengambil 4\n\nSetiawan mengambil 1\n\nSetiawan kalah\n\nSetiawan mengambil 6\n\nAloysius mengambil 4\n\nSetiawan mengambil 4\n\nAloysius mengambil 6\n\nSetiawan mengambil 4\n\nAloysius mengambil 6\n\nSetiawan mengambil 3\n\nAloysius mengambil 7\n\nSetiawan mengambil 9\n\nAloysi