l yang lainnya untuk naik kembali.\n\nDiberikan jumlah tombol, keadaan tombol-tombol sebelum Ababil mulai mencoba meloloskan diri dan tombol-tombol yang akan berubah apabila sebuah tombol tertentu ditekan, bantulah Ababil untuk mencari jumlah penekanan tersedikit yang dibutuhkannya untuk meloloskan diri dari RSJ!\nFormat Input:\n\nBaris pertama berisi sebuah bilangan T (1 &lt;= T &lt;= 20) yang menunjukkan jumlah kasus.\n\nBaris pertama dari setiap kasus akan berisi sebuah bilangan N yang menandakan banyak tombol yang ada di gembok. Baris kedua terdiri dari bilangan N1 hingga Nnyang berisi 0 atau 1, dimana 0 menunjukkan bahwa tombol tersebut telah ditekan dan 1 menunjukkan tombol tersebut belum ditekan. N baris berikutnya secara berurutan akan berisi bilangan M yang menandakan jumlah tombol yang akan naik bila tombol Ni ditekan diikuti dengan M bilangan, yaitu tombol-tombol yang akan naik.\nFormat Output:\n\nSebuah string “Case #x:  Y” untuk setiap kasus, dimana x merupakan nomor kasus (dimulai dari 1) dan Y adalah jumlah penekanan minimum untuk membuka gembok. Apabila gembok tidak bisa dibuka dengan cara apapun, outputkan -1.\nContoh Input:\n\n1\n\n4\n\n0 0 0 1\n\n2 3 4\n\n1 3\n\n1 4\n\n3 1 2 3\nContoh Output:\n\nCase #1: 4','No comment','12:21:07','12:42:33',5,163,88),(187,'Apakah contoh output case#4 sudah benar ?','sudah','12:25:31','12:38:46',5,167,86),(188,'yang diambil ke semifinal peringkat berapa saja','1 sampai 40','12:31:48','12:38:32',5,168,82),(189,'Apakah setelah pencarian melewati kotak terakhir, perhitungan pola kembali ke semula?','coba baca soal dengan teliti','12:39:54','12:41:26',5,150,86),(190,'mas, untuk contoh output dengan input 20 apa sudah benar 13?\nterimakasih','sudah benar','12:47:28','12:53:18',5,174,86),(191,'mas, untuk contoh output dengan input 20 apa sudah benar 13?\nterimakasih','','12:49:30','00:00:00',0,174,86),(192,'apakah hasil dari pemfaktoran itu ditampung dalam variabel?','terserah anda','12:49:38','12:55:10',5,95,87),(193,'