pu[b] = input.nextInt();\r\n            if(lampu[b] &lt;= 1 &amp;&amp; lampu[b]&gt;=1000000){\r\n                System.exit(0);\r\n            }\r\n        }\r\n\r\n        \r\n        for (int a = 0; a &lt; n; a++) {\r\n            //int lampu = 10, hasil=0;\r\n            int arr[] = new int[lampu[a]+1];\r\n\r\n            for (int i = 1; i &lt; lampu[a] + 1; i++) {\r\n                for (int j = 1; j &lt; lampu[a] + 1; j++) {\r\n                    if (j % i == 0) {\r\n                        if (arr[j] == 1) {\r\n                            arr[j] = 0;\r\n                        } else if (arr[j] == 0) {\r\n                            arr[j] = 1;\r\n                        }\r\n                    }\r\n                }\r\n\r\n            }\r\n            for (int k = 1; k &lt;lampu[a]+1; k++) {\r\n                hasil[a] += arr[k];\r\n            }\r\n        }\r\n        for(int c=0; c&lt;n; c++){\r\n            System.out.println(hasil[c]);\r\n        }\r\n    }else{\r\n            System.exit(0);\r\n        }\r\n\r\n    }\r\n}\r\n','artinya algoritma anda belum cukup optimal.','13:56:50','13:59:19',14,399,320),(481,'Vin, ini egy','ini evin, halo egy','20:19:49','20:28:53',17,328,390),(482,'hai jawab','jawab','11:04:04','11:04:13',17,329,396),(483,'gan, cara ngerjainnya pakai cara apa ya? \r\nhehehe','test jawab','14:29:15','14:29:49',16,329,393),(484,'wah, jawaban sm pertanyaannya kok ga sinkron gan :D','abaikan gan','14:31:01','14:34:11',16,329,393),(485,'Kak ini contoh inputannya menurut kami kurang penjelasan,mana yang inputan jumlah lampu dan mana yang inputan saklar yang ditekan\r\nTerima kasih','Halo :D\r\nUntuk setiap kasus uji inputannya hanya satu, yaitu N yang menyatakan banyaknya lampu dan saklar.\r\nTerima Kasih :)','14:33:00','14:36:59',16,497,393),(486,'berapakah jumlah char maksimal untuk setiap i','Halo :D \r\nuntuk setiap i, panjang maksimalnya adalah 100.\r\nTerima Kasih :)','14:35:14','14:40:41',16,562,394),(487,'permisi,\r\n\r\nmaksud 