asih :)','09:51:25','09:53:39',17,556,414),(502,'untuk penanda x itu menggunakan x kecil atau X kapital?','Halo :D\r\nuntuk penanda x, yang digunakan adalah x kecil.\r\nTerima kasih :)','09:52:11','09:53:44',18,510,416),(503,'&quot;N baris berikutnya, masing-masing terdapat string &quot;ABCDE&quot; yang tidak ditandai apapun atau ....&quot;\r\n\r\nJika tidak ditandai apapun karakter apa yang dimaksud?\r\n','Halo :D\r\nMohon maaf, terdapat kesalahan pengetikan, harusnya &quot;N baris berikutnya, masing-masing terdapat string &quot;ABCDE&quot; yang salah satu hurufnya diganti karakter penanda.&quot;\r\nTerima kasih :)','09:53:17','09:55:21',18,533,416),(504,'kalau ubaya kata jepang, dengan suku kata u-ba-ya, apakah ubayaa, dengan suku kata u-ba-ya-a juga termasuk kata jepang?','Halo :D\r\nubayaa termasuk kata jepang\r\nTerima kasih :)','09:54:52','09:57:04',17,503,415),(505,'jika tidak ada penanda pada string &quot;ABCDE&quot; apakah berubah menjadi space atau kosong, jadi langsung dilanjut ke string selanjutnya?','Halo :D\r\nada revisi, input dijamin hanya ABCDE dan salah satu hurufnya diganti dengan tanda seperti pada tabel kedua.\r\nterima kasih.','10:00:42','10:02:52',18,510,416),(506,'kak outputnya jumlah apa banayaknya bilangan BPTP ya?','Halo :D\r\noutput yang dihasilkan adalah banyaknya bilangan BPTP.\r\nTerima kasih :)','10:02:30','10:10:25',19,540,419),(507,'apakah sebuah BPTP itu harus dapat dibagi oleh semua bilangan prima yang ada dibawahnya , atau dapat dibagi oleh beberapa bilangan prima yang ada dibawahnya? terima kasih','Halo :D\r\nBPTP dapat dibagi oleh beberapa bilangan prima yang ada dibawahnya.\r\nTerima kasih :)','10:06:48','10:13:53',19,493,419),(508,'sudah mencoba cek jawaban di free pascal dengan banyak testcase berhasil. kenapa masih wrong answer?','Halo :D\r\nDi soal terdapat kata2 &quot;...dikodekan, tanpa spasi ataupun enter.&quot; Sedangkan di source code Anda menggunakan writeln untuk mengoutputkan hasil.\r\nTerima kasih :)','10:23:00','10:28:04',17,571,416),(509,'barusan saya ganti writeln menjadi write tetapi masih WA.. -_-','Halo :D\r\nmaaf menunggu lama, setelah kami periksa jawaban kelompok anda kurang tepat.\r\nterima kasih','10:31:10','11:09:27',19,571,416),(510,'boleh beri petunjuknya?','Halo :D\r\nSoal sudah jelas, silahkan dibaca kembali soalnya dengan lebih teliti.\r\nTerima Kasih :)','10:31:13','10:34:48',18,496,414),(511,'untuk nyaNko bisa banyak jawaban seperti :\r\nn-ya-N-ko\r\ndan nya-N-ko. mana jawaban yang benar ?','Halo :D\r\nYang benar adalah nya-N-ko. Perlu diperhatikan bahwa N dan n tidaklah sama.\r\nTerima kasih :)','10:35:08','10:41:34',17,549,415),(512,'Kak, di soal ini , dibagian output, ada dijelaskan &quot;Outputkan pesan asli Nako sebelum dikodekan, tanpa spasi ataupun enter&quot;. \r\nyang dimaksud dengan &quot;tanpa spasi ataupun enter&quot; di bagian output apa?\r\napakah tidak boleh ada \'enter\' tambahan setelah output, atau tidak boleh ada \'enter\' tambahan sebelum output ?','Halo :D\r\nYang dimaksud dengan tanpa spasi ataupun enter adalah output tidak boleh disertai character apapun (termasuk spasi maupun enter/newline).\r\nTerima kasih :)','10:40:16','10:43:05',17,479,416),(513,'apakah jika 3 huruf huruf pertamanya adalah b, d, g, h, k, m, n, p, r, s, t, atau z dan huruf keduanya adalah y ?? ','Halo :D\r\nIya benar, huruf pertama harus b, d, g, h, k, m, n, p, r, s, t, atau z dan satu satunya huruf kedua yang boleh adalah y\r\nTerima kasih :)','10:46:03','10:58:38',19,513,415),(514,'kak, kalau n=1 dan menyala, k&gt;1 lampu langsung mati atau tetap hidup, kan tidak ada lampu di sebelahnya;','\r\nHalo :D\r\nMaaf soal kami ralat dengan ketentuan N (1 &lt;= N &lt;= 100) menjadi N (2 &lt;= N &lt;= 100).\r\nTerima kasih :)','10:57:22','11:17:40',18,549,421),(515,'saya sudah mencoba banyak testcase acak berhasil semua.. ','Halo :D\r\nMohon tunggu sebentar ya, jawaban Anda sedang diperiksa.\r\nTerima Kasih :)','10:58:08','10:59:46',18,571,416),(516,'Kak, mau nanya\r\nakhir dari output soal ini pakai enter ga? terima kasih','Halo :D\r\nAkhir dari Output tidak menggunakan Enter.\r\nTerima Kasih :)','10:58:34','11:01:20',18,473,416),(517,'apa yg terjadi jika g0 &gt; k?','Halo :D\r\nsesuai soal, index g pertama adalah 1 bukan 0\r\napabila g1 &gt; k, maka permainan roket terbang tidak jalan sama sekali. Jadi, outputnya 0.\r\nTerima kasih :D\r\n','11:01:00','11:04:33',19,533,418),(518,'apakah input selalu lowercase kecuali \'N\' ?','Halo :D\r\nya, input sealu lowercase kecuali \'N\'\r\nTerima Kasih :)','11:13:34','11:18:27',18,549,415),(519,'Selamat siang. Permisi tim kami ingin bertanya. Hasil pekerjaan kami kenapa wrong answer? padahal input dan output sudah sesuai dengan contoh. Terima Kasih.','Halo :D\r\nKami sudah melakukan ralat dan judge ulang, silahkan lihat hasil akhirnya.\r\nTerima kasih :)','11:14:49','11:23:53',17,498,419),(520,'untuk simbol nomor 5 apakah X besar atau x kecil?','halo :D\r\nsimbol nomor 5 adalah x kecil.\r\nTerima Kasih :)','11:20:51','11:23:57',18,556,416),(521,'Kak.. kenapa saya tidak bisa ACc?','Halo :D\r\nSetelah kami memeriksa jawaban Anda, ternyata jawaban kelompok Anda kurang tepat.\r\nTerima kasih :)','11:38:20','11:47:11',17,535,419),(522,'Saya tadi mensubmit jawaban saya 3x dan mendapat Wrong Answer pada ketiga jawaban saya, tak lama kemudian verdict tadi tiba-tiba berubah menjadi Accepted,solved,solved. seharusnya kan jawaban saya sudah benar sejak pengumpulan pertama.. apakah dengan ini saya mendapatkan pengurangan nilai saya?','Halo :D\r\nMemang benar tadi kami melakukan judge ulang karena ada beberapa ralat pada soal kami. Tidak akan terjadi pengurangan nilai apabila Anda mengumpulkan jawaban benar sebanyak lebih dari 1 kali.\r\nTerima kasih :)','11:38:36','11:42:25',18,493,419),(523,'Kak.. kenapa saya tidak bisa ACc?\r\ncoba lihat code saya','','11:39:04','11:47:13',17,535,419),(524,'Untuk lampu yang di ujung mngikuti lampu yg di sebelahnya, apakah mengikuti kondisi S-1 atau kondisi S?','Halo 