 wrong answer. terimakasih','	\r\nHalo :D\r\nSetelah kami memeriksa jawaban Anda, ternyata jawaban kelompok Anda kurang tepat.\r\nTerima kasih :)','12:06:59','12:15:19',17,481,414),(533,'apakah 1 boleh dibalik menjadi 10,100,1000 dan sebagainya(ada trailing zero)','Halo :D\r\nMohon maaf, kami selaku panitia tidak bisa menjawab pertanyaan yang jawabannya berupa clue untuk menyelesaikan soal.\r\nTerima kasih :)','12:12:45','12:23:09',17,549,422),(534,'saya tambahkan code :\r\n\r\nassert(a&gt;=2 &amp;&amp; a&lt;=1000);\r\nassert(b&gt;=2 &amp;&amp; b&lt;=1000);\r\n\r\nhasilnya runtime.\r\nApakah batas variabel a dan b sdh benar?\r\nTerima kasih','','12:13:34','12:18:15',17,513,419),(535,'Mohon maaf\r\nsaya sudah menginput jawaban yang sebelumnya sudah saya coba dengan berbagai case. namun masih WA. ','Halo :D\r\nSetelah kami memeriksa jawaban Anda, ternyata jawaban kelompok Anda kurang tepat.\r\nTerima kasih :)','12:14:25','12:16:30',17,534,416),(536,'saya tambahkan code :\r\n\r\nassert(x&gt;=2 &amp;&amp; y&lt;=1000);\r\nassert(x&gt;=2 &amp;&amp; y&lt;=1000);\r\n\r\nhasilnya runtime.\r\nApakah batas variabel x dan y sdh benar?\r\nTerima kasih','Halo :D\r\nMohon maaf, kami selaku panitia tidak bisa menjawab pertanyaan yang jawabannya berupa clue untuk menyelesaikan soal. Untuk hal tersebut bisa Anda dapatkan dengan membaca soal.\r\nTerima kasih :)','12:16:27','12:18:13',17,513,419),(537,'apakah kami bisa meminta contoh input output yang lain dari contoh tertera untuk membenarkan program kami?','Halo :D\r\nMohon maaf, kami hanya menyediakan contoh input dan output yang sudah tertera di soal, karena contoh lainnya bersifat rahasia.\r\nTerima kasih :)','12:18:54','12:19:53',17,481,414),(538,'1. AB/DE\r\n2. |BCDE\r\n3. ABC/E\r\n\r\nmengapa pada bagian 2 output dari |BCDE adalah \'a\' padahal seharusnya A|BCDE agar bisa menghasilkan \'a\'? \r\n','Halo :D\r\npada bagian ke 2 itu artinya A1 pada tabel 1 sehingga huruf a yang dihasilkan\r\nterima kasih.','12:21:11','12:25:48',16,478,416),(539,'saya menggunakan fungsi assert untuk mengecek apakah inputan pada server anda benar sesuai batasan soal. Ternyata hasilnya runtime, artinya inputan melebihi batasan soal.\r\n\r\nassert(x&gt;=2 &amp;&amp; y&lt;=1000);\r\nassert(x&gt;=2 &amp;&amp; y&lt;=1000);\r\n\r\nBerapakah batasan x dan y?\r\nNB : assert(bool), jika bool bernilai false maka akan timbul exception atau error.\r\n\r\nTerima kasih.','Halo :D\r\nMohon maaf, setelah kami memeriksa, ternyata ada beberapa inputan yang melebihi batasan pada soal.\r\nTerima kasih :)','12:22:05','12:36:26',17,513,419),(540,'ini ga ac salah dimana ya ._. ? mohon coba di cek testcase','Halo :D\r\nmaaf kami tidak bisa memberitahukan letak kesalahannya dimana.\r\nmohon di cek kembali jawaban kelompok anda\r\nterima kasih','12:22:39','12:29:12',16,551,418),(541,'ini ga ac salah dimana ya ._. ? mohon coba di cek testcase','Halo :D\r\nmaaf kami tidak bisa memberitahukan letak kesalahannya dimana.\r\nmohon di cek kembali jawaban kelompok anda\r\nterima kasih','12:22:53','12:29:27',16,551,422),(542,'kak, maaf mengganggu\r\njika kami mengirim jawaban namun dikatakan wrong answer apakah jawaban kami itu tetap dinilai? sebab jika kami compile jawaban sudah sesuai dengan output soal','Mohon maaf, selain contoh input dan output yang kami sediakan di soal, kami juga memiliki input dan output yang bersifat rahasia yang kami miliki. Sehingga, apabila program Anda mengeluarkan output yang sesuai dengan contoh di soal, bel tentu jawaban Anda dinyatakan benar. Terima kasih :)','12:26:03','12:30:30',18,559,414),(543,'apakah dijamin total tinggi bangunan pada awalnya sama dengan total tinggi bangunan yang di harapkan brandon?','Halo :D\r\nIya, dijamin seperti itu.\r\nTerima kasih :)','12:26:13','12:31:06',18,527,420),(544,'Apakah jumlah balok penyusun seluruh bangunan awal selalu sama dengan jumlah balok penyusun seluruh bangunan yang dikehendaki?','Halo :D\r\nIya, dijamin seperti itu.\r\nTerima kasih :)','12:27:23','12:31:30',18,526,420),(545,'apakah &quot;kko&quot; termasuk kata_jepang yang valid?','Halo :D\r\nMohon maaf, kami selaku panitia tidak bisa menjawab pertanyaan yang jawabannya berupa clue untuk menyelesaikan soal. Untuk hal tersebut bisa Anda dapatkan dengan membaca soal.\r\nTerima kasih :)','12:27:46','12:28:36',18,510,415),(546,'Permisi kak, apakah semua soal tidak menggunakan enter setelah output terakhir? terima kasih','Halo :D\r\nUntuk soal yang tidak memiliki keterangan &quot;Output tanpa disertai spasi maupun enter&quot;, output menggunakan enter setelah output terakhir.\r\nTerima kasih :)','12:31:53','12:34:15',17,473,419),(547,'permisi kak untuk soal i kenapa masih pending ya\r\n','Halo :D\r\nMohon maaf jika lama, kami baru saja melakukan rejudge untuk beberapa soal, sehingga membutuhkan waktu yang cukup lama untuk menjudge jawaban setiap tim. Sekali lagi mohon maaf ya,\r\nTerima kasih :)','12:37:41','12:58:05',18,545,422),(548,'kami telah mengumpulkan soal H, dan jawabannya telah di accept, namun belum diupdate di scoreboard. bisa dibetulkan?','Halo :D\r\nScoreboard telah kami freeze sejak pukul 12:00 tadi, sehingga scoreboard tidak berubah jika Anda melakukan submit setelah jam tersebut.\r\nTerima kasih :)','12:41:03','12:42:10',17,503,421),(549,'assalamualaikum wr wb\r\nsaya mau tanya\r\nuntuk C++,apakah yg dikumpulkan adalah file cpp nya saja?\r\ndan apakah nama file harus sama dengan nama soal?\r\nsekian dan terima kasih','Halo :D\r\nyang dikumpulkan hanya file cpp nya saja dan nama file tidak harus sama dengan nama soal.\r\nTerima kasih :)','12:42:57','12:44:21',18,487,416),(550,'kenapa terjadi di runtime error? padahal sudah bisa di compile di laptop saya','Halo :D\r\nSetelah kami memeriksa jawaban Anda, ternyata jawaban kelompok Anda masih ada yang kurang tepat.\r\nTerima kasih :)','12:43:00','12:56:20',18,546,421),(551,'kenapa 2 jawaban tim saya pending?','Halo :D\r\nMohon maaf jika lama, kami baru saja melakukan rejudge untuk beberapa soal, sehingga membutuhkan waktu yang cukup lama untuk menjudge jawaban setiap tim. Sekali lagi mohon maaf ya,\r\nTerima kasih :)','12:45:55','12:58:09',18,497,414),(552,'Kami sudah mengirim kode program sejak beberapa waktu yang lalu (12:27:12), namun verdict-nya masih &quot;Pending&quot;.','Halo :D\r\nMohon maaf jika lama, kami baru saja melakukan rejudge untuk beberapa soal, sehingga membutuhkan waktu yang cukup lama untuk menjudge jawaban setiap tim. Sekali lagi mohon maaf ya,\r\nTerima kasih :)','12:51:17','12:58:13',18,569,422),(553,'Apakah soal E ada salah testcase?\r\n\r\ncontoh testcase:\r\n1 1000 100 1 1\r\n\r\nharusnya bernilai output 1000,\r\ntetapi proram saya mendapat wrong answer, ketika program saya mengoutputkan 100000 mendapat accepted\r\n\r\nharusnya roket akan berjalan 1000 kalidengan mengangkut 1 penumpang, jadi 1x1000=1000','Halo :D\r\nJawaban Anda sudah kami terima dan hasilnya accepted. Untuk kasus tersebut, kebetulan di test case kami tidak ada.\r\nTerima kasih :)','12:51:38','13:32:40',17,531,418),(554,'Kok, kode saya kok sudah di submit dari 15 menit yang lalu dan masih belum di judge? ','Halo :D\r\nMohon maaf jika lama, kami baru saja melakukan rejudge untuk beberapa soal, sehingga membutuhkan waktu yang cukup lama untuk menjudge jawaban setiap tim. Sekali lagi mohon maaf ya,\r\nTerima kasih :)','12:52:36','12:58:19',18,527,422),(555,'apa sudah ada yg ac , bukan begitu ._. soalnya sudah yakin benar','Halo :D\r\nKami sudah melakukan pengecekan terhadap source code versi kami, dan ternyata sudah benar.\r\nTerima kasih :)','12:53:30','13:12:48',17,551,422),(556,'ada koreksi manual?','Halo :D\r\nSoal sudah benar, tidak ada koreksi manual.\r\nTerima kasih :)','13:04:12','13:06:08',17,497,414),(557,'time limit kita exceed berapa banyak ya :)','Mohon maaf, kami tidak bisa memberitahukan hal tersebut. Terima kasih :)','13:10:06','13:11:01',17,574,419),(558,'Boleh yi, ye,?','Halo :D\r\nSoal sudah jelas, silahkan dibaca lagi.\r\nTerima kasih :)','13:15:04','13:17:13',17,555,415),(559,'read gk boleh ya?','Halo :D\r\nTidak masalah kalau menggunakan read untuk menerima inputan.\r\nTerima kasih :)','13:19:29','13:20:55',17,542,417),(560,'huruf \'x\' yang ada pada soal sebagai simbol dari angka 5 menggunakan huruf besar atau kecil?','Halo :D\r\nx huruf kecil\r\nTerima kasih :)','13:19:57','13:21:14',17,527,416),(561,'apakah soal I kemungkinan salah di judge? kami sudah yakin betul tapi tetap Wrong answer','Halo :D\r\nKami sudah melakukan pengecekan terhadap source code versi kami, dan hasilnya sudah benar.\r\nTerima kasih :)','13:25:50','13:26:19',17,503,422),(562,'inputannya lngsung dr program atau di input manual?','Halo :D\r\nSaaat program dieksekusi, inputan dilakukan secara manual.\r\nTerima kasih :)','13:26:31','13:28:01',17,542,414),(563,'apakah pada akhir program di harapkan output berupa sebuah newline kosong?','Halo :D\r\nUntuk setiap kasus, sertai dengan newline.\r\nTerima kasih :)','13:35:57','13:37:10',17,527,419),(564,'kak yang test case ke 2 apakah tidak valid? karena bilangan bptp antara 2 sampai 18 ada 7 kan\r\n4\r\n6\r\n8\r\n9\r\n10\r\n14\r\n15','Halo :D\r\n8 bukan bilangan BPTP karena 8 dibagi oleh 1,2,4,8 dan 4 bukan bilangan prima.\r\nTerima kasih :)','13:43:55','13:45:18',19,504,419),(565,'Sebelumnya mohon maaf kami ingin bertanya tentang wrong answer pada program kami. Saat kami mengikuti contoh input outputnya benar tetapi kenapa hasil program kami wrong answer. terimakasih','Halo :D\r\nSetelah kami mengecek source code Anda, ternyata masih ada kesalahan pada jawaban Anda, terutama pada penggunaan perintah pencetakan output.\r\nTerima kasih :)','13:44:22','13:47:32',17,481,416),(566,'apanya yg slah?\r\n','Mohon maaf, kami tidak bisa menginformasikan hal tersebut. Terima kasih :)','13:48:12','13:50:11',17,542,417),(567,'di free pascal compile timenya 0,1 s\r\nkok pas di submit hasilnya time limit exeeded?','Halo :D\r\nTerdapat perbedaan antara test case yang terdapat pada soal dan yang kami simpan, sehingga sangat memungkinkan untuk terjadi perbedaan running time yang jauh.\r\nTerima kasih :)','13:55:12','13:57:01',17,542,419),(568,'ketentuan untuk output yang dijamin hanya mengandung karakter di tabel itu apakah hanya output atau juga input?','halo :D\r\nuntuk input sesuai ketentuan soal, untuk output berupa string dari hasil konversi dari input\r\nterima kasih.','13:55:27','13:58:15',16,523,416),(569,'kami sudah melakukannya, tapi tetap wrong answer sajaaa ',NULL,'13:58:54',NULL,NULL,523,416),(570,'sepertinya sudah benar semua.',NULL,'13:59:06',NULL,NULL,571,416),(571,'apakah setiap kasus uji dipisahkan dengan enter?\r\n\r\noutput yang diinginkan adalah output setelah algoritma sorting &quot;DEWA&quot; atau sorting biasa?\r\n\r\ndi sample testcase output yang dikeluarkan adalah output dari algoritma sorting biasa','Selamat siang. Iya kak, setiap kasus uji dipisahkan dengan enter. Pada output dari setiap testcase, yang digunakan adalah algoritma sorting dewa. Maaf, pada soal terdapat kesalahan sample, sample akan kami rubah segera. Yang benar adalah yang ada pada deskripsi soal. Terima kasih :)','14:26:38','14:32:56',22,628,444),(572,'apakah di akhir output\r\nada enter?','Ada. Kami sudah melakukan update untuk output untuk problem D, sudah kami lakukan rejudge. Terima kasih :)','14:42:45','14:46:26',22,628,444),(573,'Ini N dapat darimana?','Selamat siang, Tericy Duck. N didapat dari input. Terima kasih :)','14:45:07','14:47:53',22,590,441),(574,'inputnya manual atau lewat function?\r\n','Untuk input, kami panitia sudah memiliki file dalam bentuk file dengan text biasa extension .in . Nanti diharapkan program tim anda mampu membaca input dan melakukan output dengan format input output standard bahasa pemrograman tim anda. Terima kasih :)','14:49:15','14:57:11',22,590,441),(575,'apakah tc sudah benar?','Selamat siang, anonymous. Kami akan \r\ncoba lakukan pengecekan terlebih dahulu untuk testcasenya. Terima kasih :)','14:54:59','14:59:36',22,618,443),(576,'Maaf, mau tanya, mengapa setelah file pascal dikirim, malah ditulis Compile Error ya? Padahal diCompile disini bisa.','selamat siang unknown. Mohon maaf, saat ini terdapat gangguan pada compiler pascal kami. ','15:02:49','15:06:58',23,611,441),(577,'itu berarti program kami memerlukan 3 input yaitu:\r\nN\r\nJumlah loop\r\nSaklar yang ditekan\r\n?','Selamat sore. Maaf, untuk input sudah dijelaskan di soal. Kami dari panitia tidak dapat memberikan penjelasan mengenai itu, terima kasih :)','15:03:59','16:03:11',22,590,441),(578,'make pascal compile error tp di laptop saya gk compile error','Selamat siang Semoga menang. Mohon maaf, saat ini terdapat gangguan pada compiler pascal kami.','15:08:02','15:12:52',23,641,441),(579,'apakah sudah bisa','Mohon maaf, saat ini pascal compilernya sedang dalam proses perbaikan.','15:30:33','15:41:50',22,641,441),(580,'apakah pascal compilernya sudah bisa','Selamat siang, untuk compiler pascal sudah dapat digunakan. Maaf atas ketidaknyamanannya ','15:32:21','15:56:29',22,641,441),(581,'Bagaimana jika tidak ada filenya?','selamat sore Smandupa, mohon maaf kami kurang paham dari pertanyaan tim anda. mungkin Tim anda dapat menanyakan kembali dengan lebih jelas. Terima Kasih :)','16:16:46','16:22:51',23,644,441),(582,'Maaf, mau nanya, soal yang D udah diAccepted, jadi apa kami harus mengupload ulang jawaban kami yang disoal A dan soal B?','selamat sore unknown, saat ini kami sudah melakukan pengujian ulang pada seluruh jawaban yang dikumpulkan. Jadi, apabila hasilnya sudah Accepted maka jawaban tersebut sudah benar, namun jika belum maka jawaban tersebut kurang tepat, sehingga tim anda boleh mengirimkan ulang untuk mencapai jawaban yang paling sesuai. Terima kasih :)','16:34:25','16:40:22',23,611,441),(583,'apakah dalam satu baris input string mungkin ada spasi?','Selamat sore, untuk input tidak ada spasi.','16:57:45','16:58:44',22,596,444),(584,'yang benar pakai case #t atau tidak','Yang benar tidak pakai case #t. Terima kasih','09:12:56','09:13:36',22,603,451),(585,'output dicontoh tidak menggunakan Case #n : S(?)','Format output sudah diralat. Setiap output pada semua soal tidak menggunakan case. Jadi langsung jawaban saja, terima kasih.','09:15:29','09:17:07',22,618,464),(586,'Memenuhi 2 syarat atau salah satu syarat yang tertera?','Selamat pagi, LUSlovers. Maaf sebelumnya, tapi coba baca dan pahami soal lebih baik. Terima kasih.','09:20:59','09:23:59',24,625,450),(587,'untuk setiap testcase apakah jawaban di pisahkan oleh enter ?','Selamat pagi, lari pagi. Iya benar, setiap testcase jawaban dipisahkan oleh enter. Terima kasih','09:26:20','09:29:25',22,623,449),(588,'Sample Output tidak sama dengan Format output. Mana yang benar?','Selamat pagi LUSIlovers, soal tersebut sudah sempat diperbaiki format outputnya. Silahkan direfresh soalnya terlebih dahulu. Terima kasih','09:27:38','09:30:53',22,625,464),(589,'apakah karakter hanya lowercase?','Selamat pagi, iya benar karakter hanya lowercase. Terima kasih','09:30:25','09:32:02',22,618,450),(590,'apakah string nya selalu terdiri oleh abjad saja atau ada karakter lain? jika iya, apakah selalu lowercase ?','Selamat pagi, String hanya huruf a sampai z, dan selalu lowercase. Terima kasih','09:31:27','09:32:29',22,623,450),(591,'kak program saya sudah benar sudah bisa jalan kenapa compile error?','Selamat pagi, coba dicek lagi programnya. Tim panitia ketika run program anda secara manual, juga menampilkan compile error. Terima kasih.','09:33:17','09:38:56',22,595,449),(592,'tapi tidak ada salah ketik sama sekali kak, program saya lancar jaya sumpah','selamat siang toolkit, gunakan header &lt;cstdio&gt; untuk syntax scanf dan printf','09:41:39','09:55:24',25,595,449),(593,'Compilation results...\r\n--------\r\n- Errors: 0\r\n- Warnings: 0\r\n- Output Filename: D:DimasSEKOLAHTOOLKITilpcProgrammingA.exe\r\n- Output Size: 1,36316013336182 MiB\r\n- Compilation Time: 5,06s','','09:42:08','10:47:15',24,595,449),(594,'contoh output yang benar apakah\r\n6\r\n7\r\n\r\natau\r\n\r\nCase #1: 6\r\nCase #2: 7\r\n\r\n?\r\nterimakasih.','Pada contoh output di soal, tidak ada Case#n. Coba refresh terlebih dahulu. Terima kasih.','09:42:22','09:45:17',26,624,451),(595,'Apakah tetap perlu menggunakan case #t? Terima kasih','Tidak perlu menggunakan case #t. Terima kasih','09:47:11','09:50:13',22,603,464),(596,'apakah area luasnya bisa 1?\r\n','Selamat pagi, .. Maaf sebelumnya, tapi coba baca dan pahami soal lebih baik. Terima kasih.','09:47:35','09:51:51',24,628,449),(597,'Apakah jawaban perlu di mod dengan suatu bilangan?','Selamat pagi, output tidak perlu di mod dengan suatu bilangan apapun. Terima kasih','09:48:38','09:51:12',22,603,456),(598,'&quot;Selamat pagi, coba dicek lagi programnya. Tim panitia ketika run program anda secara manual, juga menampilkan compile error. Terima kasih.&quot;\r\n\r\ncompile error dimananya kak?','','09:53:34','10:47:30',26,595,449),(599,'Contoh Input\r\n\r\n2\r\n\r\n20 3 6 80\r\n\r\n20 3 6 85 &lt;--------- ini 85 atau 86 ka?\r\n\r\nOutput\r\n\r\n6\r\n\r\n7','Selamat pagi, contoh input sudah benar 85. Terima kasih','09:57:15','10:02:16',22,631,451),(600,'Kalau tidak ada yang membentuk area atau hanya 1 kotak yang terisi  outputnya 1 atau tidak ada output?','Selamat pagi, outputnya 1. Terima kasih','10:00:19','10:01:52',22,578,449),(601,'apakah mungin pada testcase ada nama lengkap tim yang hanya terdiri dari 1 kata ? dan jika ada, akan dianggap tidak valid atau bagaimana ?\r\nlalu, apakah nama lengkap tim selalu hanya terdiri dari abjad uppercase dan spasi ? atau ada karakter lain ?','Selamat lari pagi, ya bisa saja 1 kata, namun pada output harus menampilkan GAGAL. Input adalah abjad uppercase yang tiap kata dipisahkan spasi. Terima kasih.','10:01:58','10:05:34',26,623,453),(602,'Apakah string S hanya terdiri dari huruf kecil saja?','Selamat pagi, LUSlovers. Iya, string hanya terdiri dari huruf kecil saja. Terima kasih.','10:15:55','10:19:13',24,625,450),(603,'Punya saya salah di mananya? Padahal di kami sudah benar semua ketika diperiksa','Selamat siang, mohon maaf soal tersebut sudah benar, panitia tidak dapat memberikan jawaban yang berupa clue untuk mengerjakan soal. Silahkan dibaca kembali soalnya dengan baik. Terima kasih','10:26:00','10:29:18',22,620,456),(604,'izin kak, apakah mungkin untuk 2 teman dodi akan menghasilkan nilai yang sama ? jika iya, dalam output cetak yang mana terlebih dahulu ?','Selamat siang. Teman dodi mungkin menghasilkan nilai yang sama. Apabila ada yang sama, output dicetak sesuai dengan urutan lexicography nya. Terima kasih','10:28:15','10:52:55',22,623,454),(605,'Apakah ada syarat untuk output-nya, misal ditambah enter di akhir atau dll... \r\nApakah akhir di setiap baris harus ada spasinya?','Selamat pagi. Syarat untuk penulisan output sudah tertera pada soal. Untuk setiap baris, akhiran barisnya tidak perlu ditambahkan spasi. Terima kasih','10:34:45','10:54:07',22,620,456),(606,'Apakah r pasti lebih besar daripada t dan m?','Selamat pagi. Tidak pasti lebih besar. Input sesuai dengan constrain, terima kasih.','10:38:12','10:41:45',22,578,451),(607,'bukankah budi seharusnya 29 dan andi 41?\r\nbudi dengan 2 5\r\n95 &gt; 47 = 5\r\n47 &gt; 23 = 5\r\n23 &gt; 11 = 5\r\n11 &gt; 5 = 5\r\n5 &gt; 2 = 5\r\n2 &gt; 1 &gt; 0 = 4','Selamat pagi Sinluiers, Soal tersebut sudah benar. mohon pahami lagi tiap kata yang pada soal tersebut. Terima kasih :)','10:39:09','10:43:03',23,603,454),(608,'Mengapa saat kami meng-compile di laptop kami, time limit 0 sec. Namun saat di-submit hasil time limit exceed. tolong solusinya.','Selamat pagi, LAZARUS. Mungkin time limit yang Anda lihat saat meng-compile di laptop hanya menguji pada satu data saja. Perlu diketahui, compiler Panitia menguji tidak pada satu data saja, namun banyak data. Terima kasih.','10:43:17','10:46:11',24,605,451),(609,'apakah pascal compilernya bermasalah lg ?','Selamat pagi, Semoga menang. Compiler Pascal Panitia tidak bermasalah. Terima kasih.','10:47:37','10:49:08',24,641,449),(610,'kak kalau kami input sesuai soal outputnya sudah betul, tapi kenapa masih wrong answer\r\n\r\nkami pakai program pascal .\r\n','Selamat siang. Hal tersebut bisa terjadi karena input yang dicek oleh sistem test casenya bukan hanya yang dari soal. Meskipun sudah sesuai dengan contoh, belum tentu program tersebut benar. Terima kasih :)','10:53:43','10:55:18',22,612,451),(611,'Untuk pengerjaan tiap test case apa bisa langsung dimunculkan jawaban atau harus menyimpan semua soal dulu ke dalam array dan baru di outputkan semua jawaban di akhir?','Selamat pagi, kedua cara yang anda sebutkan dapat dilakukan. Terima kasih','10:58:51','11:02:41',22,620,451),(612,'cara buat binomial newton gimana pak ?','Selamat siang, Terserah. Maaf sebelumnya, tapi coba Anda mencari solusinya sendiri. Terima kasih.','10:59:07','11:12:21',24,607,456),(613,'Apakah dijamin bahwa nama lengkap tim hanya terdiri dari huruf saja?','Iya nama lengkap tim dijamin hanya huruf, baik uppercase maupun lowercase saja. Terima kasih','10:59:57','11:01:38',22,625,453),(614,'apakah constrainnya sudah benar?','Selamat pagi, Sinluiers. Costrain sudah benar. Terima kasih.','11:05:32','11:07:02',24,603,454),(615,'yang dikatakan lembur itu melebihi batas waktu kerja atau melebihi waktu selesainya proyek X atau y pak ? bu ?','melebihi batas waktu kerja (yaitu d). (panggil kak saja ya :) )','11:10:52','11:15:32',25,607,455),(616,'kak kami sudah coba beberapa kemungkinan tapi masih wrong answer ketika di attempt itu kenapa ya?','itu mungkin saja dikarenakan karena untuk beberapa test case pada input set kami, jawaban dari program anda masih belum benar. Terima kasih','11:11:39','11:21:01',22,612,451),(617,'projek x y dikerjain bareng2 atau sendirian pak? bu ? ','Sendirian. Terima kasih','11:12:39','11:19:45',25,607,455),(618,'adakah input yang tidak ada nama kota contoh :\r\n&quot;UnITED&quot;\r\natau input yang nama tim nya lebih kecil dari 3 huruf contoh :\r\n&quot;Ma KOKO&quot;','1. Tidak ada. Setiap input pasti terdiri dari 2 kata, diikuti oleh nama kota.\r\n2. Panjang setiap kata tidak ada yang &lt; 3, sesuai dengan constrain yang tertera pada soal. Terima kasih','11:16:03','11:18:08',22,628,453),(619,'apakah tc sudah benar?','Untuk test case sudah dipastikan benar. Terima kasih.','11:19:58','11:25:04',22,618,454),(620,'tapi pada sample testcase terdapat &quot;PLAY SOCCER PEKALONGAN&quot; yang terdiri dari 3 kata\r\n','Maaf, terdapat kesalahan pada sample case tersebut. Soal sudah kami revisi, silahkan dilihat kembali. Terima kasih','11:22:55','11:28:36',22,628,453),(621,'Kenapa program saya selalu compile error saat disubmit\r\nSaya sudah menggunakan Main.java\r\ndengan public class Main\r\ndan main methodnya public static void main(String[] args)\r\n\r\nDAN saya tidak memasukan package lain','Selamat siang, untuk penulisan class Main pada java, tidak boleh menggunakan public. \r\npublic class Main tidak boleh, seharusnya :\r\nclass Main\r\n\r\nTerima kasih\r\n\r\n','11:23:58','11:30:32',22,590,449),(622,'jika jumlahnya sama disort berdasarkan apa?','Di sort berdasarkan urutan lexicography nama teman dodi. Terima kasih.','11:29:46','11:31:16',22,618,454),(623,'nama teman dodi pasti tepat 1 kata?','Tidak. Bisa lebih dari 1 kata. Yang pasti nama dipisahkan oleh tanda  &quot;:&quot; . Terima kasih','11:33:31','11:36:42',22,618,454),(624,'kak, boleh enggak minta contoh inputan dan outputnya lain untuk soal ini ?','Selamat siang, NGADINGDONG A. Maaf sebelumnya, Panitia tidak dapat memberikan contoh input dan output lain, tapi Anda diperkenankan membuat contoh input dan output sendiri dengan ketentuan, sesuai dengan soal. Terima kasih.','11:43:50','11:48:22',24,629,455),(625,'kak, boleh enggak minta contoh inputan dan outputnya lain untuk soal ini ?','','11:44:05','11:48:31',24,629,455),(626,'Time limit terlalu singkat,, cpp maupun pascal tetap time limit exceeded','Maaf, apabila hasil judge time limit exceeded, berarti solusi tim anda masih belum optimal. Semua constrain dalam soal sudah dipastikan supaya dapat dikerjakan dan ditest sehingga terdapat solusi yang tidak hasilnya time limit exceeded. Terima kasih','11:52:44','11:59:32',22,622,451),(627,'Untuk mengetahui tanda merah itu salahnya dimana, bagaimana?','Maaf, kalau boleh tahu tanda merah yang tim anda maksudkan itu tanda merah apa ya? Terima kasih','11:54:43','12:00:07',22,582,451),(628,'apakah ada syarat untuk input nama klub?','Input untuk nama klub dipastikan hanya mengandung karakter dari a sampai z, baik uppercase maupun lowercase dan terdiri dari 2 kata yang dipisahkan oleh spasi. Terima kasih','12:11:53','12:14:07',22,578,453),(629,'yang di halaman scorebord.','','12:13:22','12:15:09',24,582,451),(630,'Sudah tau kak. terimakasih','Selamat siang, B&amp;W. Terima kasih kembali.','12:14:20','12:15:07',24,582,451),(631,'Mengapa saya menerima compile error? padahal saat saya compile pada laptop saya tidak ada compile error? Mohon di cek, saya ingin tahu compilation outputnya.\r\n\r\nTerimakasih','Akan kami coba cari tahu terlebih dahulu permasalahannya. Terima kasih','12:38:46','12:49:48',22,625,453),(632,'bisa minta error message dari submission kami? karena di online compiler dan compiler local kami tidk ada masalalh.','program yang anda submit verdictnya adalah compile erorr. Ketika dicompile, terdapat error message segmentation fault. Terima kasih','12:41:35','13:14:42',22,600,450),(633,'Maaf, kenapa masih compile error? padahal public sudah dihilangkan, terus sudah dicoba di compiler online maupun lokal berhasil. tapi saat dikirim ke website hasilnya compile error','Apa sudah dipastikan nama file yang diupload adalah Main.java?','12:48:09','12:53:19',22,582,456),(634,'Apakah dijamin bahwa tiap kata hanya akan dipisahkan oleh 1 spasi? Apakah dijamin bahwa tidak ada baris kosong? Apakah dijamin bahwa karakter terakhir dari nama tim adalah sebuah huruf, bukan spasi?','Iya benar. Semua hal tersebut dapat dijamin.','13:06:26','13:08:25',22,625,453),(635,'Sudah min','Oke :)','13:10:19','13:19:24',22,582,456),(636,'Apakah pasti ada minimal satu jalur yang sampai tujuan?','Tidak dapat dipastikan bahwa minimal ada 1 jalur yang sampai tujuan. Bisa jadi tidak ada sama sekali.','13:13:23','13:16:52',22,578,464),(637,'kalau input q = 25, hasilnya terlalu besar walaupun pakai long long, apakah perlu dimod?','Tidak perlu. Untuk input besar, tim panitia sudah memastikan bahwa hasil tidak akan lebih besar dari int64. Terima kasih','13:16:19','13:17:49',22,624,456),(638,'mau tanya kak...itu yang a itu area yang terbentuk dari 2 kotak yang hadapnya diagonal apakah juga dihitung','Selamat siang. Maaf, untuk itu silahkan dibaca dengan teliti lagi di soal, karena hal tersebut sudah tercantum di soal. Terima kasih','13:19:44','13:25:40',22,640,449),(639,'maksudnya sudah Main.java tapi masih error min','Maaf, untuk itu kami sudah melakukan pengecekan dan tidak menemukan masalah. Kami compile menggunakan program anda, dengan compiler yang sama dengan yang digunakan untuk judge tidak terjadi compile error.\r\nMasalah tersebut akan kami pelajari lebih dalam, terima kasih.','13:19:53','13:34:59',22,582,456),(640,'Kalau begitu, apa output jika tidak ada jalur yang sampai tujuan?','outputnya adalah &quot;Andi tidak bisa mengikuti seminar&quot;','13:20:26','13:21:12',22,578,464),(641,'Andi bisa pergi dari X ke Y. Apakah Andi bisa pergi ke arah sebaliknya dari Y ke X?\r\nMisal : 1 ke 2 dan 2 ke 1','Andi bisa pergi kearah sebaliknya. Terima kasih','13:43:15','13:50:08',22,578,464),(642,'Berarti jawaban kami telah ter-accepted?','Belum. Meskipun dapat dicompile, namun saat dilihat manual jawaban tersebut salah. Terima kasih','13:46:07','13:50:24',22,582,456),(643,'Berarti jawaban kami telah ter-accepted?','','13:46:07','13:50:26',22,582,456),(644,'Itu Input dari soalnya yang input pertama yang \r\n3 10 5\r\n10 20 30\r\n5 10 20 \r\nKalo di cek sama outputnya kok aneh ya, tapi kalo dijadiin \r\n3 5 5 baru memenuhi outputnya 325','Selamat siang, kami mohon maaf tim Terpsyduck, panitia tidak dapat memberikan jawaban terhadap itu, karena jawaban tersebut akan menjadi clue tambahan yang membantu tim. Yang dapat kami beritahukan, input output tersebut sudah benar. Terima kasih','13:47:03','13:52:04',22,635,455),(645,'apakah yang dimaksud dengan &quot;mengatur project&quot; adalah menentukan mana yang harus dikerjakan seorang pekerja antara project X atau Y? mohon penjelasannya, terimakasih','Iya benar, terima kasih','13:55:34','13:57:54',22,624,455),(646,'Halo ko peliks &gt;,&lt;',NULL,'12:33:15',NULL,NULL,645,519),(647,'srwerersre','ddfghfghfgh','10:38:02','10:38:09',22,645,548),(648,'apakah bilangan prima yang dipakai boleh angka yang sama ?','Mohon maaf, untuk pertanyaan tersebut di soal sudah jelas. Terima kasih','13:09:51','13:14:26',22,623,540),(649,'Kak, apakah jumlah variable yang akan digunakan pada setiap case sama? Bila iya, berapa? Bila tidak, apakah ada batasan? Terima kasih.','Untuk jumlah variable pasti hanya 2, sesuai dengan yang tertera pada contoh input. Terima kasih','13:11:20','13:12:52',22,620,539),(650,'kenapa query IPLC tidak dijalankan di universe ILPC ?','Apabila tim anda mengarah pada penjelasan dari contoh inputnya, penjelasan tersebut adalah salah satu dari sekian banyak opsi yang ada supaya banyak switch adalah 1, yang merupakan nilai minimum. Terima kasih','13:20:00','13:23:25',22,583,546),(651,'Apakah input berupa  &quot;aba&quot; Jawabannya 3 ?','Iya benar. Terima kasih','13:22:04','13:23:38',22,635,541),(652,'apabila input 0 0 0, jawabannya yes ?','Iya benar','13:30:56','13:42:12',22,635,545),(653,'apabila input 0 0 0, jawabannya yes ?','Iya benar','13:36:44','13:42:08',22,635,545),(654,'Kak, nilai bilangan dari A dan B merepresentasikan jumlah apa ya kak? Terima kasih.','Mohon maaf, untuk pertanyaan tersebut di soal sudah jelas. Terima kasih','13:55:07','13:58:22',25,620,543),(655,'apakah ada query yang kembar?\r\n','Query bisa kembar. Terima kasih','13:56:15','13:58:00',22,583,546),(656,'apakah input -1 -2 jawabannya Yes?','Maaf, coba soalnya dibaca lagi dengan baik. Terima kasih','14:00:16','14:03:44',22,635,545),(657,'apakah dapat A = B ? jika bisa bagaimana hasilnya ?','Mohon maaf,\r\nDipastikan A dan B berbeda','14:09:43','14:46:48',25,623,543),(658,'batas T nya berapa?','Untuk soal tersebut, batas T nya adalah 10. Soal akan diupdate, terima kasih','14:18:55','14:24:08',22,618,540),(659,'Jika n=0, apakah outputnya No ?','Untuk n = 0 tidak mungkin, karena sudah tertera pada constrain. Terima kasih','14:19:58','14:24:56',22,635,545),(660,'apakah A mungkin sama dengan B?','Dipastikan A tidak sama denganB. Terima kasih','14:53:13','14:54:22',22,618,543),(661,'apakah jika ada 2 orang ingin dari sekolah A ke B, sementara hanya ada 1 orang ingin dari sekolah B ke A, apakah mereka semua dapat mengikuti pertukaran atau hanya 1 orang dari A ke B dan 1 orang dari B ke A?','apabila terdapat kasus seperti itu, perpindahan yang dilakukan hanya 1 orang dari A ke B dan 1 orang dari B ke A. Terima kasih','15:03:36','15:07:26',22,618,543),(662,'Berapakah output untuk\r\n1\r\n3\r\n1 2\r\n2 1\r\n2 1\r\nTerimakasih :D','apabila terdapat kasus seperti itu, perpindahan yang dilakukan hanya 1 orang dari A ke B dan 1 orang dari B ke A. Terima kasih','15:04:12','15:09:11',22,603,543),(663,'apakah mungkin A=B?','Dipastikan tidak ada input A = B. terima kasih','15:11:14','15:13:09',22,603,543),(664,'panjang string maksimalnya berapa?\r\nTerimakasih','Untuk panjang String maksimal 100. Pada Constrain, 1 &lt;= S &lt;= 100, yang dimaksud adalah 1 &lt;= |S| &lt;= 100. Terima kasih','15:20:30','15:25:06',22,603,546),(665,'apakah yang di copy harus keseluruhan string atau bisa hanya sebagian?','keseluruhan string yang sudah terbentuk. Terima kasih','15:23:59','15:25:06',25,618,541),(666,'apakah dipastikan A dan B kurang dari 100000?','1 &lt;= A,B &lt;= 100000','15:24:31','15:25:43',25,618,543),(667,'apakah kemungkinan variabel hanya dari a sampai z?','Character untuk setiap variable dipastikan a - z. Namun, v