ish setelah mobil Meliza?','','10:28:45','00:00:00',0,163,79),(214,'Si A, si B, si C, si D, dan si E adalah lima orang pembalap. Mereka sedang balapan mobil si suatu sirkuit. Di lap ke-3, A ada di urutan kedua paling belakang . Posisi B kalah dari D, tapi menang dari A. Bila D membalap C tanpa membalap A,B maupun E, maka D akan ada pada posisi pertama, sementara E akan menempati posisi terdepan bila membalap 2 orang. Pada pernyataan-pernyataan berikut ini, manakah yang pasti salah?','','10:29:24','00:00:00',0,163,80),(215,'untuk pilihan yang c itu yang bener 3^25 atau 2^25 kak','soal sudah benar','10:29:36','10:32:57',5,89,74),(216,'Dari soal sebelumnya, bagaimana urutan mereka saat itu jika E membalap satu orang di depannya?','','10:29:45','00:00:00',0,163,81),(217,'Sesudah balapan mobil selesai, kelima pembalap tersebut saling bersalaman lalu masuk ke satu ruangan untuk berpesta. Di dalam ruangan tersebut sudah terdapat 100 orang, yaitu kru-kru dari kelima tim mereka. Di pesta itu setiap orang akan bersalaman dengan setiap orang lainnya. Karena kelima pembalap tersebut sudah bersalaman satu sama lain sebelum pesta, mereka tidak saling bersalaman lagi pada pesta ini, tetapi mereka akan tetap bersalaman dengan para kru. Berapa jumlah salaman yang terjadi di pesta ini?','','10:30:12','00:00:00',0,163,82),(218,'Di tengah pesta tersebut, Si A, si B, si C, si D, dan si E sedang bercakap – cakap dengan salah satu kru. Karena ada beberapa orang yang berbohong, percakapan semakin kacau, lalu kelima orang tersebut mengatakan  pernyataan – pernyataan di bawah ini:\n\nA berkata : B adalah pembohong                                   \n\nB berkata : A lah yang pembohong\n\nC berkata: E dan A sama-sama jujur\n\nD berkata: Akulah yang jujur\n\nE berkata: B dan D sama-sama jujur\n\nSiapa saja yang berbohong jika yang berbohong lebih banyak dari yang jujur?','','10:30:32','00:00:00',0,163,83),(219,'Prisma tegak segitiga ABCDEF memiliki panjang sisi alas AB = x, BC = y, dan CA = z. 