alau iya kapan bisa diberitahu?\r\nterima kasih...','Selamat siang, mohon maaf hasil tryout untuk trial tidak dipublikasikan. Terima kasih :)','15:00:09','15:08:02',22,578,247),(474,'Apakah akan ada pembahasannya setelah selesai ( setelah 16.30 ) ?','Selamat siang, mohon maaf pembahasan soal tidak akan diberikan. Terima kasih :)','15:01:04','15:07:22',22,614,251),(475,'oh ya terima kasih atas jawabannya','sama sama :)','15:10:24','15:14:58',22,578,247),(476,'kalau kunci jawabannya bisa diminta gk selesai try out?','Mohon maaf lagi otmic_icg, kunci jawaban soal trial bersifat rahasia, jadi tidak dapat dipublikasikan. Terima kasih','15:14:23','15:16:05',22,578,247),(477,'Oh ok terima kasih y...','sama sama, selamat berlomba! :)','15:25:01','15:37:18',22,578,247),(478,'Jumlah dari semua bilangan bulat x yang memenuhi persamaan 2log(x2-4x-1) adalah ...\r\napakah maksudnya 2log(x2-4x-1)=0?','Selamat siang anonymous, benar yang dimaksud adalah 2log(x2-4x-1)=0. Di soal akan kami tambahkan, terima kasih.','14:16:09','14:19:19',22,618,277),(479,'1. apakah ketiga digit 0 itu harus berdekatan (000) atau bisa diletakkan sembarang?\r\n2. apakah digit selain ketiga digit 0 itu juga bisa berharga 0?\r\n\r\nterima kasih.','1. Digit 0 bisa diletakkan sembarang.\r\n2. Selain ketiga digit 0 tersebut tidak dapat berharga 0.','14:24:52','14:31:09',22,624,283),(480,'Assalamualaikum, kak apakah no 15 adakah kesalahan penulisan jawaban? (typo)\r\nTerima kasih','Selamat siang, LAZARUS. Terima kasih atas pemberitahuannya dan maaf atas kesalahan penulisan. Jawaban telah disunting. Terima kasih.','14:28:56','14:42:18',24,605,266),(481,'Serta, tali busur AC yang berjarak 52cm dari O.\r\nJika jari-jari lingkaran adalah 10 cm,\r\n\r\nMungkinkah jarak ke pusat lebih besar dari jari-jari?','Tidak mungkin. Ada kesalahan pengetikan dimana simbol akar tidak muncul. Seharusnya 5 akar 2.  Terima kasih','14:29:04','14:37:26',22,618,278),(482,'Pembulatan ke mana?','Selamat siang, anonymous. Pembulatan men