da merasa tidak ada, coba refresh terlebih dahulu karena memang ada kesalahan 15 menit lalu. Namun, sudah direvisi.  Terima kasih.','14:56:29','15:01:03',24,604,261),(494,'kak, soalnya salah, bagaimana mungkin lingkaran dengan jari jari 10 cm bisa memiliki jarak antar titik pusat dan tali busur sejauh 52 cm???','Karena ada kesalahan teknis, simbol akar pada tidak muncul. Seharusnya tali busur sejauh 5 akar 2 cm. Terima kasih','14:57:41','15:04:01',22,620,278),(495,'substring(w), apakah sama dengan substring(w,w)?','substring(w) berarti substring mulai dari index ke w(inclusive) hingga index terakhir sebuah string. Terima kasih','15:03:22','15:05:43',22,625,267),(496,'apakah program menggunakan library string pada bahasa java? (substring)\r\n','iya benar, program menggunakan library string pada bahasa java. Terima kasih','15:05:54','15:08:20',22,628,267),(497,'&quot;Serta, tali busur AC yang berjarak 52cm dari O&quot;, apakah terjadi esalahan pengetikan ? karena jari jarinya hanya 10 cm pada soal','Karena ada kesalahan teknis, simbol akar pada tidak muncul. Seharusnya tali busur sejauh 5 akar 2 cm. Terima kasih\r\n\r\n','15:07:54','15:10:21',22,623,278),(498,'kak mau tanya maksud kalimatnya nomor 21 gimana?\r\n\r\n&quot;Bila seorang mahasiswa dipilih secara acak, cari peluangnya bahwa [ seseorang yang mengambil kuliah teknik informatika mengambil matakuliah teknik informatika, multimedia dan sistem informasi] ?&quot;','Selamat siang toolkit, Soal sudah benar, silahkan dipahami kembali soalnya. Terima Kasih :)','15:09:24','15:10:07',23,595,272),(499,'Revisinya dimananya ya min?','Selamat siang, anonymous. Coba refresh terlebih dahulu. Terima kasih.','15:10:40','15:11:44',24,618,284),(500,'orang kedua membeli ... &quot;setengah telur&quot;. maksud dari setengah telur apa kan tidak ada telur yang pecah?','Selamat siang, otmic_icg. Memang benar tidak ada telur yang pecah. Coba pahami soal lebih baik. Terima kasih.','15:20:43','15:28:35',24,578,264),(501,'Segitiga KCL?','Soal sudah direvisi. Silahkan direfresh terlebih dahulu','15:22:16','15:29:49',22,626,274),(502,'Pada soal tertera &quot;Terdapat titik P dan Q&quot;, Namun yang diketahui keliling segitiga KCL dan yang ditanyakan segitiga AKL.\r\n\r\nApakah K=P dan L=Q? atau bagaimana?','Soal sudah direvisi. Silahkan direfresh terlebih dahulu','15:23:04','15:29:51',22,625,274),(503,'kan ada diketahui KCL, nah L-nya dari mana? ','Soal sudah direvisi. Silahkan direfresh terlebih dahulu','15:26:05','15:29:53',22,617,274),(504,'yang pada segmen BC dan DC itu P dan Q atau K dan L','Soal sudah direvisi. Silahkan direfresh terlebih dahulu','15:26:30','15:29:57',22,592,274),(505,'jawaban yang kami dapat 3744 tapi dipilihan jawabannya tidak ada, adanya 3774 tolong di cek ulang. thxx:)','Soal sudah direvisi. Silahkan direfresh terlebih dahulu','15:27:57','15:30:15',22,617,266),(506,'Apakah meja dianggap identik?','benar, meja dianggap identik','15:29:34','15:30:48',22,625,282),(507,'Apakah pilihan sudah benar?','Pilihan sudah benar. Terima kasih','15:31:29','16:23:10',22,618,257),(508,'ada revisi tidak ya min?','Silahkan direfresh ya, terima kasih.','15:37:59','15:47:08',22,618,269),(509,'kak primes length nya berapa?','penjelasan mengenai length itu apa sudah ditambahkan pada soal. Silahkan direfresh, terima kasih','15:44:10','15:47:24',22,595,269),(510,'apakah segitiga harus satu warna?\r\napakah refresh soal akan menghilangkan jawaban yg sudah diisi?','Selamat siang, Quick Mafs. Segitiga tidak harus satu warna. Warna hanya untuk membantu saja. Refresh soal tidak akan menghilangkan jawaban yang sudah diisi. Terima kasih.','15:45:16','15:59:10',24,626,253),(511,'apakah tidak terjadi kesalahan pengetikan pada nilai N ?','Soal sudah direvisi. Terima kasih','15:45:44','15:48:08',22,623,269),(512,'&quot;Jumlah kuardat 3 bilangan&quot;\r\nberarti\r\n(a + b + c)^2\r\natau a^2 + b^2 + c^2?\r\n','(a+b+c)^2. Terima kasih','15:47:23','15:49:35',22,628,284),(513,'apakah ada ralat soal atau ralat jawaban dari semua soal','Silahkan direfresh untuk ralat soal maupun jawaban. Terima kasih','15:50:56','15:51:37',22,641,252),(514,'Diketahui a1,a2,a3, … , an adalah bilangan bulat yang membentuk barisan aritmatika. Nilai dari  a1 + a2 + a3 + a4 + a5 = 680. Misal beda barisan tersebut adalah x dimana x adalah jumlah kuadrat 3 bilangan ganjil berurutan. Diketahui hasil kali ketiga bilangan sama dengan 7 kali jumlah ketiga bilangan tersebut. Berapakah nilai dari a1?\r\n\r\nApa ini sudah direvisi? ','Sudah. Yang direvisi adalah bagian kata &quot;jumlah kuadrat&quot;. diganti menjadi &quot;kuadrat jumlah&quot;. Terima kasih','15:51:33','15:52:38',22,618,284),(515,'Apakah soal sudah benar? Mohon di cek kembali. ','Ada revisi jawaban pada soal tersebut. Silahkan direfresh, terima kasih','15:52:00','15:53:12',22,625,269),(516,'Maaf, apakah jawaban soal nomor 3 ada yang salah?','Soal nomor 3 sudah benar. Terima kasih','16:03:30','16:24:38',22,611,254),(517,'Apakah soal sudah benar? mohon di cek kembali. Terimakasih','Setelah kami lakukan pengecekan ulang, untuk soal tersebut sudah benar. Terima kasih','16:08:57','16:11:39',22,625,283),(518,'Apakah pilihan sudah benar?','PIlihan sudah benar. Terima kasih','16:12:43','16:23:15',22,618,257),(519,'saya sudah menghitung dengan rumus yang benar namun tidak menemukan jawaban yang saya temukan, apakah ada kesalahan atau tidak  ','Selamat sore, ASTAROTH THE SIX. Tidak ada kesalahan, baik pada soal maupun pada jawaban. Coba baca dan pahami soal lebih baik. Terima kasih.','16:16:42','16:27:47',24,606,283),(520,'apakah babak ini menggunakan sistem minus?','Selamat sore, Quick Mafs. Iya, babak ini menggunakan sistem minus. Panitia telah menuliskannya pada peraturan. Terima kasih.','16:22:45','16:25:30',24,626,252),(521,'Pada soal tertera &quot;(kecuali yang 0 tsb)&quot;\r\n\r\nBerarti digit 0 boleh muncul sebanyak lebih dari 4 kali?','Selamat sore, LUSlovers. Tidak, digit 0 hanya boleh muncul sebanyak 3 kali. Terima kasih.','16:24:40','16:26:38',24,625,283),(522,'Apakah untuk jawaban D yang 3774 benar atau ada kesalahan ketik ?','Selamat sore, HUMAN ERROR. Jawaban sudah direvisi. Coba refresh terlebih dahulu. Terima kasih.','16:27:13','16:28:15',24,586,266);
