files/a9afcf46f2e564783bdec97683c0372e.out',1,'Gabriella Aaron',111),(278,'A','Berlipat-Lipat','<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">Setelah absen di babak penyisihan dan semifinal ILPC 2015, Ababil kembali untuk menantang para peserta ILPC di babak final programming. Kali ini, Ababil ingin meminta para peserta untuk menyelesaikan tantangan yang dinamakan &ldquo;ILPC Berlipat-lipat&rdquo;. Dalam tantangan ini, anda akan diberikan sebuah kata S dengan panjang N (1 &lt;= N &lt;= 15000). S hanya dapat mempunyai 4 macam karakter, yaitu I, L, P dan C (ya iyalah, apalagi sih?). Anda harus mencari semua sub-kata sepanjang K (1&lt;= K &lt;= 10) yang muncul lebih dari sekali dalam S. Sebagai contoh, apabila anda diberikan S = &ldquo;<span style=\"color: #333333;\">CCCCCPPPPPCCCCCPPPPPPCCCCC&rdquo; dan K=10, maka ada dua sub-kata dengan panjang 10 yang muncul lebih dari sekali dalam N, yaitu &ldquo;CCCCCPPPPP&rdquo; dan &ldquo;PPPPPCCCCC&rdquo;.</span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Input</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Baris pertama input akan berisi sebuah bilangan T (1 &lt;= T &lt;= 20) yang berisi jumlah kasus uji. Dalam setiap kasus uji, baris pertama akan berisi dua bilangan N dan K dan baris kedua akan berisi satu kata S seperti dijelaskan diatas.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Output</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Untuk setiap kasus uji, pada baris pertama tuliskan &ldquo;Case X: Y&rdquo;, dimana X merupakan nomor kasus uji dan Y merupakan jumlah sub-kata yang muncul lebih dari sekali. Pada baris berikutnya, tuliskan Y bilangan bulat dipisahkan dengan </span><span style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333; mso-ansi-language: IN;\">sebuah </span><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">spasi yang menyatakan indeks pertama kemunculan setiap subkata (indeks dimulai dari 0). Indeks-indeks ini diurutkan sesuai dengan urutan kemunculan kedua kali (akan dijelaskan lebih lanjut di contoh output).</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Contoh Input 1</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">1</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">26 10</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">CCCCCPPPPPCCCCCPPPPPPCCCCC</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Contoh Output 1</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Case 1: 2</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">0 5</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">Contoh Input 2</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\'\'\'; mso-bidi-font-family: FreeSans; color: #333333;\">2</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-family: \'\'\'\'\'\'\'\'Courier New\'\'\'\'\'\