justify;\"><span style=\"font-size: 12pt;\"><a class=\"short-url\" href=\"http://bit.ly/1Z6ZRXc\">bit.ly/1Z6ZRXc</a></span></p>','asset/input_files/80254db3b8081ebb6304ab5f24e94aff.in','asset/output_files/528bb5db3103330f1ed329914c532743.out',1,'Alvin Piter',115),(292,'C','Alan 2','<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\';\">Alan membeli <em>N</em></span><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\"> buah baju yang dilengkapi dengan nomor punggung yang berbeda satu sama lain. Baju diberi nomor dari 1 sampai <em>N</em>. Kemudian Alan memberikan <em>N</em> baju tersebut kepada <em>N</em> orang anaknya. Anak yang lebih tinggi mendapat baju dengan nomor punggung lebih besar.</span><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\';\"> &nbsp;Setelah itu, Alan mengajukan <em>Q </em></span><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">pertanyaan kepada Anda. Setiap pertanyaan berbunyi seperti ini: &ldquo;<em>Berapakah nomor punggung anak yang memiliki tinggi</em></span><em><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\';\"> &nbsp;X</span></em><span style=\"font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">?&rdquo;.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat<em> N (1 &lt;= N &lt;= 10<sup>5</sup>)</em> - banyak anak Alan. N baris berikutnya masing &ndash; masing berisi bilangan bulat <em>H<sub>i</sub> (1 &lt;= H<sub>i</sub> &lt;= 10<sup>9</sup>)</em> &ndash; tinggi anak yang memiliki nomor punggung <em>i (1 &lt;= i &lt;= N)</em>. Tidak ada 2 orang anak yang memiliki tinggi yang sama. Baris <em>N + 2&nbsp;</em>berisi bilangan bulat <em>Q (1 &lt;= Q &lt;= 10<sup>5</sup>)</em> - banyak pertanyaan Alan. <em>Q</em> baris berikutnya masing &ndash; masing berisi bilangan bulat <em>X (1 &lt;= X &lt;= 10<sup>9</sup>).</em> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap pertanyaan, output dalam satu baris nomor punggung anak dengan tinggi <em>X</em>. Jika tidak ada anak yang memiliki tinggi <em>X</em>, output &ldquo;-1&rdquo; (tanpa tanda petik).</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Contoh Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">6</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1 </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">7 </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">8 </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">12 </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">13 </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">15</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">12</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">15</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">22</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Contoh Output</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">4</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">6</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">-1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Penjelasan </span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat 6 orang anak. Anak bernomor punggung 1 memiliki tinggi 1, anak bernomor punggung 2 memiliki tinggi 7, anak bernomor punggung 3 memiliki tinggi 8, dst.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Alan menanyakan 3 pertanyaan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Anak dengan tinggi 12 memiliki nomor punggung 4.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Anak dengan tinggi 15 memiliki nomor punggung 6.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tidak ada anak dengan tinggi 22.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong style=\"font-size: 18.6667px;\"><span style=\"line-height: 115%;\">Hint</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><a class=\"short-url\" href=\"http://bit.ly/1RjLCiQ\">bit.ly/1RjLCiQ</a><strong style=\"font-size: 18.6667px;\"><span style=\"line-height: 115%;\"><br /></span></strong></span></p>','asset/input_files/4a17a99d57023267e414f469064f1aaf.in','asset/output_files/919bf574f58cabbfbfe135a8d982d7f8.out',1,'Alvin Piter',115),(293,'D','Jake','<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Jake adalah seorang murid SMA dengan penyakit malas akut. Jake baru saja mengikuti <em>N</em> ujian untuk <em>N</em> mata pelajaran berbeda. Anggap mata pelajaran diberi nomor 1 sampai <em>N</em>. Jake tahu secara pasti nilai yang dia dapatkan di setiap ujian yang dia ikuti. Jake menganggap dirinya lulus dari sebuah mata pelajaran apabila nilai yang dia dapatkan lebih besar atau sama dengan nilai minimum yang ditentukan oleh gurunya. Selain itu, Jake menganggap dirinya sukses jika jumlah mata pelajaran yang dinyatakan lulus lebih besar atau sama dengan jumlah mata pelajaran yang dinyatakan tidak lulus. Jake bahkan malas untuk menentukan nasibnya sendiri, sehingga dia meminta bantuan Anda.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat <em>T (1 &lt;= T &lt;= 30)</em> &ndash; banyak kasus uji. Setiap kasus uji terdiri dari 3 baris. Baris pertama adalah bilangan bulat <em>N (1 &lt;= N &lt;= 100)</em> &ndash; banyak mata pelajaran. Baris berikutnya berisi N bilangan bulat <em>U<sub>i</sub> (1 &lt;= U<sub>i</sub> &lt;= 100)</em> &ndash; nilai yang diperoleh Jake untuk mata pelajaran <em>i (1 &lt;= i &lt;= N)</em>. Baris berikutnya berisi <em>N</em> bilangan bulat <em>M<sub>i</sub> (1 &lt;= M<sub>i</sub> &lt;= 100)</em> &ndash; nilai minimum agar murid dinyatakan lulus untuk mata pelajaran <em>i (1 &lt;= i &lt;= N)</em>.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris kata &ldquo;SUKSES&rdquo; (tanpa tanda petik) jika Jake menganggap dirinya sukses, dan &ldquo;GAGAL&rdquo; (tanpa tanda petik) jika Jake menganggap dirinya gagal.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Contoh Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">4 4 5</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">4 9 9</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">4</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">9 9 1 1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2 3 9 9</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Contoh Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">GAGAL</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">SUKSES</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Penjelasan</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Kasus p