na, sans-serif;\">.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"font-family: Verdana, sans-serif;\">Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"font-family: Verdana, sans-serif;\">Pada baris pertama terdapat bilangan bulat</span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;<em>T ( 1 &lt;= T &lt;= 1000)</em>&nbsp;</span><span style=\"font-family: Verdana, sans-serif;\">&ndash; banyak kasus uji. Setiap kasus uji terdiri dari 1 baris yang berisi bilangan</span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;<em>N (1 &lt;= N &lt;= 10<sup>18</sup>)</em></span><span style=\"font-family: Verdana, sans-serif;\">. Perhatikan bahwa nilai</span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;<em>N</em>&nbsp;</span><span style=\"font-family: Verdana, sans-serif;\">sangat besar, gunakan tipe data yang tepat.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; font-family: Verdana, sans-serif;\">Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"font-family: Verdana, sans-serif;\">Untuk setiap kasus uji, output dalam satu baris bilangan bulat terbesar x sehingga</span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;<em>x<sup>5</sup>&lt;= N</em></span><span style=\"font-family: Verdana, sans-serif;\">.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; font-family: Verdana, sans-serif;\">Contoh Input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">32</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">200000</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"font-family: Verdana, sans-serif;\">Contoh Output</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">11</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; font-family: Verdana, sans-serif;\">Penjelasan</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"font-family: Verdana, sans-serif;\">Kasus uji pertama: 2<sup>5</sup></span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;</span><span style=\"font-family: Verdana, sans-serif;\">&lt;= 32</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"font-family: Verdana, sans-serif;\">Kasus uji kedua: 11<sup>5</sup></span><span style=\"font-family: Verdana, sans-serif;\">&nbsp;</span><span style=\"font-family: Verdana, sans-serif;\">&lt;= 200000</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"font-family: Verdana, sans-serif;\">Hint</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">3982<sup>5</sup>&nbsp;&gt; 10<sup>18</sup></span><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>','asset/input_files/2230007dc0f126c3a8b3235f8f699462.in','asset/output_files/728f91c1d3ba3bdc7a4db1519974e0f4.out',1,'Alvin Piter',119),(309,'D','Alan 2','<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Alan membeli&nbsp;<em>N</em>&nbsp;buah baju yang dilengkapi dengan nomor punggung yang berbeda satu sama lain. Baju diberi nomor dari 1 sampai&nbsp;<em>N</em>. Kemudian Alan memberikan&nbsp;<em>N</em>&nbsp;baju tersebut kepada&nbsp;<em>N</em>&nbsp;orang anaknya. Anak yang lebih tinggi mendapat baju dengan nomor punggung lebih besar.&nbsp;&nbsp;Setelah itu, Alan mengajukan&nbsp;<em>Q&nbsp;</em>pertanyaan kepada Anda. Setiap pertanyaan berbunyi seperti ini: &ldquo;<em>Berapakah nomor punggung anak yang memiliki tinggi</em><em>&nbsp;&nbsp;X</em>?&rdquo;.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat<em>&nbsp;N (1 &lt;= N &lt;= 10<sup>5</sup>)</em>&nbsp;- banyak anak Alan. N baris berikutnya masing &ndash; masing berisi bilangan bulat&nbsp;<em>H<sub>i</sub>&nbsp;(1 &lt;= H<sub>i</sub>&nbsp;&lt;= 10<sup>9</sup>)</em>&nbsp;&ndash; tinggi anak yang memiliki nomor punggung&nbsp;<em>i (1 &lt;= i &lt;= N)</em>. Tidak ada 2 orang anak yang memiliki tinggi yang sama dan tinggi anak terurut dari kecil ke besar. Baris&nbsp;<em>N + 2&nbsp;</em>berisi bilangan bulat&nbsp;<em>Q (1 &lt;= Q &lt;= 10<sup>5</sup>)</em>&nbsp;- banyak pertanyaan Alan.&nbsp;<em>Q</em>&nbsp;baris berikutnya masing &ndash; masing berisi bilangan bulat&nbsp;<em>X (1 &lt;= X &lt;= 10<sup>9</sup>).</em></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt; line-height: 115%;\">Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap pertanyaan, output dalam satu baris nomor punggung anak dengan tinggi&nbsp;<em>X</em>. Jika tidak ada anak yang memiliki tinggi&nbsp;<em>X</em>, output &ldquo;-1&rdquo; (tanpa tanda petik).</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Contoh Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">6</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">7</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">8</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">12</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">13</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">15</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">12</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">15</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">22</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Contoh Output</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">4</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">6</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">-1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%;\">Penjelasan</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat 6 orang anak. Anak bernomor punggung 1 memiliki tinggi 1 satuan, anak bernomor punggung 2 memiliki tinggi 7 satuan, anak bernomor punggung 3 memiliki tinggi 8 satuan, dst.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Alan menanyakan 3 pertanyaan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Anak dengan tinggi 12 memiliki nomor punggung 4.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Anak dengan tinggi 15 memiliki nomor punggung 6.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tidak ada anak dengan tinggi 22.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong style=\"font-size: 18.6667px;\"><span style=\"line-height: 115%;\">Hint</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><a class=\"short-url\" href=\"http://bit.ly/1RjLCiQ\">bit.ly/1RjLCiQ</a></span></p>','asset/input_files/c4cd3214730da2df14803c3315c8724c.in','asset/output_files/33d0edc182c8e85414e80c2c3cf9a2a5.out',1,'Alvin Piter',119),(310,'A','Alan 3','<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowP