se\" Name=\"Colorful List Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Alan memiliki <em>N</em> orang anak. Semua anaknya membentuk sebuah barisan dari kiri ke kanan. Anak-anak dinomori secara berurut dari 1 sampai <em>N</em>, anak paling kiri diberi nomor 1 dan anak paling kanan diberi nomor <em>N</em>. Alan akan menanyakan <em>Q</em> pertanyaan kepada Anda. Setiap pertanyaan berbunyi seperti ini: <em>&ldquo;Berapakah jumlah tinggi anak-anak yang memiliki nomor L sampai nomor R?&rdquo; </em></span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 14pt;\">Input</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat <em>N (1 &lt;= N &lt;= 10<sup>5</sup>)</em> &ndash; banyak anak Alan. Baris kedua berisi N bilangan bulat <em>H<sub>i</sub> (1 &lt;= H<sub>i</sub> &lt;= 10<sup>9</sup>)</em> &ndash; tinggi anak ke-<em>i</em> <em>(1 &lt;= i &lt;= N)</em>. &nbsp;Baris ketiga berisi bilangan bulat <em>Q (1 &lt;= Q &lt;= 10<sup>5</sup>)</em> &ndash; banyak pertanyaan Alan. &nbsp;<em>Q</em> baris berikutnya masing &ndash; masing berisi dua bilangan bulat<em> L</em> dan <em>R</em> <em>(1 &lt;= L &lt;= R &lt;= 10<sup>5</sup>)</em>. </span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 14pt;\">Output</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Untuk setiap pertanyaan, output dalam satu baris jumlah tinggi anak nomor <em>L</em> sampai nomor <em>R</em>.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">5</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">1 2 3 4 5</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">1 2</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">2 2</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">1 5</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">15</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Alan memiliki 3 orang anak yang masing &ndash; masing tingginya 1,2,3,4 dan 5 satuan. Alan menanyakan 3 pertanyaan. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Jumlah tinggi anak nomor 1 sampai 2 adalah 1 + 2 = 3 satuan.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Jumlah tinggi anak nomor 2 sampai 2 adalah 2 satuan.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Jumlah tinggi anak nomor 1 sampai 5 adalah 1 + 2 + 3 + 4 + 5 = 15 satuan.</span></p>','asset/input_files/b3659269ed499cfa6d0d4accdd5e1714.in','asset/output_files/8f94a4be1a49f058e33a80fd13823703.out',1,'AP',120),(311,'B','Dadu','<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n