e\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada bulan Januari 2016, John mendapat kesempatan untuk mengunjungi Amerika Serikat. Di salah satu kota di AS, John menemukan sebuah <em>vending machine</em> yang menjual minuman. Setelah beberapa kali melakukan transaksi, John mendapati bahwa <em>vending machine</em> tersebut selalu memberikan kembalian dalam bentuk koin yang bernominal 1$ (1$ = 100 sen), 20 sen, 5 sen atau 1 sen. Tidak hanya itu, <em>vending machine</em> juga memberikan kembalian dengan jumlah koin yang minimal. Sebagai contoh, John membeli sebotol minuman berharga 3.11$ dengan memasukkan uang sebesar 6.67$, maka vending machine tersebut akan mengembalikan 3 buah koin 1$, 2 buah koin 20 sen, 3 buah koin 5 sen dan sebuah koin 1 sen. John tertarik untuk membuat ulang sebuah vending machine seperti itu, dan meminta bantuan Anda sebagai calon penerima hadiah utama ILPC 2016 untuk membuat program yang dapat mengeluarkan output berupa jumlah koin minimal yang merupakan uang kembalian dari transaksi vending machine.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat <em>T (1 &lt;= T &lt;= 100)</em> &ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat <em>A</em> dan <em>B</em> <em>(1 &lt;= B &lt;= A &lt;= 1000)</em> &ndash; nominal yang dibayar oleh John dan harga minuman.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris jumlah koin kembalian minimal yang akan diterima John. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">999 111</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">481 123</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Contoh Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">16</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">11</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada kasus pertama, John akan menerima kembalian sebesar 999 &ndash; 111 = 888 sen. John akan menerima 8 buah koin 100 sen, 4 buah koin 20 sen, sebuah koin 5 sen dan 3 buah koin 1 sen.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada kasus kedua, John akan menerima kembalian sebesar 481 &ndash; 123 = 358 sen. John akan menerima 3 buah koin 100 sen, 2 buah koin 20 sen, 3 buah koin 5 sen dan 3 buah koin 3 sen.</span></p>','asset/input_files/9016367d09efc763a4c08c02a9394c3b.in','asset/output_files/241ddd9dceeacc44bf6b295a0caf7793.out',1,'E',120),(313,'D','Lampu','<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakCon