hulu. Jika setiap soal yang dikerjakan dengan benar mendapat 1 poin, berapakah poin maksimal yang dapat diperoleh Sheldon?</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Pada baris pertama terdapat bilangan bulat <em>T (1 &lt;= T &lt;= 10)</em> - banyak kasus uji. Setiap kasus uji terdiri dari 2 baris. Baris pertama adalah bilangan bulat <em>N (1 &lt;= N &lt;= 100) </em></span><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">dan <em>W (1 &lt;= W &lt;= 10000)</em> - banyak soal dan batas waktu pengerjaan. Baris berikutnya terdapat <em>N</em> buah bilangan bulat <em>Ti (1 &lt;= Ti &lt;= 100)</em> - waktu yang dibutuhkan untuk mengerjakan soal ke-<em>i</em> <em>(1 &lt;= i &lt;= N)</em>.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Output</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">Untuk setiap kasus, output dalam satu baris sebuah bilangan yang menyatakan poin maksimal yang dapat diperoleh Sheldon.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Contoh Input</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">4 10</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">1 4 2 3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">4 7</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">4 2 3 4</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Contoh Output</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">4</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong><span style=\"line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">Penjelasan</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">Pada kasus uji pertama terdapat 4 soal yang harus dikerjakan dalam 10 menit. Sheldon dapat menyelesaikan semua soal dalam waktu 1 + 4 + 2 + 3 = 10 menit. Total nilai yang diperoleh adalah 4.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">Pada kasus uji kedua terdapat 4 soal yang harus dikerjakan dalam 7 menit. Sheldon dapat mengerjakan soal ke-2 dan soal ke-4 dalam 6 menit. Total nilai yang diperoleh adalah 2 poin.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\';\">&nbsp;</span></p>','asset/input_files/6423409b7b58de62ca56b9c4031b1e89.in','asset/output_files/1f49fcb17158aed1efbb9a14427c0c7e.out',1,'A',120),(315,'F','Stewie dan Palindrom','<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocum