ty=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Stewie adalah seorang balita jenius berusia 1 tahun dari pasangan Peter dan Lois Griffin. Meskipun usianya masih 1 tahun, Stewie sudah membuat banyak penemuan yang dapat mengubah dunia. Beberapa penemuannya yang paling terkenal antara lain adalah <em>Mind Control Device</em>, <em>Freeze Gun</em>, dan <em>Particle Transportation Device</em>. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Saat ini Stewie ingin membuat sebuah alat yang dapat membuat palindrom dari suatu kata dengan cara mengubah susunan huruf pada kata tersebut. Palindrom adalah sebuah kata yang dapat dibaca dengan sama baik dari depan maupun belakang, contohnya: &ldquo;TAAT&rdquo;, &ldquo;ANNA&rdquo;,dll. Stewie sadar tidak semua kata dapat diubah menjadi palindrom. Bantulah Stewie menentukan apakah suatu kata dapat diubah menjadi palindrom atau tidak. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat <em>T (1 &lt;= T &lt;= 100)</em> &ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi kata yang dimiliki Stewie. Dijamin kata ini hanya terdiri dari huruf alfabet kapital (A..Z). Panjang kata berada pada rentang 1 sampai 1000.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris angka &ldquo;1&rdquo; (tanpa tanda petik) jika Stewie dapat membuat palindrom dari kata tersebut, dan angka &ldquo;0&rdquo; (tanpa tanda petik) jika Stewie tidak dapat membuat palindrom dari kata tersebut.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Contoh Input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">MAMA</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">ABC</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">0</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk kasus pertama, Stewie dapat mengubah kata \"MAMA\" menjadi palindrom &ldquo;MAAM&rdquo; atau &ldquo;AMMA&rdquo;.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk kasus kedua, Stewie tidak dapat membuat palindrom dari kata \"ABC\".<br /></span></p>','asset/input_files/4a13366dfc7a882e02f52c7e00455e36.in','asset/output_files/b0059fe310c03ccd3c51d7d90c550c4e.out',1,'A',120),(316,'G','Gym','<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--></p>\r\n<p style=\"text-align: justify;\"><!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"true\"\r\n  DefSemiHidden=\"true\" DefQFormat=\"false\" DefPriority=\"99\"\r\n  LatentStyleCount=\"267\">\r\n  <w:LsdException Locked=\"false\" Priorit