 Locked=\"false\" Priority=\"68\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium Grid 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"69\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Medium Grid 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"70\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Dark List Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"71\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Shading Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"72\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful List Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di tahun 2016 Megan ingin memulai kebiasaan hidup sehat. Langkah pertama yang dia lakukan adalah berlangganan di salah satu <em>gym</em> dekat rumahnya. Salah satu masalah yang dihadapi Megan di <em>gym</em> adalah bagaimana cara membagi beban secara tepat. Megan ingin membagi beban&ndash;beban yang tersedia menjadi dua bagian. Bagian pertama akan digunakan untuk melatih otot tangan kanan, sedangkan bagian kedua untuk melatih otot tangan kiri. Bantulah Megan menghitung selisih berat beban minimal untuk tangan kiri dan kanannya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat <em>T (1 &lt;= T &lt;= 50)</em> &ndash; banyak kasus uji. Setiap kasus uji terdiri dari dua baris. Baris pertama adalah bilangan bulat <em>N (2 &lt;= N &lt;= 20)</em> &ndash; banyak beban yang tersedia. Pada baris kedua terdapat <em>N</em> bilangan bulat <em>W<sub>i</sub> (1 &lt;= W<sub>i</sub> &lt;= 100)</em> &ndash; berat beban ke-i <em>(1 &lt;= i &lt;= N)</em>.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris bilangan yang menyatakan selisih berat beban minimal untuk tangan kiri dan kanan Megan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1 2 3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">0</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat 3 beban dengan berat masing&ndash;masing 1 satuan,2 satuan dan 3 satuan. Megan dapat mengangkat beban 3 di tangan kiri dan beban 1 dan 2 di tangan kanan. Tangan kiri dan kanan masing&ndash;masing memiliki total berat 3 satuan, sehingga selisihnya adalah 0.</span></p>','asset/input_files/b2b3f61172ad28a319f25ecc52ff0ad6.in','asset/output_files/b08c52570dc6a91a1811909cfd8a4709.out',1,'A',120),(317,'A','S','<p>Z</p>','asset/input_files/da2ca88a71583b31718b60f21a71204a.in','asset/output_files/4237ce7e944f7b619a6010cad89cb768.out',1,'A',121),(318,'A','Dadu','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Upin dan Ipin lagi-lagi berebut sepotong ayam goreng! Celakanya kakak mereka, Ros, sedang sibuk sehingga tidak bisa membagi ayam goreng tersebut dengan adil. Upin dan Ipin setuju untuk menyelesaikan masalah ini dengan cara mengocok 7 buah dadu. Setiap dadu berbentuk kubus yang setiap sisinya diberi angka berbeda dari 1 sampai 6. Upin akan bertaruh menggunakan angka&nbsp;<em>N</em>. Jika jumlah mata dadu yang keluar adalah&nbsp;<em>N</em>, maka ayam goreng tersebut akan menjadi milik Upin. Jika jumlah mata dadu yang keluar bukan&nbsp;<em>N</em>, maka ayam goreng tersebut akan menjadi milik Ipin. Upin sangat was&ndash;was dengan hasil pengocokan dadu tersebut, sehingga dia tidak dapat menghitung peluang menangnya.&nbsp; Bantulah Upin!<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat&nbsp;<em>T (1 &lt;= T &lt;= 40)</em>&nbsp;&ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan&nbsp;<em>N (7 &lt;= N &lt;= 42)</em>&nbsp;&ndash; total mata dadu yang ditaruhkan oleh Upin.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris peluang Upin mendapat total mata dadu sebesar&nbsp;<em>N</em>. Peluang dinyatakan dalam bentuk pecahan A/B yang paling sederhana. Pecahan A/B dikatakan paling sederhana apabila faktor persekutuan terbesar A dan B sama dengan 1.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">7</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">8</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1/279936</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">7/279936</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Penjelasan</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Banyak ruang sampel pelemparan 7 buah dadu bermata 6 adalah 6<sup>7</sup>&nbsp;= 279936.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk mendapat total mata dadu&nbsp;<em>N = 7</em>, semua dadu harus menunjukkan angka 1.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk mendapat total mata dadu&nbsp;<em>N = 8</em>, salah satu dadu menunjukkan angka 2 dan sisanya menunjukkan angka 1.</span></p>','asset/input_files/a146113f1129a11f99c9290ed8bcf6b5.in','asset/output_files/3560470b98bcc05921e347edbd4c13e1.out',1,'Evin Cintiawan',122),(319,'B','Koin','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada bulan Januari 2016, John mendapat kesempatan untuk mengunjungi Amerika Serikat. Di salah satu kota di AS, John menemukan sebuah&nbsp;<em>vending machine</em>&nbsp;yang menjual minuman. Setelah beberapa kali melakukan transaksi, John mendapati bahwa&nbsp;<em>vending machine</em>&nbsp;tersebut selalu memberikan kembalian dalam bentuk koin yang bernominal 1$ (1$ = 100 sen), 20 sen, 5 sen atau 1 sen. Tidak hanya itu,&nbsp;<em>vending machine</em>&nbsp;juga memberikan kembalian dengan jumlah koin yang minimal. Sebagai contoh, John membeli sebotol minuman berharga 3.11$ dengan memasukkan uang sebesar 6.67$, maka vending machine tersebut akan mengembalikan 3 buah koin 1$, 2 buah koin 20 sen, 3 buah koin 5 sen dan sebuah koin 1 sen. John tertarik untuk membuat ulang sebuah vending machine seperti itu, dan meminta bantuan Anda sebagai calon penerima hadiah utama ILPC 2016 untuk membuat program yang dapat mengeluarkan output berupa jumlah koin minimal yang merupakan uang kembalian dari transaksi vending machine.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat&nbsp;<em>T (1 &lt;= T &lt;= 100)</em>&nbsp;&ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat&nbsp;<em>A</em>&nbsp;dan&nbsp;<em>B</em>&nbsp;<em>(1 &lt;= B &lt;= A &lt;= 1000)</em>&nbsp;&ndash; nominal yang dibayar oleh John dan harga minuman dalam cent.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris jumlah koin kembalian minimal yang akan diterima John.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">999 111</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">481 123</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Contoh Output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">16</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">11</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada kasus pertama, John akan menerima kembalian sebesar 999 &ndash; 111 = 888 sen. John akan menerima 8 buah koin 1$, 4 buah koin 20 sen, sebuah koin 5 sen dan 3 buah koin 1 sen.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada kasus kedua, John akan menerima kembalian sebesar 481 &ndash; 123 = 358 sen. John akan menerima 3 buah koin 1$, 2 buah koin 20 sen, 3 buah koin 5 sen dan 3 buah koin 1 sen.</span></p>','asset/input_files/345d07c4b22d5d048fedafeaae0497af.in','asset/output_files/86390ca736e6f23354a851f4e9a2a963.out',1,'Evin Cintiawan',122),(320,'C','Lampu','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat&nbsp;<em>N</em>&nbsp;buah lampu yang masing &ndash; masing diberi nomor secara unik dari 1 sampai&nbsp;<em>N</em>. Mula &ndash; mula semua lampu dalam keadaan padam. Untuk menyalakan lampu &ndash; lampu tersebut, digunakan&nbsp;<em>N</em>&nbsp;buah saklar yang juga diberi nomor secara unik dari 1 sampai&nbsp;<em>N</em>. &nbsp;Apabila saklar bernomor&nbsp;<em>x</em>&nbsp;ditekan, maka keadaan lampu yang bernomor kelipatan&nbsp;<em>x</em>&nbsp;akan terpengaruh. Jika mula &ndash; mula lampu dalam keadaan padam, lampu akan menyala, begitu pula sebaliknya. Jika Anda menekan masing &ndash; masing saklar sebanyak 1 kali secara berurutan dari saklar 1 sampai N, berapa jumlah lampu yang pada akhirnya dalam kondisi menyala?</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Contoh:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk N = 3, hanya lampu nomor 1 yang dalam keadaan menyala. Penjelasan:</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Keadaan awal lampu = [padam, padam, padam]</span></li>\r\n<li><span style=\"font-size: 12pt;\">Setelah saklar 1 ditekan = [menyala, menyala, menyala]</span></li>\r\n<li><span style=\"font-size: 12pt;\">Setelah saklar 2 ditekan = [menyala, padam, menyala]</span></li>\r\n<li><span style=\"font-size: 12pt;\">Setelah saklar 3 ditekan = [menyala, padam, padam]</span></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat&nbsp;<em>T (1 &lt;= T &lt;= 1000)</em>&nbsp;&ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat&nbsp;<em>N (1 &lt;= N &lt;= 10<sup>6</sup>)</em>&nbsp;&ndash; banyak lampu.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris banyak lampu yang dalam keadaan menyala setelah semua saklar ditekan sekali.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-a