yang harus dikerjakan dalam 10 menit. Sheldon dapat menyelesaikan semua soal dalam waktu 1 + 4 + 2 + 3 = 10 menit. Total nilai yang diperoleh adalah 4.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'; mso-fareast-theme-font: minor-fareast;\">Pada kasus uji kedua terdapat 4 soal yang harus dikerjakan dalam 7 menit. Sheldon dapat mengerjakan soal ke-2 dan soal ke-4 dalam 6 menit. Total nilai yang diperoleh adalah 2 poin.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'Times New Roman\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\',\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'serif\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\';\">&nbsp;</span></p>','asset/input_files/9620c0cee9fec8f5b4329448cd2dfcb6.in','asset/output_files/2a42a34d2d4a854d7144a8aab7eacbef.out',1,'Alvin Piter',122),(323,'F','Gym','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di tahun 2016 Megan ingin memulai kebiasaan hidup sehat. Langkah pertama yang dia lakukan adalah berlangganan di salah satu&nbsp;<em>gym</em>&nbsp;dekat rumahnya. Salah satu masalah yang dihadapi Megan di&nbsp;<em>gym</em>&nbsp;adalah bagaimana cara membagi beban secara tepat. Megan ingin membagi beban&ndash;beban yang tersedia menjadi dua bagian. Bagian pertama akan digunakan untuk melatih otot tangan kanan, sedangkan bagian kedua untuk melatih otot tangan kiri. Bantulah Megan menghitung selisih berat beban minimal untuk tangan kiri dan kanannya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat&nbsp;<em>T (1 &lt;= T &lt;= 50)</em>&nbsp;&ndash; banyak kasus uji. Setiap kasus uji terdiri dari dua baris. Baris pertama adalah bilangan bulat&nbsp;<em>N (2 &lt;= N &lt;= 20)</em>&nbsp;&ndash; banyak beban yang tersedia. Pada baris kedua terdapat&nbsp;<em>N</em>&nbsp;bilangan bulat&nbsp;<em>W<sub>i</sub>&nbsp;(1 &lt;= W<sub>i</sub>&nbsp;&lt;= 100)</em>&nbsp;&ndash; berat beban ke-i&nbsp;<em>(1 &lt;= i &lt;= N)</em>.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris bilangan yang menyatakan selisih berat beban minimal untuk tangan kiri dan kanan Megan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1 2 3</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">0</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat 3 beban dengan berat masing&ndash;masing 1 satuan,2 satuan dan 3 satuan. Megan dapat mengangkat beban 3 di tangan kiri dan beban 1 dan 2 di tangan kanan. Tangan kiri dan kanan masing&ndash;masing memiliki total berat 3 satuan, sehingga selisihnya adalah 0.</span></p>','asset/input_files/2051abe6a353ffe972e2b43ca887d620.in','asset/output_files/2d85abe8b1b9a0da1b7650e5eb56d523.out',1,'Alvin Piter',122),(324,'G','Stewie dan Palindrom','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Stewie adalah seorang balita jenius berusia 1 tahun dari pasangan Peter dan Lois Griffin. Meskipun usianya masih 1 tahun, Stewie sudah membuat banyak penemuan yang dapat mengubah dunia. Beberapa penemuannya yang paling terkenal antara lain adalah&nbsp;<em>Mind Control Device</em>,&nbsp;<em>Freeze Gun</em>, dan&nbsp;<em>Particle Transportation Device</em>.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Saat ini Stewie ingin membuat sebuah alat yang dapat membuat palindrom dari suatu kata dengan cara mengubah susunan huruf pada kata tersebut. Palindrom adalah sebuah kata yang dapat dibaca dengan sama baik dari depan maupun belakang, contohnya: &ldquo;TAAT&rdquo;, &ldquo;ANNA&rdquo;,dll. Stewie sadar tidak semua kata dapat diubah menjadi palindrom. Bantulah Stewie menentukan apakah suatu kata dapat diubah menjadi palindrom atau tidak.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Input</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pada baris pertama terdapat bilangan bulat&nbsp;<em>T (1 &lt;= T &lt;= 100)</em>&nbsp;&ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi kata yang dimiliki Stewie. Dijamin kata ini hanya terdiri dari huruf alfabet kapital (A..Z). Panjang kata berada pada rentang 1 sampai 1000.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk setiap kasus uji, output dalam satu baris angka &ldquo;1&rdquo; (tanpa tanda petik) jika Stewie dapat membuat palindrom dari kata tersebut, dan angka &ldquo;0&rdquo; (tanpa tanda petik) jika Stewie tidak dapat membuat palindrom dari kata tersebut.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong><span style=\"font-size: 14pt;\">Contoh Input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">2<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">MAMA</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">ABC</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Contoh Output</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">0</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 14pt;\"><strong>Penjelasan</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk kasus pertama, Stewie dapat mengubah kata \"MAMA\" menjadi palindrom &ldquo;MAAM&rdquo; atau &ldquo;AMMA&rdquo;.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Untuk kasus kedua, Stewie tidak dapat membuat palindrom dari kata \"ABC\".</span></p>','asset/input_files/955b8cb25942e7d48a18929171d0cc10.in','asset/output_files/4505731657654d09208a4582063b8609.out',1,'Alvin Piter',122),(325,'A','Dadu','<p>z</p>','asset/input_files/b97bbdbdf0e646535519c7eb5e4a5955.in','asset/output_files/22f9ec24def88a6dd3175d31ef86fee2.out',1,'E',123),(326,'B','Koin','<p>z</p>','asset/input_files/7a7628eaaafd10153867433a5d353eb6.in','asset/output_files/e82e82153820933d570167f04a9feea5.out',1,'E',123),(327,'C','Lampu','<p>Z</p>','asset/input_files/b51e09c8913ec8595d66268526fc30d5.in','asset/output_files/4b63b708dbcb2eebb6c2c3e06595299d.out',1,'E',123),(328,'D','Alan 3','<p>Z</p>','asset/input_files/8dccfa77cbc8b49ed2399267d252d12a.in','asset/output_files/20e25403b9117a1a78603c53506c13a2.out',1,'A',123),(329,'E','Sheldon','<p>Z</p>','asset/input_files/7c3e7f76ca047cb52a5e6f9a6c85d6ca.in','asset/output_files/eedd0154f6a6aaf81016b4b93795375a.out',1,'A',123),(330,'F','Stewie dan Palindrom','<p>Z</p>','asset/input_files/4bc346162b4fee47fe0ee1be468b923b.in','asset/output_files/4c1a82b9aa80a1157a87171b6ec2cba3.out',1,'A',123),(331,'G','Gym','<p>Z</p>','asset/input_files/4956482c64eeda2acd3a721ab9a8f2f2.in','asset/output_files/7ca4bac532168c89dbcb6dce7b9d5e1d.out',1,'A',123),(332,'A','Alan 3','<p>Z</p>','asset/input_files/f6eeeda7e5ff21f5de6d4755b9051def.in','asset/output_files/b12b65e94d18e5b54426bbe99743a1e2.out',1,'A',124),(333,'B','Dadu','<p>Z</p>','asset/input_files/3ce864b783da9c4fae