0ffc69325616c00e6a535c3191e.out',1,'ILPC',136),(383,'C','Bioskop','<p>z</p>','asset/input_files/6efc0e6138bb6c7cb70995504d3f8924.in','asset/output_files/10ff7ed03ecab6e8164b72e2e343a257.out',1,'ILPC',136),(384,'D','Bom 1','<p>z</p>','asset/input_files/2dbe2278a555ccb67e690909be238b3e.in','asset/output_files/2ac62090b6f46029e0e20fd4c4fc1318.out',1,'ilpc',136),(385,'E','Bom 2','<p>z</p>','asset/input_files/1c839c46a81c72138174d93a4b6452c9.in','asset/output_files/6f27bb4e8691dcd9d4a9f1820b969b74.out',1,'ILPC',136),(386,'F','Manipulasi Data','<p>z</p>','asset/input_files/713df97ea7ce7e3b10337a142cb1cf1f.in','asset/output_files/8f6951619a0fe7b8f286d957672b983b.out',1,'ILPC',136),(387,'G','Chronos','<p>z</p>','asset/input_files/189c54a3732b63422025aaca5502f437.in','asset/output_files/17d8224ce7231fbb0b8ff8be5dd64007.out',1,'Hendi',136),(388,'A','Smart Lamp','<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">DESKRIPSI</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Prof. F tak henti-hentinya membantu orang lain dengan cara membuat AI yang dapat membantu kehidupan mereka sehari-hari. Kali ini, prof. F akan membuat sebuah lampu hias pintar, dimana lampus hias ini terdiri dari N buah lampu yang akan berkedip-kedip (mati-nyala) dengan suatu pattern tertentu. Namun, karena masih berupa sebuah prototype, lampu ini hanya bisa menyala selama S detik saja. Aturan pattern mati-nyala lampu-lampu tersebut adalah sebagai berikut:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'\'Times New Roman\'\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Sebuah lampu akan menyala pada detik ke S<sub>i</sub> jika lampu di sebelah kiri <strong>dan</strong> kananya juga menyala pada detik ke S<sub>i</sub> &ndash; 1.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'\'Times New Roman\'\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Sebaliknya, sebuah lampu akan mati pada detik ke S<sub>i</sub> apabila lampu di sebelah kiri <strong>atau</strong> kananya mati pada detik ke S<sub>i</sub> &ndash; 1.</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'\'Times New Roman\'\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Untuk lampu yang berada di ujung kanan dan kiri, akan mengikuti lampu terdekat yang berada di samping mereka.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%;\">Bantulah prof. F untuk menentukan kondisi akhir dari lampu hias tersebut (kondisi semua lampu pada detik ke S).</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">INPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Input pertama adalah T (1 &lt;= T &lt;= 1000) yang menyatakan jumlah kasus uji untuk program ini. Untuk setiap kasus uji, input baris pertama adalah N (1 &lt;= N &lt;= 100) yang menyatakan jumlah lampu yang terdapat pada lampu hias tersebut dan S (1 &lt;= S &lt;= 10000) yang menyatakan berapa lama lampu tersebut dapat bertahan hidup, keduanya dipisahkan oleh spasi. Lalu pada baris selanjutnya, inputkan kondisi awal (detik ke 0) lampu-lampu hias tersebut secara berurutan sebanyak N kali, dimana kondisi lampu yang hidup dinyatakan dengan angka 1 dan kondisi lampu yang mati dinyatakan dengan angka 0.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">OUTPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Untuk setiap kasus uji, outputnya adalah kondisi akhir (pada detik ke S) dari semua lampu pada lampu hias tersebut, 1 jika kondisinya nyala dan 0 jika kondisinya mati.</span></p>\r\n<table class=\"MsoTableGrid\" style=\"border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">3 4</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">1 1 1</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">6 2</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">1 0 1 1 0 0</span></p>\r\n</td>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; border-left: none; mso-border-left-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">1 1 1</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">1 0 0 0 0 0</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Penjelasan contoh input dan output:</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Untuk kasus uji pertama, semua lampu akan selalu menyala pada detik keempat karena kondisi awalnya adalah semua lampu menyala.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Untuk kasus uji kedua, </span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: .25in; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'\'Times New Roman\'\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Pada detik pertama: lampu ke-1 akan mati karena lampu di sampingnya yaitu lampu ke-2 juga mati. Sedangkan lampu ke-2 akan nyala karena lampu di sebelah kiri dan kanannya menyala (lampu ke-1 dan ke-3). Untuk lampu ke-3 akan mati karena lampu ke-2 mati meskipun lampu ke-4 menyala. Lampu ke-4 juga akan mati karena lampu ke-5 mati meskipun lampu ke-3 menyala. Untuk lampu ke-5 dan ke-6 juga sama, akan mati pada detik pertama.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: .25in; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; line-height: normal; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'\'Times New Roman\'\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Pada detik kedua: lampu ke-1 akan menyala karena pada detik pertama lampu ke-2 menyala. Untuk lampu ke-2, akan mati karena pada detik pertama lampu ke-1 maupun ke-3 mati. Untuk lampu ke-3, 4, 5, dan 6 akan tetap mati.</span></p>','asset/input_files/739438ee42fcb04e53f2f6f1816b092a.in','asset/output_files/9bf6d6e6a66d137ddd8577827f9a022e.out',1,'Evin Cintiawan',137),(389,'A','Lampu','<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #365f91; mso-themecolor: accent1; mso-themeshade: 191;\">DESKRIPSI</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Terdapat N buah lampu yang masing &ndash; masing diberi nomor secara unik dari 1 sampai N. Mula &ndash; mula semua lampu dalam keadaan padam. Untuk menyalakan lampu &ndash; lampu tersebut, digunakan N buah saklar yang juga diberi nomor secara unik dari 1 sampai N. &nbsp;Apabila saklar bernomor i ditekan, maka keadaan lampu yang bernomor kelipatan i akan terpengaruh. Jika mula &ndash; mula lampu dalam keadaan padam, lampu akan menyala, begitu pula sebaliknya. Jika Anda menekan masing &ndash; masing saklar sebanyak 1 kali, berapa jumlah lampu yang pada akhirnya dalam kondisi menyala? Contoh:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Untuk N = 3, hanya lampu nomor 1 yang dalam keadaan menyala. Penjelasan:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">- Keadaan awal lampu = [padam, padam, padam]</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">- Setelah saklar 1 ditekan = [menyala, menyala, menyala]</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">- Setelah saklar 2 ditekan = [menyala, padam, menyala]</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">- Setelah saklar 3 ditekan = [menyala, padam, padam]</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #365f91; mso-themecolor: accent1; mso-themeshade: 191;\">INPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 1000) &ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat N (1 &lt;= N &lt;= 10^6) &ndash; banyak lampu.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #365f91; mso-themecolor: accent1; mso-themeshade: 191;\">OUTPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%;\">Untuk setiap kasus uji, output dalam satu baris banyak lampu yang dalam keadaan menyala setelah semua saklar ditekan sekali.</span></p>\r\n<table class=\"MsoTableGrid\" style=\"border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">Contoh input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">2</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">3</span></p>\r\n</td>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; border-left: none; mso-border-left-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">Contoh output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-fareast-font-family: SimSun; mso-fareast-theme-font: minor-fareast; mso-fareast-language: ZH-CN;\">1</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','asset/input_files/ba8ff2ea89a247855e70a9b14c79cab2.in','asset/output_files/4caa015fc07c23dfe8a3d59ed69b6e63.out',1,'Tim Soal',138),(390,'B','Sorting Dewa','<p><img src=\"../../../asset/gambar_logika/4TTrialProgramming(02.jpg\" alt=\"Noctis\" width=\"300\" height=\"289\" /></p>\r\n<p><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">DESKRIPSI</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%;\">Noctis adalah seorang mahasiswa jurusan Teknik Informatika Universitas Surabaya. Ia merasa dirinya sangatlah jenius, dan memiliki banyak teori yang Ia buat-buat sendiri. Salah satu teori yang ia buat adalah sebuah algoritma sorting (pengurutan) abjad yang ia sebut &lsquo;Sorting Dewa&rsquo;. Pada algortima Sorting Dewa yang ia buat, untuk mengurutkan kumpulan string x, xz, xy, dan xyz, Noctis akan mengurutkannya menjadi x, xy, xz, xyz (dari terkecil ke terbesar). Padahal, pada umumnya programmer akan mengurutkannya menjadi x, xy, xyz, xz. Meskipun memiliki algoritma sorting sendiri, Noctis sendiri ternyata tidak tahu cara membuat program untuk mengurutkan suatu kumpulan string dengan menggunakan algoritma Sorting Dewa! Karena tidak ingin memalukan dirinya sendiri, Noctis meminta Anda untuk mengajarinya cara membuat program yang bisa mengurutkan suatu kumpulan string sesuai dengan aturan Sorting Dewa.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">INPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 20) &ndash; banyak kasus uji. Setiap kasus uji, inputan diawali dengan sebuah bilangan bulat N (1 &lt;= N &lt;= 1000) yang menyatakan jumlah string yang harus diurutkan. Untuk N baris selanjutnya, inputkan kumpulan string yang ingin diurutkan, dipisahkan dengan enter.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">OUTPUT</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%;\">Untuk setiap kasus uji, outputnya adalah hasil pengurutan. Hasil pengurutan dipisahkan dengan enter.</span>&nbsp;</p>\r\n<table class=\"MsoTableGrid\" style=\"border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh input</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">1</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">4</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xyz</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xy</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xz</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">x</span></p>\r\n</td>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; border-left: none; mso-border-left-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh output</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">x</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xy</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xyz</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas;\">xz</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','asset/input_files/af77f6180eaaa55fa37dc80829bfcdaf.in','asset/output_files/0d858190abd04f7c68c1cfbb627e5b8f.out',2,'Tim Soal',138),(391,'C','Si Entis','<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">DESKRIPSI</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%;\">Bilangan palindrom adalah bilangan yang akan menghasilkan nilai yang sama bila dibaca dari depan maupun dari belakang. Suatu hari, Entis yang baru saja menyadari hal ini ingin bermain-main dengan angka palindrom. Ia memiliki N buah digit bilangan bulat yang ingin ia bentuk menjadi palindrom. Namun karena Entis menyukai segala sesuatu yang besar, ia pun memutuskan untuk membuat sebuah bilangan palindrom yang memiliki nilai paling besar dari digit-digit yang dimilikinya. Karena Entis kesusahan untuk membentuk bilangan ini, maka ia meminta bantuan anda sang programmer handal untuk membantunya</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">INPUT</span></strong></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Input diawali dengan sebuah bilangan bulat T(1&lt;=T&lt;=100) yang menyatakan jumlah test case. Tiap test case terdiri dari sebuah integer N dengan panjang digit 1 sampai 1000. Integer yang mungkin dibentuk selalu positif dan tidak pernah negatif</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #2e74b5; mso-themecolor: accent1; mso-themeshade: 191;\">OUTPUT</span></strong></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Output diawali dengan &ldquo;</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; font-family: \'Courier New\';\">Case #X:</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> &ldquo; dimana </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; font-family: \'Courier New\';\">X</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> adalah nomor test-case diikuti dengan palindrome terbesar yang dapat dibuat dari integer yang diberikan</span></p>\r\n<table class=\"MsoTableGrid\" style=\"border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh input</span></strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">5</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">5132521</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">12345</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">990000</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">0070</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">5</span></p>\r\n</td>\r\n<td style=\"width: 233.75pt; border: solid windowtext 1.0pt; border-left: none; mso-border-left-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"312\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt;\">Contoh output</span></strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">Case #1: 5213125</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">Case #2: 5</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">Case #3: 900009</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">Case #4: 070</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: Consolas; mso-bidi-font-family: \'Courier New\';\">Case #5: 5</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>','asset/input_files/7976e9508e15260d25c4d0ee9f6ff277.in','asset/output_files/f747837459effcfa679a693f06733b8c.out',2,'Tim Soal',138),(392,'D','Mencari Jati Diri','<p>test</p>','asset/input_files/ff35aa78413fa691f241f8c7e5219810.in','asset/output_files/caf35dc277f18f173322204e31de9347.out',1,'Tim Soal',138),(393,'A','Lampu','<p><strong>DESKRIPSI</strong></p>\r\n<p style=\"text-align: justify;\">Terdapat N buah lampu yang masing &ndash; masing diberi nomor secara unik dari 1 sampai N. Mula &ndash; mula semua lampu dalam keadaan padam. Untuk menyalakan lampu &ndash; lampu tersebut, digunakan N buah saklar yang juga diberi nomor secara unik dari 1 sampai N.&nbsp; Apabila saklar bernomor i ditekan, maka keadaan lampu yang bernomor kelipatan i akan terpengaruh. Jika mula &ndash; mula lampu dalam keadaan padam, lampu akan menyala, begitu pula sebaliknya. Jika Anda menekan masing &ndash; masing saklar sebanyak 1 kali, berapa jumlah lampu yang pada akhirnya dalam kondisi menyala? Contoh:</p>\r\n<p style=\"text-align: justify;\">Untuk N = 3, hanya lampu nomor 1 yang dalam keadaan menyala. Penjelasan:</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Keadaan awal lampu = [padam, padam, padam]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 1 ditekan = [menyala, menyala, menyala]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 2 ditekan = [menyala, padam, menyala]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 3 ditekan = [menyala, padam, padam]</li>\r\n</ul>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 1000) &ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat N (1 &lt;= N &lt;= 10^6) &ndash; banyak lampu.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Untuk setiap kasus uji, output dalam satu baris banyak lampu yang dalam keadaan menyala setelah setiap saklar ditekan sekali.</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH INPUT</strong></p>\r\n<p style=\"text-align: justify;\">2</p>\r\n<p style=\"text-align: justify;\">1</p>\r\n<p style=\"text-align: justify;\">3</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">1</p>\r\n<p style=\"text-align: justify;\">1</p>','asset/input_files/31c4cda56f295c74da458ec21cfdf7b9.in','asset/output_files/916198d3517dc1b9193a8fac0dd25111.out',1,'Tim Soal',139),(394,'B','Sorting Dewa','<p><strong>DESKRIPSI</strong></p>\r\n<p><strong><img src=\"../../../asset/gambar_logika/4TTrialProgramming(02.jpg\" alt=\"Noctis Lucis Caelum\" width=\"300\" height=\"289\" /></strong></p>\r\n<p style=\"text-align: justify;\">*gambar diambil dari:&nbsp;http://www.meristation.com/noticias/final-fantasy-xv-lluvia-de-nuevas-caracteristicas/2030702</p>\r\n<p style=\"text-align: justify;\">Noctis adalah seorang mahasiswa jurusan Teknik Informatika Universitas Surabaya. Ia merasa dirinya sangatlah jenius, dan memiliki banyak teori yang Ia buat-buat sendiri. Salah satu teori yang ia buat adalah sebuah algoritma sorting (pengurutan) abjad yang ia sebut &lsquo;Sorting Dewa&rsquo;. Pada algortima Sorting Dewa yang ia buat, untuk mengurutkan kumpulan string x, xz, xy, dan xyz, Noctis akan mengurutkannya menjadi x, xy, xyz, xz (dari terkecil ke terbesar). Padahal, pada umumnya programmer akan mengurutkannya menjadi x, xy, xz, xyz. Meskipun memiliki algoritma sorting sendiri, Noctis sendiri ternyata tidak tahu cara membuat program untuk mengurutkan suatu kumpulan string dengan menggunakan algoritma Sorting Dewa! Karena tidak ingin memalukan dirinya sendiri, Noctis meminta Anda untuk mengajarinya cara membuat program yang bisa mengurutkan suatu kumpulan string sesuai dengan aturan Sorting Dewa.</p>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 20) &ndash; banyak kasus uji. Setiap kasus uji, inputan diawali dengan sebuah bilangan bulat N (1 &lt;= N &lt;= 1000) yang menyatakan jumlah string yang harus diurutkan. Untuk N baris selanjutnya, inputkan kumpulan string yang ingin diurutkan, dipisahkan dengan enter.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Untuk setiap kasus uji, outputnya adalah hasil pengurutan. Hasil pengurutan dipisahkan dengan enter.</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH INPUT</strong></p>\r\n<p>1</p>\r\n<p>4</p>\r\n<p>xyz</p>\r\n<p>xy</p>\r\n<p>xz</p>\r\n<p style=\"text-align: justify;\">x</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">x</p>\r\n<p>xy</p>\r\n<p>xyz</p>\r\n<p style=\"text-align: justify;\">xz</p>','asset/input_files/4577988b34e7f588c9513a81fd0795f0.in','asset/output_files/26456d61f7822947b87378478dd56228.out',2,'Tim Soal',139),(395,'C','Si Entis','<p><strong>DESKRIPSI</strong></p>\r\n<p style=\"text-align: justify;\">Bilangan palindrom adalah bilangan yang akan menghasilkan nilai yang sama bila dibaca dari depan maupun dari belakang. Suatu hari, Entis yang baru saja menyadari hal ini ingin bermain-main dengan angka palindrom. Ia memiliki N buah digit bilangan bulat yang ingin ia bentuk menjadi palindrom. Namun karena Entis menyukai segala sesuatu yang besar, ia pun memutuskan untuk membuat sebuah bilangan palindrom yang memiliki nilai paling besar dari digit-digit yang dimilikinya. Karena Entis kesusahan untuk membentuk bilangan ini, maka ia meminta bantuan anda sang programmer handal untuk membantunya.</p>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Input diawali dengan sebuah bilangan bulat T(1&lt;=T&lt;=100) yang menyatakan jumlah test case. Tiap test case terdiri dari sebuah integer N dengan panjang digit 1 sampai 1000. Integer yang mungkin dibentuk selalu positif dan tidak pernah negatif.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Output diawali dengan &ldquo;Case #X: &ldquo; dimana X adalah nomor test-case diikuti dengan palindrome terbesar yang dapat dibuat dari integer yang diberikan.</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH INPUT</strong></p>\r\n<p style=\"text-align: justify;\">5</p>\r\n<p>5132521</p>\r\n<p>12345</p>\r\n<p>990000</p>\r\n<p>0070</p>\r\n<p style=\"text-align: justify;\">5</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Case #1: 5213125</p>\r\n<p>Case #2: 5</p>\r\n<p>Case #3: 900009</p>\r\n<p>Case #4: 070</p>\r\n<p style=\"text-align: justify;\">Case #5: 5</p>','asset/input_files/1fbca8cd0b37989bf1b6fdf0f7bb4d14.in','asset/output_files/bd51d2948d83dde1232ee1c0bfd44161.out',2,'Tim Soal',139),(396,'A','Lampu','<p><strong>DESKRIPSI</strong></p>\r\n<p style=\"text-align: justify;\">Terdapat N buah lampu yang masing &ndash; masing diberi nomor secara unik dari 1 sampai N. Mula &ndash; mula semua lampu dalam keadaan padam. Untuk menyalakan lampu &ndash; lampu tersebut, digunakan N buah saklar yang juga diberi nomor secara unik dari 1 sampai N.&nbsp; Apabila saklar bernomor i ditekan, maka keadaan lampu yang bernomor kelipatan i akan terpengaruh. Jika mula &ndash; mula lampu dalam keadaan padam, lampu akan menyala, begitu pula sebaliknya. Jika Anda menekan masing &ndash; masing saklar sebanyak 1 kali, berapa jumlah lampu yang pada akhirnya dalam kondisi menyala? Contoh:</p>\r\n<p style=\"text-align: justify;\">Untuk N = 3, hanya lampu nomor 1 yang dalam keadaan menyala. Penjelasan:</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Keadaan awal lampu = [padam, padam, padam]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 1 ditekan = [menyala, menyala, menyala]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 2 ditekan = [menyala, padam, menyala]</li>\r\n<li style=\"text-align: justify;\">Setelah saklar 3 ditekan = [menyala, padam, padam]</li>\r\n</ul>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 1000) &ndash; banyak kasus uji. Setiap kasus uji terdiri dari satu baris yang berisi bilangan bulat N (1 &lt;= N &lt;= 10^6) &ndash; banyak lampu.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Untuk setiap kasus uji, output dalam satu baris banyak lampu yang dalam keadaan menyala setelah semua saklar ditekan sekali.</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH INPUT</strong></p>\r\n<p style=\"text-align: justify;\">2</p>\r\n<p style=\"text-align: justify;\">1</p>\r\n<p style=\"text-align: justify;\">3</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">1</p>\r\n<p style=\"text-align: justify;\">1</p>','asset/input_files/b403428d3843ee3156a6b8d1a469c93c.in','asset/output_files/75c3c1903147581db4bf0f0f3eec8347.out',1,'Tim Soal',140),(397,'B','Sorting Dewa','<p><strong>DESKRIPSI</strong></p>\r\n<p><strong><img src=\"../../../asset/gambar_logika/4TTrialProgramming(02.jpg\" alt=\"Noctis Lucis Caelum\" width=\"300\" height=\"289\" /></strong></p>\r\n<p style=\"text-align: justify;\">Noctis adalah seorang mahasiswa jurusan Teknik Informatika Universitas Surabaya. Ia merasa dirinya sangatlah jenius, dan memiliki banyak teori yang Ia buat-buat sendiri. Salah satu teori yang ia buat adalah sebuah algoritma sorting (pengurutan) abjad yang ia sebut &lsquo;Sorting Dewa&rsquo;. Pada algortima Sorting Dewa yang ia buat, untuk mengurutkan kumpulan string x, xz, xy, dan xyz, Noctis akan mengurutkannya menjadi x, xy, xyz, xz (dari terkecil ke terbesar). Padahal, pada umumnya programmer akan mengurutkannya menjadi x, xy, xz, xyz. Meskipun memiliki algoritma sorting sendiri, Noctis sendiri ternyata tidak tahu cara membuat program untuk mengurutkan suatu kumpulan string dengan menggunakan algoritma Sorting Dewa! Karena tidak ingin memalukan dirinya sendiri, Noctis meminta Anda untuk mengajarinya cara membuat program yang bisa mengurutkan suatu kumpulan string sesuai dengan aturan Sorting Dewa.</p>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Pada baris pertama terdapat bilangan bulat T (1 &lt;= T &lt;= 20) &ndash; banyak kasus uji. Setiap kasus uji, inputan diawali dengan sebuah bilangan bulat N (1 &lt;= N &lt;= 1000) yang menyatakan jumlah string yang harus diurutkan. Untuk N baris selanjutnya, inputkan kumpulan string yang ingin diurutkan, dipisahkan dengan enter.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p>Untuk setiap kasus uji, outputnya adalah hasil pengurutan. Hasil pengurutan dipisahkan dengan enter.</p>\r\n<p><strong>CONTOH INPUT</strong></p>\r\n<p>1</p>\r\n<p>4</p>\r\n<p>xyz</p>\r\n<p>xy</p>\r\n<p>xz</p>\r\n<p>x</p>\r\n<p><strong>CONTOH OUTPUT</strong></p>\r\n<p>x</p>\r\n<p>xy</p>\r\n<p>xyz</p>\r\n<p>xz</p>','asset/input_files/acced442add176739586d03f4c1d7005.in','asset/output_files/4587fabc1ebd3bcea24d3c1e127cfbd5.out',2,'Tim Soal',140),(398,'C','Si Entis','<p style=\"text-align: justify;\"><strong>DESKRIPSI</strong></p>\r\n<p style=\"text-align: justify;\">Bilangan palindrom adalah bilangan yang akan menghasilkan nilai yang sama bila dibaca dari depan maupun dari belakang. Suatu hari, Entis yang baru saja menyadari hal ini ingin bermain-main dengan angka palindrom. Ia memiliki N buah digit bilangan bulat yang ingin ia bentuk menjadi palindrom. Namun karena Entis menyukai segala sesuatu yang besar, ia pun memutuskan untuk membuat sebuah bilangan palindrom yang memiliki nilai paling besar dari digit-digit yang dimilikinya. Karena Entis kesusahan untuk membentuk bilangan ini, maka ia meminta bantuan anda sang programmer handal untuk membantunya.</p>\r\n<p><strong>INPUT</strong></p>\r\n<p style=\"text-align: justify;\">Input diawali dengan sebuah bilangan bulat T(1&lt;=T&lt;=100) yang menyatakan jumlah test case. Tiap test case terdiri dari sebuah integer N dengan panjang digit 1 sampai 1000. Integer yang mungkin dibentuk selalu positif dan tidak pernah negatif.</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Output diawali dengan &ldquo;Case #X: &ldquo; dimana X adalah nomor test-case diikuti dengan palindrome terbesar yang dapat dibuat dari integer yang diberikan.</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH INPUT</strong></p>\r\n<p style=\"text-align: justify;\">5</p>\r\n<p>5132521</p>\r\n<p>12345</p>\r\n<p>990000</p>\r\n<p>0070</p>\r\n<p style=\"text-align: justify;\">5</p>\r\n<p style=\"text-align: justify;\"><strong>CONTOH OUTPUT</strong></p>\r\n<p style=\"text-align: justify;\">Case #1: 5213125</p>\r\n<p>Case #2: 5</p>\r\n<p>Case #3: 900009</p>\r\n<p>Case #4: 070</p>\r\n<p style=\"text-align: justify;\">Case #5: 5</p>','asset/input_files/b406fbd19fb28d6bcab673380d76e5cb.in','asset/output_files/b8c3db7b1e781bf8d2e5acf134d4a39b.out',2,'Tim Soal',140),(399,'A','BPTB','<p><strong>DESKRIPSI</strong></p>\r\n<p>Di sebuah game center, terdapat permainan menebak bilangan BPTB (Bukan Prima Tapi Prima). Permainan tersebut memberikan 2 buah integer, X dan Y, lalu pemain harus menebak berapa jumlah BPTB antara X dan Y (Inklusif).&nbsp; BPTB adalah sebuah bilangan yang dapat dibagi oleh 1, bilangan prima yang lebih kecil darinya dan bilangan itu sendiri. Sebagai contoh:</p>\r\n<ul>\r\n<li>26 adalah BPTB, karena dapat dibagi oleh 1, 2, 13, 26.</li>\r\n<li>29 bukanlah BPTB, karena 29 merupakan bilangan prima</li>\r\n<li>30 bukanlah BPTB, karena 30 habis dibagi oleh 1, 2, 3, 5, 6, 10, 15, 30. (6,10,15 bukanlah bilangan prima)</li>\r\n</ul>\r\n<p>Suatu hari, Andre yang merupakan seorang gamer ingin membuat sebuah robot yang dapat membantunya memenangkan game tersebut. Andre meminta anda untuk membantunya menciptakan robot tersebut dengan input dan output sebagai berikut</p>\r\n<p><strong>INPUT</strong></p>\r\n<p>Baris pertama merupakan T (1 &lt;= T &lt;= 1000) yang merupakan jumlah kasus. Setiap kasus terdiri dari 2 integer, X dan Y (2 &lt;= X &lt;= Y &lt;= 1000).</p>\r\n<p><strong>OUTPUT</strong></p>\r\n<p>Setiap kasus memiliki 1 baris output, yaitu jumlah bilangan BPTB antara X dan Y (inklusif).</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"312\">\r\n<p><strong>Contoh input</strong></p>\r\n<p>2</p>\r\n<p>11 15</p>\r\n<p>2 18</p>\r\n</td>\r\n<td width=\"312\">\r\n<p><strong>Contoh output</strong></p>\r\n<p>2</p>\r\n<p>6</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','asset/input_files/403ff207aa7bee10c2bb016ee0e69d4e.in','asset/output_files/5278d804abeeb6b12a09ad84bf4580ba.out',1,'Uvuvwevwevwe Onyetenyevwe Ugwemubwem Ossas',141),(400,'A','Angka Kurang Beruntung','<p>Lihat di drive</p>','asset/input_files/fe580c3b14fa6cbc77380e91d7013cf4.in','asset/output_files/7cbdda9b1ed8705ca8bbba377f7143f0.out',1,'Andre',142),(401,'B','Morae','<p>Lihat di drive</p>','asset/input_files/3fc480b6ae7cb5561f2dae685f1103b3.in','asset/output_files/90e902a33651c637f63596978ee49d8f.out',1,'Felix Aditya W. P. W.',142),(402,'C','LJKode','<p>Lihat di drive</p>','asset/input_files/a6b294650120479a7cf30284c68a9941.in','asset/output_files/192c5906fd9757ae3949