e87312bb8dfc.in','asset/output_files/51816f2b2548497f615b2948af83e989.out',10,'F',167),(538,'A','Mesin Pencari Persamaan','<p>laskldas</p>','asset/input_files/76b9415b95c170cd8673048701b9e6d5.in','asset/output_files/b19a1ff6557c2cc8c43320609346afa8.out',10,'Felix',169),(539,'A','Mesin Pencari Persamaan','<p><span style=\"font-weight: 400;\">Suatu hari, seorang mahasiswa mencoba untuk menciptakan mesin yang dapat mengetahui apakah sebuah sistem persamaan linear dapat diselesaikan atau tidak. Dengan data awal berupa persamaan - persamaan yang sudah diketahui sebelumnya (Dalam bentuk umum persamaan a + b = c), mesin tersebut diharapkan dapat mengetahui apakah dengan menggunakan data yang sudah ada, persamaan dalam soal dapat dikerjakan atau tidak.</span></p>\r\n<p><span style=\"font-weight: 400;\">Dengan menggunakan input berupa beberapa persamaan yang saling berhubungan satu sama lain (Sistem Persamaan Linear), dan sudah diketahui nilainya, carilah persamaan mana saja yang dapat diselesaikan dengan data tersebut!</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Input</strong><span style=\"font-weight: 400;\"><br /></span><span style=\"font-weight: 400;\">Baris pertama adalah T yang menunjukkan jumlah test case.</span></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama dari setiap test case adalah jumlah persamaan linear yang diketahui sebelumnya (n).</span></p>\r\n<p><span style=\"font-weight: 400;\">n baris berikutnya adalah persamaan linearnya.</span></p>\r\n<p><span style=\"font-weight: 400;\">Baris setelahnya merupakan jumlah persamaan linear yang akan dicek (m).</span></p>\r\n<p><span style=\"font-weight: 400;\">m baris berikutnya adalah persamaan linear yang akan dicek.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, outputkan hasil dari persamaan yang diinput, dan diawali dengan Case #x: , lalu baris selanjutnya adalah output dari testcase tersebut. Apabila tidak ada hasilnya, hanya outputkan Case #x: . (Outputkan sesuai dengan urutan input). <br />Catatan : Ganti simbol + dan = pada output menjadi spasi. (Untuk lebih jelasnya, lihat di contoh).<br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Constrain</strong></p>\r\n<p><span style=\"font-weight: 400;\">-100000 &lt; a,b &lt; 100000</span></p>\r\n<p><span style=\"font-weight: 400;\">c bilangan integer</span></p>\r\n<p><span style=\"font-weight: 400;\">T &le; 3</span></p>\r\n<p><span style=\"font-weight: 400;\">N &le; 5000</span></p>\r\n<p><span style=\"font-weight: 400;\">Q &le; 5000</span></p>\r\n<p><strong>Contoh</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">3</span></p>\r\n<p><span style=\"font-weight: 400;\">a+b=12</span></p>\r\n<p><span style=\"font-weight: 400;\">a+c=6</span></p>\r\n<p><span style=\"font-weight: 400;\">c+d=5</span></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">b+d</span></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">a+b=10</span></p>\r\n<p><span style=\"font-weight: 400;\">b+c=12</span></p>\r\n<p><span style=\"font-weight: 400;\">4</span></p>\r\n<p><span style=\"font-weight: 400;\">a+b</span></p>\r\n<p><span style=\"font-weight: 400;\">b+a</span></p>\r\n<p><span style=\"font-weight: 400;\">a+c</span></p>\r\n<p><span style=\"font-weight: 400;\">c+b</span></p>\r\n</td>\r\n<td>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Case #1: </span></p>\r\n<p><span style=\"font-weight: 400;\">b d 11</span></p>\r\nCase #2:<br />\r\n<p><span style=\"font-weight: 400;\">a b 10</span></p>\r\n<p><span style=\"font-weight: 400;\">b a 10</span></p>\r\n<p><span style=\"font-weight: 400;\">c b 12</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-weight: 400;\">&nbsp;</span></p>','asset/input_files/28a40e9430bd6db6526076a8969db55a.in','asset/output_files/f871c9b0030e9a45988a0a569354bcea.out',5,'Felix Aditya Wijaya P.W.',170),(540,'B','Prima Andi','<p><span style=\"font-weight: 400;\">Andi adalah seorang anak yang selalu ingin tahu, suatu hari ia mengetahui bahwa suatu bilangan non prima dapat dirubah ke dalam penjumlahan bilangan-bilangan prima. Andi ingin mengetahui ada berapa kombinasi yang memenuhi sehingga bilangan non prima N dapat dinyatakan dalam bentuk penjumlahan K buah bilangan prima yang berbeda.</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama adalah T yaitu jumlah testcase yang akan diujikan, T baris berikutnya berisi bilangan N dan K.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap testcase, keluarkan X, dimana X merupakan total kombinasi yang memenuhi.</span></p>\r\n<p><strong>Constrain</strong></p>\r\n<p><span style=\"font-weight: 400;\">1&lt;=N&lt;=1000</span></p>\r\n<p><span style=\"font-weight: 400;\">1&lt;=K&lt;=12</span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">5</span></p>\r\n<p><span style=\"font-weight: 400;\">24 3</span></p>\r\n<p><span style=\"font-weight: 400;\">24 2</span></p>\r\n<p><span style=\"font-weight: 400;\">2 1</span></p>\r\n<p><span style=\"font-weight: 400;\">1 1</span></p>\r\n<p><span style=\"font-weight: 400;\">18 3</span></p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">3</span></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">0</span></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">(Penjelasan: N=24 K=3 mengeluarkan hasil 2 karena kombinasi bilangan yang memenuhi yaitu {2, 3, 19} dan {2, 5, 17})</span></p>','asset/input_files/2ac31e86cf8d50d4fac76193d02d9392.in','asset/output_files/39fb2582fd66f02e719a33d469078057.out',1,'Rudy G. Lie',170),(541,'C','Copy Paste','<p><span style=\"font-weight: 400;\">Seorang programmer yang sangat pintar namun malas ingin mencari cara untuk membuat sebuah string s. Dia memikirkan ada beberapa cara untuk menambahkan huruf atau kata di sebuah string. Yaitu :</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Copy substring dari string yang sudah terbentuk. (C)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Paste substring yang terakhir dicopy. (P)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Tambahkan satu huruf di bagian paling belakang string. (T)</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Programmer tersebut ingin membuat program yang dapat mencari berapa jumlah operasi terkecil yang dapat dilakukan untuk membuat sebuah string yang diminta. Catatan : melakukan proses copy dihitung sebagai 1 operasi, paste 1 operasi, dan tambah 1 operasi. (Semua huruf dalam string tersebut adalah huruf kecil/lower case).</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Input pertama adalah jumlah test case (T).</span></p>\r\n<p><span style=\"font-weight: 400;\">Setiap test case memiliki 1 baris input, yaitu string yang ingin dibentuk.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Setiap test case mengeluarkan output X, yaitu jumlah operasi terkecil yang dibutuhkan.</span></p>\r\n<p><strong>Constrain</strong></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= T &lt;= 100</span></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= S &lt;= 100</span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">abcabcabcabc</span></p>\r\n<p><span style=\"font-weight: 400;\">zzzzzzzzzzz</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">7</span></p>\r\n<p><span style=\"font-weight: 400;\">7</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-weight: 400;\">Solusi untuk Case #1 :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(T) a</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(T) b</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(T) c</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(C) abc</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(P) abc</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(P) abc</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">(P) abc</span></li>\r\n</ol>','asset/input_files/0e6ca589fb8caeea9bc5081252863a0a.in','asset/output_files/490df0fb34d0daa6b36ff7b4e8258289.out',1,'Felix Aditya Wijaya P.W.',170),(542,'D','Mengubah Bilangan','<p><span style=\"font-weight: 400;\">Seorang mahasiswa ubaya ingin mengubah suatu list bilangan menjadi sebuah bilangan. Aturan pengubahannya adalah sebagai berikut :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cari semua kemungkinan himpunan bagian dari list tersebut.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Untuk setiap himpunan bagian, cari selisih terbesar dan terkecil antara elemen-elemennya. Apabila himpunan tersebut hanya terdiri dari 1 bilangan, selisihnya adalah 0.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Jumlahkan setiap selisih dari seluruh himpunan bagian tersebut untuk mendapatkan hasil setelah angka tersebut dirubah.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Bantulah mahasiswa tersebut menciptakan program sesuai dengan yang dideskripsikan diatas.</span></p>\r\n<p><strong>Contoh dari penerapan aturan tersebut adalah :</strong></p>\r\n<p><span style=\"font-weight: 400;\">Apabila diketahui sebuah list bilangan {3,6,7}, maka semua himpunan bagian serta selisih yang dimaksud dalam soal adalah :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{3} -&gt; 0</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{6} -&gt; 0</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{7} -&gt; 0</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{3,6} -&gt; 6 - 3 = 3</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{3,7} -&gt; 7 - 3 = 4</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{6,7} -&gt; 7 - 6 = 1</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">{3,6,7} -&gt; 7 - 3 = 4</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Maka, hasil yang harus dioutputkan adalah : 0 + 0 + 0 + 3 + 4 + 1 + 4 = 12</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Constrain</strong></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= T &lt;= 25</span></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= K &lt;= 10000</span></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= N &lt;= 10000</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama adalah </span><strong>T</strong><span style=\"font-weight: 400;\">, yaitu jumlah test case.</span></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, terdiri dari 2 baris. </span></p>\r\n<ol>\r\n<li><span style=\"font-weight: 400;\"> Baris pertama adalah bilangan </span><strong>N</strong><span style=\"font-weight: 400;\">, yaitu banyak bilangan dalam list.</span></li>\r\n<li><span style=\"font-weight: 400;\"> Baris kedua adalah bilangan sebanyak </span><strong>N</strong><span style=\"font-weight: 400;\">, yaitu bilangan bulat positif (</span><strong>K</strong><span style=\"font-weight: 400;\">) yang telah terurut mulai dari terkecil hingga terbesar.</span></li>\r\n</ol>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, outputkan bilangan sesuai dalam soal. (Output dimodulokan dengan 10^9 + 7) </span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">3</span></p>\r\n<p><span style=\"font-weight: 400;\">3 6 7</span></p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">12</span></p>','asset/input_files/5bdcf7fc307b7ad90deeea6a18aab3e1.in','asset/output_files/52009cc4261100c37fef28e8190ea05e.out',2,'Felix Aditya Wijaya P.W.',170),(543,'E','Pertukaran Pelajar','<p><span style=\"font-weight: 400;\">Ayah Andi bekerja di suatu organisasi yang mengatur pertukaran pelajar. Suatu hari, Andi mengunjungi tempat kerja ayahnya dan menemukan daftar pelajar yang ingin melakukan pertukaran dari sekolah </span><strong>A</strong><span style=\"font-weight: 400;\"> menuju sekolah </span><strong>B</strong><span style=\"font-weight: 400;\">. Organisasi tersebut hanya akan menyetujui pertukaran pelajar yang diajukan apabila ada siswa yang ingin melakukan pertukaran dari sekolah </span><strong>B</strong><span style=\"font-weight: 400;\"> ke sekolah </span><strong>A</strong><span style=\"font-weight: 400;\">. &nbsp;Ia menemukan </span><strong>N</strong><span style=\"font-weight: 400;\"> orang pelajar yang ingin melakukan pertukaran pelajar dan ingin mengetahui berapa pelajar yang disetujui pertukaran pelajarnya. </span><strong>A</strong><span style=\"font-weight: 400;\"> dan </span><strong>B</strong><span style=\"font-weight: 400;\"> masing-masing direpresentasikan oleh sebuah bilangan bulat.</span></p>\r\n<p><strong>Constrain</strong></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= T &lt;= 200</span></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= N &lt;= 500000</span></p>\r\n<p><span style=\"font-weight: 400;\">1 &lt;= A,B &lt;= 100000</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Input terdiri dari T yang menyatakan kasus uji, untuk setiap kasus uji terdapat. N baris berikutnya terdapat bilangan <strong>A</strong> dan <strong>B</strong> yang dipisahkan oleh spasi.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap kasus uji, keluarkan X, yaitu total pelajar yang disetujui.</span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">10</span></p>\r\n<p><span style=\"font-weight: 400;\">1 2</span></p>\r\n<p><span style=\"font-weight: 400;\">2 1</span></p>\r\n<p><span style=\"font-weight: 400;\">3 4</span></p>\r\n<p><span style=\"font-weight: 400;\">4 3</span></p>\r\n<p><span style=\"font-weight: 400;\">100 200</span></p>\r\n<p><span style=\"font-weight: 400;\">200 100</span></p>\r\n<p><span style=\"font-weight: 400;\">57 2</span></p>\r\n<p><span style=\"font-weight: 400;\">2 57</span></p>\r\n<p><span style=\"font-weight: 400;\">1 2</span></p>\r\n<p><span style=\"font-weight: 400;\">2 1</span></p>\r\n<p><span style=\"font-weight: 400;\">10</span></p>\r\n<p><span style=\"font-weight: 400;\">1 2</span></p>\r\n<p><span style=\"font-weight: 400;\">3 4</span></p>\r\n<p><span style=\"font-weight: 400;\">5 6</span></p>\r\n<p><span style=\"font-weight: 400;\">7 8</span></p>\r\n<p><span style=\"font-weight: 400;\">9 10</span></p>\r\n<p><span style=\"font-weight: 400;\">11 12</span></p>\r\n<p><span style=\"font-weight: 400;\">13 14</span></p>\r\n<p><span style=\"font-weight: 400;\">15 16</span></p>\r\n<p><span style=\"font-weight: 400;\">17 18</span></p>\r\n<p><span style=\"font-weight: 400;\">19 20</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">10</span></p>\r\n<p><span style=\"font-weight: 400;\">0</span></p>','asset/input_files/855818d68bd34c15b26c85e573f8852c.in','asset/output_files/e6ae37e1f87e1aff4341ab1b0c0b6c68.out',1,'Rudy G. Lie',170),(544,'F','Bumi Datar','<p><span style=\"font-weight: 400;\">Ada sebuah mitos yang menyatakan bahwa pada zaman dahulu kala, Bumi adalah sebuah lahan persegi datar yang sangat besar. Dan tidak ada kehidupan saat itu. Kemudian langit pun dipenuhi dengan meteor yang berjatuhan dari luar angkasa. Setiap meteor yang jatuh ke tanah di bumi, terbentuklah sungai, yang mengalir ke 4 arah (Utara, Timur, Barat, dan Selatan) hingga air mencapai ujung Bumi dan jatuh ke luar angkasa. </span></p>\r\n<p><span style=\"font-weight: 400;\">Sungai &ndash; sungai tersebut menyilang simpang siur satu sama lain dan membagi lahan yang besar (Pangaea) menjadi lahan &ndash; lahan (dataran) kecil yang lain. Sekarang, ilmuwan - ilmuwan ingin mengetahui berapa banyak lahan yang terbentuk pada Bumi dahulu kala setelah semua meteor jatuh ke Bumi, beserta luas minimum dan maksimum daratan - daratan yang baru terbentuk. Bisakah kalian membantu Ilmuwan &ndash; ilmuwan menjawab pertanyaan mereka?</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama berisi bilangan </span><strong>T</strong><span style=\"font-weight: 400;\"> yang menyatakan jumlah test case.</span></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama dari setiap test case memiliki 3 bilangan </span><strong>N, M, Q</strong><span style=\"font-weight: 400;\">&nbsp;dimana N dan M adalah koordinat bawah kanan planet dan Q adalah jumlah meteor. Q baris selanjutnya berisi koordinat&nbsp;</span><strong>X</strong><span style=\"font-weight: 400;\">,&nbsp;</span><strong>Y</strong><span style=\"font-weight: 400;\">&nbsp;di mana setiap meteor jatuh.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, outputkan sebuah baris yang berisi 3 bilangan yang menyatakan jumlah wilayah baru yang terbentuk, luas minimum, dan luas maksimum daratan. </span></p>\r\n<p><strong>Constrain</strong></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">1 &le; T &le; 10</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">2 &le; N, M &le; 10</span><span style=\"font-weight: 400;\">5</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">0 &le; Q &le; 10</span><span style=\"font-weight: 400;\">5</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">1 &le; X &le; N</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">1 &le; Y &le; M</span></li>\r\n</ul>\r\n<p><strong>NOTES</strong></p>\r\n<ul>\r\n<li><strong><span style=\"font-weight: 400;\">Asumsikan bumi sebagai sebuah persegi dengan koordinat kiri atas (1, 1) dan kanan bawah (N, M).</span></strong></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-weight: 400;\">Lebih dari satu meteor dapat mendarat pada koordinat yang sama</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-weight: 400;\">Laut yang tersebut dapat diasumsikan mengalir dalam arah garis lurus paralel dengan tepi bumi.</span></li>\r\n</ul>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">5 5 2</span></p>\r\n<p><span style=\"font-weight: 400;\">2 3</span></p>\r\n<p><span style=\"font-weight: 400;\">4 4</span></p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p>&nbsp;9 1 4</p>','asset/input_files/6e10e12966111994a8cba86c6a3856fe.in','asset/output_files/e666185b6e162d9c3bda9768a44cc031.out',1,'Varianto',170),(545,'G','Bermain Dengan Angka','<p><span style=\"font-weight: 400;\">Ayo kita bermain dengan angka lagi!</span></p>\r\n<p><span style=\"font-weight: 400;\">Di soal kali ini, kalian akan diberikan n buah bilangan bulat non negatif (a1, a2, a3, a4). Kalian diminta untuk mencari tahu, apakah kalian dapat membuat bilangan baru, dari semua digit yang diberikan di soal, dan terdapat satu dari semua kemungkinan dimana bilangan baru tersebut habis dibagi oleh 3. Kalian dapat menyusun ulang bilangannya sebagai berikut :</span></p>\r\n<p><span style=\"font-weight: 400;\">Misalnya diberikan bilangan 3, 20 maka kalian dapat membentuk :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">320</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">302</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">230</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">203</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">032</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">023</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Dari semua kemungkinan tersebut, tidak ada bilangan yang dapat dibagi tiga. Oleh sebab itu, outputkan &ldquo;No&rdquo;.</span></p>\r\n<p><span style=\"font-weight: 400;\">Apabila ternyata ada minimal satu kombinasi yang habis dibagi 3, outputkan \"Yes\".</span></p>\r\n<p><strong>Constrain</strong></p>\r\n<p>1 &lt;= T &lt;= 100</p>\r\n<p>1 &lt;= n &lt;= 100</p>\r\n<p>1 &lt;= a<sub>n</sub> &lt;=10<sup>9</sup></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama adalah T, yaitu jumlah test case.</span></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case terdiri dari 2 baris :</span></p>\r\n<ol>\r\n<li><span style=\"font-weight: 400;\"> baris pertama terdiri dari 1 bilangan, yaitu n.</span></li>\r\n<li><span style=\"font-weight: 400;\"> Baris kedua terdiri dari n bilangan (a1, a2, ... an) yang dipisahkan oleh spasi.</span></li>\r\n</ol>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, outputkan \"Yes\" atau \"No\"</span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">9</span></p>\r\n<p><span style=\"font-weight: 400;\">2</span></p>\r\n<p><span style=\"font-weight: 400;\">1 4</span></p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Yes</span></p>\r\n<p><span style=\"font-weight: 400;\">No</span></p>','asset/input_files/c044d5298843edd988ad3b72be300f66.in','asset/output_files/598e1485bfc3661c17985b4bc2a7a885.out',1,'Felix Aditya Wijaya P.W.',170),(546,'H','Multiverse Search','<p><span style=\"font-weight: 400;\">Pertama - tama, selamat tim anda sudah masuk ke babak final. Pada soal pertama babak final ini, kalian akan mencari file kunci jawaban ILPC di sebuah search engine. Kalian hanya perlu menuliskan kata kunci &ldquo;ILPC&rdquo; di search engine untuk mendapatkan kunci jawabannya. Namun secara kebetulan, ILPC adalah nama universe kita. Setelah diselidiki lebih lanjut, ternyata itu bukanlah suatu kebetulan. Namun, nama setiap universe yang ada di semesta ini dipastikan sama dengan nama lomba universe tersebut. Sebagai contoh :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Universe ICLP memiliki nama lomba ICLP</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Universe ILCP memiliki nama lomba ILCP, dan sebagainya.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Panitia di setiap universe sudah tahu kalau terjadi kebocoran kunci jawaban lomba. Namun, para panitia tidak mengetahui kalau ternyata semesta kita punya banyak sekali universe. Hanya kalian yang tahu, karena kalian memiliki teman di tiap tiap universe. Sayangnya, kalian tidak bisa mensubmit query nama lomba di universe kalian. Misalnya, kalian tidak boleh mensubmit query ILPC di universe ILPC. Namun, boleh mensubmit ILPC di universe ICLP. (Ini dikarenakan panitia dapat melacak query apa saja yang disubmit oleh peserta lomba. Kalau ketahuan mencari kunci, maka tim akan didiskualifikasi.</span></p>\r\n<p><span style=\"font-weight: 400;\">Oleh sebab itu, kalian(para peserta dari semua universe) menciptakan sebuah sistem untuk mengatasi hal tersebut. Sistemnya adalah sebagai berikut :</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Setiap query yang ada, akan disimpan di sistem</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sistem dapat memutuskan query tersebut harus dicari di search engine universe mana.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sistem akan mengirim beberapa query sekaligus, dan dapat memutuskan untuk &ldquo;switch&rdquo; atau berpindah universe kapanpun</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Query harus diproses sesuai dengan urutan yang tersimpan di sistem.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sistem tidak akan mengirimkan query ke universe yang namanya sama dengan query.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Berdasarkan penjelasan tersebut, tugas anda adalah mencari jumlah minimum switch antar universe supaya setiap query dapat dijalankan.</span></p>\r\n<p><strong>Constrains</strong><strong><br /></strong><span style=\"font-weight: 400;\">1 &lt;= T &lt;= 100</span></p>\r\n<p><span style=\"font-weight: 400;\">2 &lt;= |S| &lt;= 100</span></p>\r\n<p><span style=\"font-weight: 400;\">0 &lt;= Q &lt;= 1000</span></p>\r\n<p><strong>Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama adalah T, yaitu jumlah test case.</span></p>\r\n<p><span style=\"font-weight: 400;\">Baris pertama untuk setiap test case adalah </span><strong>S</strong><span style=\"font-weight: 400;\">, yaitu jumlah universe yang ada. </span><strong>S</strong><span style=\"font-weight: 400;\"> baris berikutnya adalah nama dari setiap universe.</span></p>\r\n<p><span style=\"font-weight: 400;\">Baris berikutnya adalah </span><strong>Q</strong><span style=\"font-weight: 400;\">, yaitu jumlah query yang tersimpan dalam sistem. </span><strong>Q</strong><span style=\"font-weight: 400;\"> baris berikutnya adalah querynya.</span></p>\r\n<p><strong>Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk setiap test case, outputkan jumlah minimum switch antar universenya.</span></p>\r\n<p><strong>Contoh Input</strong></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><span style=\"font-weight: 400;\">3</span></p>\r\n<p><span style=\"font-weight: 400;\">ILPC</span></p>\r\n<p><span style=\"font-weight: 400;\">IPLC</span><span style=\"font-weight: 400;\"><br /></span><span style=\"font-weight: 400;\">ICPL</span></p>\r\n<p><span style=\"font-weight: 400;\">4</span></p>\r\n<p><span style=\"font-weight: 400;\">ILPC</span></p>\r\n<p><span style=\"font-weight: 400;\">ICPL</span><span style=\"font-weight: 400;\"><br /></span><span style=\"font-weight: 400;\">IPLC</span><span style=\"font-weight: 400;\"><br /></span><span style=\"font-weight: 400;\">ILLL</span></p>\r\n<p><strong>Contoh Output</strong></p>\r\n<p><span style=\"font-weight: 400;\">1</span></p>\r\n<p><strong>Penjelasan :</strong></p>\r\n<p><span style=\"font-weight: 400;\">Untuk menjalankan query, salah satu kemungkinan optimal yang akan dilakukan sistem adalah: </span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Jalankan query ILPC di universe IPLC</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Jalankan query ICPL di universe IPLC</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Query IPLC sama dengan nama universe. Switch ke universe ICPL, lalu jalankan query IPLC di universe ICPL.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Jalankan query ILLL di universe ICPL.</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">Karena terdapat 1 kali switch, dan itu adalah yang optimal (paling sedikit) maka outputkan 1.</span></p>','asset/input_files/8c933a87b734fc1c49fef9172417154a.in','asset/output_files/b87c8d53e6dd348424db48ae293fb976.out',1,'Felix Aditya Wijaya P.W.',170),(547,'B','lkasjlkdahjksabhugyegwq','<p>lkaidsajklj</p>','asset/input_files/ee6d72ba0d6086c49dd1554eeaee0004.in','asset/output_files/64a2fdaca92076308f69776d536ef5d1.out',5,'Felijsljdsakljkl',169),(548,'A','ajksdjkhjkh','<p>asasdasdasd</p>','asset/input_files/a.in','asset/output_files/a.out',1,'1',171);
INSERT INTO `soal_pilgan` VALUES (1,1,'<p>Niadra seorang pengusaha rumah makan. Di toko tempat Niadra biasa belanja selalu ada promo untuk pembelian bahan-bahan tertentu. Dari tahun kemarin Niadra telah mengumpulkan 875 botol kecap bekas. Setiap tujuh botol kecap dapat ditukarkan dengan satu botol kecap baru. Jadi, berapakah botol kecap baru yang diperoleh Niadra?</p>','d',1),(2,2,'<p>Darwin menulis suatu bilangan yang terdiri dari 6 angka (6 digit) di papan tulis, tetapi kemudian Agus menghapus 2 buah angka 5 yang terdapat pada bilangan tersebut sehingga bilangan yang terbaca menjadi 2012. Berapa banyak bilangan dengan enam digit yang dapat Darwin tuliskan agar hal seperti di atas dapat terjadi ?</p>','c',1),(3,3,'<p>Sebuah jam dinding berdentang 1 kali pada jam 1, 2 kali pada jam 2, dan seterusnya hingga berdentang 12 kali pada jam 12. Pada jam 4, jam dinding tersebut berdentang selama 5 detik. Berapa detik yang diperlukan jam dinding tersebut untuk berdentang pada jam 8?</p>','d',1),(4,4,'<p>Jika A dapat dibagi oleh 2911, 3233, 143 dan 1003, maka A juga dapat dibagi oleh :</p>','c',1),(5,5,'<p>Ada permainan beberapa dang beberapa ding dan beberapa dong. Misalkan pula semua dang adalah ding dan beberapa dong adalah dang. Berdasarkan informasi tersebut, yang mana saja dari pernyataan M,L,N yang pasti benar ?</p>\n<p>M : Semua dang adalah dong</p>\n<p>L : Beberapa dang bukan dong</p>\n<p>N: Beberapa dong adalah ding</p>','a',1),(6,1,'<p>Ketika Denny sedang bermain datanglah seorang temannya bernama Dono. Dono datang dengan membawa 3 buah kotak, dimana tiap kotak berisi 2 buah bola dengan label (A dan A, B dan B, A dan B) yang memberitahukan warna dari kedua bola yang ada dalam kotak. Agar permainan menjadi semakin seru, Dono menukar semua label yang ada dengan label yang salah (saling tertukar). Dono menantang Denny untuk membenarkan label yang ada pada ketiga kotak tersebut dengan melakukan pengambilan sebuah bola dari kotak yang bertuliskan A dan B. Berapa banyakkah langkah minimum yang harus dilakukan oleh Denny agar ia bisa membenarkan ketiga label yang ada ?</p>','a',2),(7,2,'<p>Di desa SukaMaju terdapat sebuah kepercayaan bahwa angka 13 merupakan angka sial dan hari Jumat merupakan hari yang dianggap mistis. Jika kedua hal tersebut bertemu (hari Jumat tanggal 13) maka warga diharuskan mengadakan sebuah ritual adat untuk menghindari hal buruk yang dipercaya akan terjadi jika ritual tersebut tidak diadakan. Jika desa tersebut menggunakan sistim penanggalan sesuai dengan kalender masehi, berapakah jumlah minimal ritual adat yang harus dilakukan dalam 1 tahun ?</p>','a',2),(8,3,'<p>Pak Dedy adalah seorang pengusaha sukses, ia memiliki sebuah toko coklat bernama toko &ldquo;Alay Banget&rdquo;. Kebetulan hari ini merupakan hari ulang tahunnya untuk merayakannya ia memberikan bonus sebuah coklat untuk setiap pembelian 5 buah coklat. Andi dan Budi adalah sepasang sahabat yang sangat menggemari coklat, keduanya ingin membeli membeli coklat di toko tersebut. Andi ingin membeli 10 buah coklat, sedangkan Budi ingin membeli 8 buah coklat. Karena sedang ada bonus, mereka memutuskan untuk membeli secara bersamaan agar lebih hemat. Jika harga sebuah coklat adalah Rp 10.000 berapakah jumlah uang yang mereka hemat ?</p>','a',2),(9,4,'<p>Diberikan 4 buah angka yang terdiri dari 2 buah digit. Semua digit dari keempat angka tersebut tidak ada yang sama dan &gt; 0. Jika diketahui bahwa jumlah keempat angkat tersebut adalah 221. Manakah dari pilihan dibawah ini yang tidak termasuk sebagai digit dalam keempat angka tersebut ?</p>','d',2),(10,5,'<p>Dina memiliki 5 buah kartu berwarna putih bertuliskan angka 1 sampai dengan 5, selain itu dia memiliki 4 buah kartu berwarna hitam bertuliskan angka 3 sampai dengan 6. Jika kemudia kartu itu di gabungkan dan kemudian diatur sedemikian rupa hingga memiliki warna yang berselang seling dan jumlah dari kartu putih dan hitam yang bersebelahan adalah sama, berapakah jumlah 3 buah angka yang ada ditengah ?</p>','b',2),(11,6,'<p>Toko coklat &ldquo;Selalu Manis&rdquo; menjual 4 jenis coklat yaitu jenis A, jenis B, jenis C dan jenis D. Agar semakin menarik coklat di jual dalam beberapa kemasan. Kemasan pertama berisi 2 coklat A, 3 coklat B, 1 coklat C dan 4 coklat D. Kemasan kedua berisi 4 coklat A, 1 coklat B, dan 5 coklat C. Kemasan ketiga berisi 2 coklat A, 4 coklat B,&nbsp; 2 coklat C, dan 4 coklat D. Kemasan pertama dijual seharga 40.000 rupiah, kemasan kedua dijual seharga 50.000 rupiah, sedangkan kemasan ketiga dijual seharga 70.000 rupiah. Karena suatu hal, ada seorang pembeli yang hanya ingin membeli masing masing jenis coklat sebanyak 2 buah, berapakah harga yang harus dibayar oleh pembeli tersebut ?</p>','e',2),(12,7,'<p>Dian memiliki uang yang lebih banyak daripada Dini. Selisih kedua uang mereka sebesar 1/3 dari total uang mereka berdua. Jika total uang mereka adalah 90.000 rupiah, berapakah jumlah uang Dian?</p>','e',2),(13,8,'<p>Sebuah tumpukan kartu terdiri dari 52 lembar dengan pembagian 26 kartu berwarna merah dan 26 kartu berwarna hitam. Jika seseorang telah mengocok kartu dan membaginya menjadi 2 yaitu 23 kartu di sebelah kiri dan 29 kartu di sebelah kanan. Berapakah selisih kartu berwarna merah di kiri dan kartu berwarna hitam di kanan?</p>','c',2),(14,9,'<p>Sebuah kota X mempunyai 3 calon walikota. Calon walikota akan dipilih melalui pengambilan suara. Total penduduk yang ada di kota X adalah 40 orang. Jika pengambilan suara akan diadakan besok dan salah seorang calon walikota ingin mengetahui berapa suara yang harus dia dapatkan untuk pasti menjadi walikota. Berapakah suara yang harus ia dapatkan untuk memenangkannya dengan pasti?</p>','b',2),(15,10,'<p>Jika dimiliki sebuah persamaan A,B * A,B = (A * A) + A,CB dan diketahui nilai dari A, B dan C adalah antara 0 sampai 9. Salah satu contohnya adalah 0,0 * 0,0 = (0,0 * 0,0) + 0,00</p>\n<p>Berapakah total semua kemungkinannya ( selain contoh di atas ) ?</p>','c',2),(16,11,'<p>Tersedia 5 digit angka yang masing &ndash; masing digitnya dapat bernilai 0-9, anda harus menebak semua angka tersebut. Bila ada digit yang tertebak dengan benar, anda akan diberi tahu, setelah berapa kali menebakkah pada kasus terburuk anda dapat memastikan nilai dari semua digit tersebut?</p>','b',2),(17,12,'<p>Prisma tegak segitiga ABCDEF memiliki panjang sisi alas AB = 11, BC = 7, dan CA = 13. Jika setiap sisi alsanya diperpanjang menjadi 5x panjang semula dan tingginya diperpendek menjadi setengahnya maka berapa perbandingan prisma yang lama dengan yang baru?</p>','a',2),(18,13,'<p>Untuk merayakan tahun baru, Pak Dede mengadakan sebuah pesta. Pesta tersebut akan dihadiri oleh 87 orang. Di saat tepat jam 12 malam (saat pergantian tahun) Pak Dede menyuruh para hadirin untuk bersalaman satu sama lain. Dalam pesta tersebut juga hadir Nana, Nini, Nunu, Nene dan Nono. Kelimanya bermusuhan karena suatu hal, sehingga mereka tidak mau bersalaman. Berapa salamankah yang akan terjadi di pesta itu?</p>','d',2),(19,14,'<p>Usia Nino dan ayahnya berbeda 30 tahun, 5 tahun lagi&nbsp; jumlah 4 kali usia Nino dan 2 kali usia ayahnya adalah 165 tahun. Sekarang Nono, adik Nino berusia sepersepuluh usia Nino. Jika sekarang Februari 2013 dan Nino berulang tahun, maka bulan apa dan tahun berapakah sebulan setelah Nono lahir?</p>','c',2),(20,15,'<p>Si A, si B, si C, si D, dan si E sedang balapan mobil si suatu sirkuit. Di lap ke-3, A ada di urutan kedua paling belakang . Posisi B kalah dari D, tapi menang dari A. Jika D membalap C tanpa membalap A,B maupun E, maka D akan ada pada posisi pertama, sementara E akan menempati posisi terdepan bila membalap 2 orang. Bagaimana urutan mereka saat itu?</p>','d',2),(21,16,'<p>Si A, si B, si C, si D, dan si E sedang bercakap &ndash; cakap dengan anda, karena ada beberapa orang yang berbohong, percakapan semakin kacau, lalu kelima orang tersebut mengatakan&nbsp; pernyataan &ndash; pernyataan di bawah ini:</p>\n<p>A berkata : B adalah pembohong&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>B berkata : A lah yang pembohong&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>C berkata: E dan A sama-sama jujur &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>D berkata: Akulah yang jujur &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>E berkata: B dan D sama-sama jujur</p>\n<p>Siapa saja yang berkata jujur jika yang berbohong lebih banyak dari yang jujur?</p>','c',2),(22,17,'<p>Seekor ayam menghasilkan 1 telur dalam 1 hari, sehingga dalam 10 hari seekor ayam bertelur 10 kali. Berapa telor yang dihasilkan dalam 22,5 hari?</p>','d',2),(23,18,'<p>Sebuah perusahaan bernama &ldquo;Suka-Suka Saya&rdquo; memiliki tangki air raksasa untuk menampung air hujan. Perusahaan ini berada di kota &ldquo;Selalu Hujan&rdquo; di suatu Negara yang setiap hari selalu turun hujan. Diketahui isi dari tangki tersebut dalam suatu hari adalah dua kali lipat dari hari sebelumnya. Jika tangki air tersebut penuh pada hari ke 30, maka pada hari keberapa isi tangki tersebut hanya seperempat dari maksimal?</p>','e',2),(24,19,'<p>Ani memiliki 4 binatang peliharaan kesayangan yang bernama Aries, Aquarius, Libra, Virgo. Keempat binatang peliharaan Ani adalah seekor Anjing, seekor Kucing, seekor Hamster, seekor Kambing. Dua diantaranya berkelamin jantan. Anjing dan Kambing sekarang sedang hamil. Si Anjing lebih muda dari Virgo, tapi lebih tua dari Aquarius yang sebentar lagi akan memiliki anak. Virgo lebih tua dari Hamster. Siapa nama Kucing kesayangan Ani dan apa jenis kelaminnya?</p>','c',2),(25,20,'<p>Skenario untuk no 20 &ndash; 22</p>\n<p>Seorang kepala sekolah SMA &ldquo;Tanpa Nama&rdquo; sedang menentukan kelas untuk 7 mata pelajaran (K,L,M,N,O,P,Q) di sekolah itu. Sekarang kepala sekolah itu sedang berusaha mengisi 7 ruang kosong yang diberi nomor 1-7 dari kiri ke kanan. Diantara ruangan 4 dan 5 terdapat gudang.Hanya ruangan 1 dan 7 yang memiliki proyektor. Terdapat ketentuan yang tidak dapat dilanggar oleh kepala sekolah, yaitu :</p>\n<ul>\n<li>Ruangan kelas L dan M tidak boleh bersebelahan</li>\n<li>Ruangan N dan O wajib bersebelahan</li>\n<li>Ruangan L harus berada di ruangan 3</li>\n</ul>\n<p>Kelas Programming harus berada di ruangan dengan proyektor</p>\n<p>Pertanyaan no 20:</p>\n<p>Jika Kelas O adalah kelas programming dan jika kelas K dan Q ada di dua runganan yang bersebelahan dengan gudang, di ruang mana kelas M bisa diletakkan?</p>','a',2),(26,21,'<p>Sesuai dengan skenario yang ada pada soal nomor 20, jika Kelas K dan M ada di ruangan bersebelahan dengan gudang dan jika kelas O ada di ruangan 2, yang mana pernyataan yang paling tepat?</p>','c',2),(27,22,'<p>Sesuai dengan skenario yang ada pada soal nomor 20, jika kelas K dan O adalah kelas programming dan jika kelas M tidak bersebelahan dengan gudang, pernyataan yang salah adalah</p>','d',2),(28,23,'<p>Berapakah sisa pembagian 5059<sup>601</sup> oleh 1234?</p>','d',2),(29,24,'<p>Bayangkan sebuah papan catur (ukuran 8 x 8). Ada berapa banyak persegi panjang berbeda yang&nbsp; dapat dibentuk dengan menghubungkan titik-titik sudut persegi ukuran 1x1?&nbsp;</p>','d',2),(30,25,'<p>Terdapat 11 titik&nbsp; pada suatu bidang. Tiga diantaranya terletak segaris. Berapa banyak garis&nbsp; berbeda yang dapat dibuat dengan menghubungkan 2 titik&nbsp; berbeda? (asumsi tidak ada 2 titik yang menempati posisi yang sama)</p>','c',2),(31,26,'<p>Sebuah kantong berisi 6 kelereng merah dan 7 kelereng biru. Valentino akan mengambil 2&nbsp; kelereng sekaligus dari kantong tersebut. Berapakah peluang Valentino mendapat 2 kelereng&nbsp; merah?</p>','a',2),(32,27,'<p>Andi memiliki sejumlah uang. Dia ingin membelanjakan uangnya di beberapa toko. Andi&nbsp; menghabiskan setengah dari jumlah uangnya di toko pertama. Kemudian menghabiskan 1/3 dari&nbsp; sisa uangnya di toko kedua. Kemudian menghabiskan seperempat dari sisa uangnya di toko ke 3.&nbsp; Jika sisa uangnya sekarang adalah Rp 25.000, berapakah uangnya mula-mula?&nbsp;</p>','c',2),(33,28,'<p>Andika memiliki 100 batang rokok. Setiap 5 batang puntung rokok, Andika dapat membuat 1 rokok baru. Berapakah total rokok yang dapat dimiliki Andika?&nbsp;</p>','e',2),(34,29,'<p>Dalam suatu kelas terdapat&nbsp; 10 orang siswa. Berapa banyak kah cara untuk memilih 3 orang di antaranya untuk menjadi ketua, wakil dan bendahara kelas?&nbsp;</p>','d',2),(35,30,'<p>Gambar untuk soal no 30 - 31</p>\n<p>&nbsp;<img title=\"soal30-31\" src=\"/~ifcontest/files/public/Logika30-31.png\" alt=\"Image untuk soal 30 - 31\" width=\"120\" height=\"180\" /></p>\n<p>Dengan menggunakan gambar tersebut ada berapa banyakkah jumlah jajar genjang yang ada / terdapat dalam gambar tersebut ?</p>','d',2),(36,31,'<p>Dengan menggunakan gambar pada soal no 30, ada berapa banyakkah jumlah segienam yang ada / terdapat dalam gambar tersebut ?</p>','c',2),(37,32,'<p>Di atas sebuah papan catur berukuran 8x8, ada berapa kemungkinan peletakan dua buah benteng tanpa saling memakan satu sama lain?</p>','d',2),(38,33,'<p>Jika A adalah 2013<sup>2013 </sup>Berapa digit terakhir dari&nbsp; A<sup>2013</sup>?</p>','d',2),(39,34,'<p>8 orang pemanah sedang berlatih bersama. Mereka diberikan nomor dari 3sampai 10. Di hadapan mereka ada 50 apel yang juga bernomor dari 1sampai 50. Para pemanah ini berlatih memanah dengan cara yang unik. Mereka hanya akan memanah apel yang dinomori sama atau kelipatan dari nomor mereka. Sebagai contoh, pemanah nomor 4 akan memanah apel nomor 4,8,12 dst. Berapakah apel yang tidak dipanah jika setiap pemanah ini selalu mengenai apel sasaran mereka?</p>','b',2),(40,35,'<p>Gambar untuk soal no 35</p>\n<p><img title=\"soal35\" src=\"/~ifcontest/files/public/Logika35.png\" alt=\"Image untuk soal 35\" width=\"100\" height=\"100\" /></p>\n<p>Gambar diatas merupakan sebuah gambar dengan 12 titik didalamnya. Jika dengan menghubungkan beberapa dari ke 12 titik tersebut bisa membentuk persegi (ukuran bebas). Berapa banyak persegi yang bisa didapatkan?</p>','e',2),(41,36,'<p>Pak Deka baru saja merayakan ulang tahunnya yang ke 56 bersama dengan istrinya. Ia telah memiliki dua anak laki laki yang tiap orang memiliki seorang saudara perempuan. Anak perempuan tertua dari Pak Deka telah berkeluarga dan memiliki 2 orang anak. Sedangkan anak anak Pak Deka yang lainnya belum berkeluarga. Berapakah jumlah keluarga besar Pak Deka ?</p>','c',2),(42,37,'<p>Sebuah angka terdiri dari 4 digit, sebutlah sebagai ABCD yang tiap digitnya merupakan sebuah bilangan yang berada diantara 0 sampai 9 (kecuali A tidak boleh 0) dan dalam penggunaannya angka yang sudah muncul boleh muncul kembali (A=1, maka B, C ataupun D boleh sama dengan 1). Jika diketahui A x B = CD berapa banyakkah bilangan ABCD yang memenuhi kriteria tersebut ?</p>','c',2),(43,38,'<p>Seorang perternak mengetahui bahwa 20 ekor ayam, di 2 kandang berbeda, menetaskan 30 telor dalam 21 hari. Berapa waktu yang diperlukan 30 ekor ayam di 4 kandang berbeda untuk menetaskan telor dalam jumlah sama?</p>','d',2),(44,39,'<p>Jika dimiliki sebuah angka A dan B, dan A merupakan hasil penjumlahan 2013 angka genap pertama yang dimulai dari angka 1, sedangkan B merupakan hasil penjumlahan 2013 angka ganjil pertama yang dimulai dari angka 1. Berapakah selisih dari A dan B?</p>','c',2),(45,40,'<p>Di Teknik Informatika Ubaya 40% mahasiswa perempuan memakai kacamata, dan 70% mahasiswa laki-laki memakai kacamata. Bila persentase mahasiswa perempuan adalah 40% dan jumlah mahasiswa laki-laki yang tidak berkacamata adalah 9, maka berapakah mahasiswa perempuan yang tidak memakai kacamata?&nbsp;</p>','d',2),(46,1,'<p>Ketika Denny sedang bermain datanglah seorang temannya bernama Dono. Dono datang dengan membawa 3 buah kotak, dimana tiap kotak berisi 2 buah bola dengan label (A dan A, B dan B, A dan B) yang memberitahukan warna dari kedua bola yang ada dalam kotak. Agar permainan menjadi semakin seru, Dono menukar semua label yang ada dengan label yang salah (saling tertukar). Dono menantang Denny untuk membenarkan label yang ada pada ketiga kotak tersebut dengan melakukan pengambilan sebuah bola dari kotak yang bertuliskan A dan B. Berapa banyakkah langkah minimum yang harus dilakukan oleh Denny agar ia bisa membenarkan ketiga label yang ada ?</p>','a',3),(47,2,'<p>Di desa SukaMaju terdapat sebuah kepercayaan bahwa angka 13 merupakan angka sial dan hari Jumat merupakan hari yang dianggap mistis. Jika kedua hal tersebut bertemu (hari Jumat tanggal 13) maka warga diharuskan mengadakan sebuah ritual adat untuk menghindari hal buruk yang dipercaya akan terjadi jika ritual tersebut tidak diadakan. Jika desa tersebut menggunakan sistim penanggalan sesuai dengan kalender masehi, berapakah jumlah minimal ritual adat yang harus dilakukan dalam 1 tahun ?</p>','a',3),(48,3,'<p>Pak Dedy adalah seorang pengusaha sukses, ia memiliki sebuah toko coklat bernama toko &ldquo;Alay Banget&rdquo;. Kebetulan hari ini merupakan hari ulang tahunnya untuk merayakannya ia memberikan bonus sebuah coklat untuk setiap pembelian 5 buah coklat. Andi dan Budi adalah sepasang sahabat yang sangat menggemari coklat, keduanya ingin membeli membeli coklat di toko tersebut. Andi ingin membeli 10 buah coklat, sedangkan Budi ingin membeli 8 buah coklat. Karena sedang ada bonus, mereka memutuskan untuk membeli secara bersamaan agar lebih hemat. Jika harga sebuah coklat adalah 10.000 rupiah berapakah jumlah uang yang mereka hemat ?</p>','a',3),(49,4,'<p>Diberikan 4 buah angka yang terdiri dari 2 buah digit. Semua digit dari keempat angka tersebut tidak ada yang sama dan &gt; 0. Jika diketahui bahwa jumlah keempat angkat tersebut adalah 221. Manakah dari pilihan dibawah ini yang tidak termasuk sebagai digit dalam keempat angka tersebut ?</p>','d',3),(50,5,'<p>Dina memiliki 5 buah kartu berwarna putih bertuliskan angka 1 sampai dengan 5, selain itu dia memiliki 4 buah kartu berwarna hitam bertuliskan angka 3 sampai dengan 6. Jika kemudia kartu itu di gabungkan dan kemudian diatur sedemikian rupa hingga memiliki warna yang berselang seling dan jumlah dari kartu putih dan hitam yang bersebelahan adalah sama, berapakah jumlah 3 buah angka yang ada ditengah ?</p>','b',3),(51,1,'<p>Niadra seorang pengusaha rumah makan. Di toko tempat Niadra biasa belanja selalu ada promo untuk pembelian bahan-bahan tertentu. Dari tahun kemarin Niadra telah mengumpulkan 875 botol kecap bekas. Setiap tujuh botol kecap dapat ditukarkan dengan satu botol kecap baru. Jadi, berapakah botol kecap baru yang diperoleh Niadra?</p>','e',4),(52,2,'<p>Darwin menulis suatu bilangan yang terdiri dari 6 angka (6 digit) di papan tulis, tetapi kemudian Agus menghapus 2 buah angka 5 yang terdapat pada bilangan tersebut sehingga bilangan yang terbaca menjadi 2012. Berapa banyak bilangan dengan enam digit yang dapat Darwin tuliskan agar hal seperti di atas dapat terjadi ?</p>','c',4),(53,3,'<p>Sebuah jam dinding berdentang 1 kali pada jam 1, 2 kali pada jam 2, dan seterusnya hingga berdentang 12 kali pada jam 12. Pada jam 4, jam dinding tersebut berdentang selama 5 detik. Berapa detik yang diperlukan jam dinding tersebut untuk berdentang pada jam 8</p>','e',4),(54,4,'<p>Jika A dapat dibagi oleh 2911, 3233, 143 dan 1003, maka A juga dapat dibagi oleh :</p>','e',4),(55,5,'<p>Ada permainan beberapa dang beberapa ding dan beberapa dong. Misalkan pula semua dang adalah ding dan beberapa dong adalah dang. Berdasarkan informasi tersebut, yang mana saja dari pernyataan M,L,N yang pasti benar ?</p>\n<p>M : Semua dang adalah dong</p>\n<p>L : Beberapa dang bukan dong</p>\n<p>N: Beberapa dong adalah ding</p>','a',4),(56,1,'<p>Ada 7 orang disebuah bioskop dan mau duduk untuk nonton bersama tetapi beberapa dari mereka lebih memilih untuk duduk berdekatan bersama dengan sahabatnya. Mereka bernama a,b,c,d,e,f,g posisi tempat duduk adalah:</p>\n<p>[&nbsp; ] [&nbsp; ] [&nbsp; ]</p>\n<p>&nbsp; &nbsp; &nbsp; [x]</p>\n<p>[&nbsp; ] [&nbsp; ] [&nbsp; ]</p>\n<p>&nbsp;</p>\n<p>Siapakah yang duduk di posisi x jika diketahui:</p>\n<ul>\n<li>A tidak mau duduk berdekatan dengan B dan F ia lebih memilih untuk duduk berdekatan dengan C atau E</li>\n<li>B tidak mau duduk berdekatan dengan A atau F, ia lebih memilih untuk duduk berdekatan dengan D dan G</li>\n<li>G tidak mau duduk berdekatan dengan D dan F, ia lebih memilih untuk duduk berdekatan dengan B dan E</li>\n<li>F tidak mau duduk bersampingan dengan E, ia lebih memilih bersebelahan bersama C</li>\n</ul>','c',5),(57,2,'<p>Dari soal nomer 1,siapakah yang duduk disebelah D?</p>','b',5),(58,3,'<p>Sebuah jam berdentang 1 kali pada jam 1, 2 kali pada jam 2 dan seterusnya hingga 12 kali pada jam 12. pada jam 3 jam dinding tersebut berhenti berdentang setelah 3 detik. Setelah berapa detik jam dinding tersebut berhenti berdentang bila sekarang tepat pukul 8?</p>','d',5),(59,4,'<p>Urutkan dari yang paling kecil ke yang paling besar</p>\n<p>I.&nbsp; 2222^5555</p>\n<p>II. 5555^2222</p>\n<p>III.0^1</p>\n<p>IV. 1^0</p>\n<p>V.&nbsp; 9999^999</p>','c',5),(60,5,'<p>Urutkan dari yang paling ringan ke yang paling berat</p>\n<p>i.&nbsp; kapas 101kg</p>\n<p>ii. besi 100.0kg</p>\n<p>iii.emas 100g</p>\n<p>iv. pasir 10kg</p>\n<p>v.&nbsp; debu 100.1g</p>','c',5),(61,6,'<p>Berapa kali muncul angka 8 dan 9 dalam bilangan 1-8000</p>','a',5),(62,7,'<p>Hasil 4^99 mod 100 adalah</p>','b',5),(63,8,'<p>Manakah yang paling besar hasilnya?&nbsp;</p>\n<p>I.&nbsp; 999^9&nbsp;&nbsp; mod 200</p>\n<p>II. 9^999&nbsp;&nbsp; mod 200</p>\n<p>III.200^9&nbsp;&nbsp; mod 999</p>\n<p>IV. 200^999 mod 9&nbsp;</p>','c',5),(64,9,'<p>Pada sebuah kotak terdapat 7 kartu biru 3 kartu hijau 8 kartu merah dan 4 kartu pink. berapa minimal banyak kartu yang diambil agar setidaknya pasti mendapatkan 5 kartu berwarna sama?</p>','d',5),(65,10,'<p>Sebuah lingkaran akan dibagi menjadi beberapa bidang menggunakan 5 buah garis lurus. berapa banyak bidang yang dapat terbentuk maksimal?</p>','d',5),(66,11,'<p>Diberikan deret 3, 13, 1113, 3113, 132113, 1113122113, ... di suku ke berapa kah angka 4 pertama kali muncul?</p>','e',5),(67,12,'<p>Jika x = 0.725, y = &radic;0.724, z = (0.723)<sup>2</sup>, manakah pernyataan berikut yang paling benar?</p>','e',5),(68,13,'<p>Jika a dan b adalah bilangan bulat dan a + b adalah bilangan genap, maka berikut ini yang pasti tidak mungkin menghasilkan bilangan ganjil adalah</p>','b',5),(69,14,'<p>Mona membeli sebuah tas berkelas dengan diskon 20% dan membayar seharga Rp. 4.800.000,-. Lola yaitu seorang penggila tas ini ingin membeli tas yang dimiliki Mona dengan harga 15% lebih dari yang seharusnya Mona bayar. Berapa untung atau rugi Mona?</p>','a',5),(70,15,'<p>Ada 3 saudara memberi berbagai pernyataan :</p>\n<p>A : &ldquo; aku punya tiga kakak laki-laki dan satu adik perempuan&rdquo;</p>\n<p>B : &ldquo;aku punya dua kakak laki-laki dan dua adik perempuan&rdquo;</p>\n<p>C : &ldquo;aku punya satu kakak laki-laki dan tiga adik perempuan&rdquo;</p>\n<p>Dari pernyataan di atas, berapa jumlah terkecil saudara ini?</p>','b',5),(71,16,'<p>Bejo dan Jono adalah pegawai di kantor pak Beno. Bejo memiliki arloji yang ia pikir lima belas menit lebih lambat dari jam kantornya, tapi sebenarnya lima belas menit lebih cepat. Jono memiliki arloji yang menurutnya lima belas menit lebih cepat dari jam kantor tapi sebenarnya lima belas menit lebih lambat. Bila mereka berdua dijadwalkan untuk tiba pada pukul 08.00 di kantor oleh pak Beno, berapa selisih waktu kedatangan mereka?</p>','c',5),(72,17,'<p>8 orang bermain game berbisik, tujuannya adalah untuk menyebarkan pesan ke semua orang. Untuk membisikkan kepada 1 orang dibtuhukan waktu 1 menit dan setiap pesan disampaikan hanya boleh ada 1 pendengar. Jika pada awal hanya ada 1 orang yang mendapat pesan. Berapa menit tercepat agar semua orang di ruangan sudah mendengarkan pesan tersebut?</p>','a',5),(73,18,'<p>Sebuah kapal akan tenggelam dalam waktu 25 menit! Ada 15 orang yang terkurung di kapal itu dan sayangnya hanya ada 1 sekoci penyelamat yang hanya bisa diisi 4 orang. Perairan di sana penuh dengan hiu yang lapar. Ada pulau terdekat yang mebutuhkan waktu 4 menit untuk menuju ke pulau itu dan sebaliknya. Berapa orang yang tidak dapat menginjak daratan kembali?</p>','c',5),(74,19,'<p>&nbsp;Perhatikan gambar berikut :</p>\n<p><img src=\"/asset/public/Soal%2019.PNG\" alt=\"soal 19\" width=\"302\" height=\"124\" /></p>\n<p>Berapa banyak kombinasi cara menyusun yang dapat dilakukan untuk mengisi penuh kotak 5x5m dengan persegi 1x1m dan/atau segitiga dengan alas 1m dan tinggi 1m diatas ?</p>','c',5),(75,20,'<p>Budi sedang mengisi air ke dalam sebuah tabung besar bervolume <strong>V</strong> cm<sup>3</sup> miliknya.&nbsp; Namun ternyata tabung tersebut memiliki lubang kecil pada <sup>1</sup>/<sub>5</sub> tinggi tabung diukur dari dasar tabung. Lubang tersebut mampu mengeluarkan air sebanyak <strong>A</strong> cm<sup>3</sup> tiap detiknya, dimana A adalah <sup>1</sup>/<sub>x</sub> dari Volume air yang mampu dikeluarkan oleh kran air per detiknya.</p>\r\n<p>Apabila waktu untuk mengisi setengah dari tabung adalah 13 V / 60 A&nbsp;, berapakah waktu yang dibutuhkan untuk mengisi penuh tabung yang bocor ini?</p>','d',5),(76,21,'<p>Sepuluh tahun lalu, umur Eric adalah dua kali umur David.&nbsp; Tahun ini (2014) , jumlah dari tiga kali umur Eric dan dua kali umur Peter adalah 146. Berapakah penjumlahan umur Eric,Peter dan David pada tahun 2021?</p>','e',5),(77,22,'<p>Hasil dari &nbsp;<img src=\"/asset/public/Soal%2022.PNG\" alt=\"soal 22\" width=\"354\" height=\"27\" />&nbsp;adalah</p>','d',5),(78,23,'<p>Di sebuah sirkuit,&nbsp; Meliza, Dewi,dan Devina sedang menguji tiga mobil listrik baru milik mereka masing-masing. Lalu mereka bergantian menjalankan mobil secara berlawanan arah pada lintasan seperti pada gambar.</p>\n<p><img src=\"/asset/public/Soal%2023.png\" alt=\"soal 23\" width=\"449\" height=\"107\" /></p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ketika mobil Meliza dan Dewi berada di lintasan, mobil mereka bertemu setelah 10 detik.</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ketika mobil Dewi dan Devina berada di lintasan, mobil mereka bertemu setelah 9 detik.</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kecepatan mobil Meliza, Dewi, dan Devina masing-masingnya selalu tetap dalam setiap pengujian di lintasan.</p>\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lintasan yang sama selalu digunakan dalam pengujian, dan kedua mobil selalu start dari ujung lintasan.</p>\n<p>Pertanyaan :</p>\n<p>Manakah pernyataan berikut ini yang pasti salah ?</p>','c',5),(79,24,'<p>Asumsikan dalam pengujian tadi ternyata kecepatan mobil Dewi sama dengan kecepatan mobil Devina dan panjang lintasan uji adalah 540 meter. Ketiga mobil tersebut kemudian bertanding dalam suatu balapan pada lintasan yang panjangnya dua kali lipat lintasan uji. Ketiga mobil tersebut start pada ujung lintasan dengan kecepatan tetap seperti saat pengujian dilakukan. Namun baterai mobil Devina mengalami gangguan sehingga kecepatannya turun menjadi setengah kecepatan semula. Pada jarak berapakah gangguan tersebut muncul dari garis finish sehingga menyebabkan mobil Devina finish setelah mobil Meliza?</p>','a',5),(80,25,'<p>Si A, si B, si C, si D, dan si E adalah lima orang pembalap. Mereka sedang balapan mobil si suatu sirkuit. Di lap ke-3, A ada di urutan kedua paling belakang . Posisi B kalah dari D, tapi menang dari A. Bila D membalap C tanpa membalap A,B maupun E, maka D akan ada pada posisi pertama, sementara E akan menempati posisi terdepan bila membalap 2 orang. Pada pernyataan-pernyataan berikut ini, manakah yang pasti salah?</p>','d',5),(81,26,'<p>Dari soal sebelumnya, bagaimana urutan mereka saat itu jika E membalap satu orang di depannya?</p>','b',5),(82,27,'<p>Sesudah balapan mobil selesai, kelima pembalap tersebut saling bersalaman lalu masuk ke satu ruangan untuk berpesta. Di dalam ruangan tersebut sudah terdapat 100 orang, yaitu kru-kru dari kelima tim mereka. Di pesta itu setiap orang akan bersalaman dengan setiap orang lainnya. Karena kelima pembalap tersebut sudah bersalaman satu sama lain sebelum pesta, mereka tidak saling bersalaman lagi pada pesta ini, tetapi mereka akan tetap bersalaman dengan para kru. Berapa jumlah salaman yang terjadi di pesta ini?</p>','a',5),(83,28,'<p>Di tengah pesta tersebut, Si A, si B, si C, si D, dan si E sedang bercakap &ndash; cakap dengan salah satu kru. Karena ada beberapa orang yang berbohong, percakapan semakin kacau, lalu kelima orang tersebut mengatakan&nbsp; pernyataan &ndash; pernyataan di bawah ini:</p>\n<p>A berkata : B adalah pembohong&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>B berkata : A lah yang pembohong</p>\n<p>C berkata: E dan A sama-sama jujur</p>\n<p>D berkata: Akulah yang jujur</p>\n<p>E berkata: B dan D sama-sama jujur</p>\n<p>Siapa saja yang berbohong jika yang berbohong lebih banyak dari yang jujur?</p>','d',5),(84,29,'<p>Prisma tegak segitiga ABCDEF memiliki panjang sisi alas AB = x, BC = y, dan CA = z. Jika setiap sisi alsanya diperpanjang menjadi 5 kali panjang semula dan tingginya diperpendek menjadi seperempatnya maka berapa perbandingan volume prisma yang lama dengan yang baru?</p>','d',5),(85,30,'<p>Usia David dan ayahnya berbeda 30 tahun, 5 tahun lagi&nbsp; jumlah 4 kali usia David dan 2 kali usia ayahnya 150 tahun. Sekarang Daniel, adik David berusia tepat sepersepuluh usia David. Jika sekarang Februari 2014 dan David berulang tahun, maka bulan apa dan tahun berapakah tiga bulan setelah Daniel lahir?</p>','d',5),(86,31,'<p>Ada seekor ayam unik. Setiap jam, dia akan bersuara &lsquo;kukuruyuk&rsquo; sejumlah jam tersebut. Misal sekarang jam 2, dia akan bersuara &lsquo;kukuruyuk&rsquo; sebanyak 2 kali. Untuk setiap &lsquo;kukuryuk&rsquo; butuh waktu 3 detik. Bila sekarang jam 12, berapa detik yang kita butuhkan untuk tahu bahwa sekarang adalah jam 12?</p>','d',5),(87,32,'<p>Saat lampu mati, anda menyalakan 7 lilin untuk menerangi anda mengerjakan tugas. Karena ada angin kencang 3 lilin mati, tapi anda kembali bekerja. Kemudian 1 lilin mati lagi dan anda pun menutup jendela kamar anda dan kemudian tidur. Berapa lilin yang akan tersisa pada nantinya?</p>','c',5),(88,33,'<p>Bona dan Lilo membawa sejumlah kue, lalu Bona memakan 1 kue dan Lilo memakan 2 kue. Jika setelah itu Bona memberikan 1 kue ke Lilo maka jumlah kue yang mereka bawa sama. Jika Lilo memberikan 2 kue ke Bona, maka jumlah kue Bona 3 kali lipat milik Lilo. Berapa hasil kali dua kue yang mereka miliki pada awalnya?</p>','a',5),(89,34,'<p>Boni sedang berjalan-jalan di sebuah mal di luar negeri. Kemudian Boni melihat sebuah laptop yang sangat keren dan tasnya yang berkualitas tinggi. Si penjual memberi harga paket yaitu $620 untuk kedua barang tersebut. Penjual memberi tahu bahwa harga laptopnya adalah $600 lebih dari harga tasnya dan harga tas adalah harga paket dikurangi harga laptop. Boni akhirnya tidak jadi beli laptop tapi tetap berniat membeli tasnya. Boni memberikan uang $50. Berapa kembaliannya?</p>','d',5),(90,35,'<p>Lima ekor burung kingfisher bisa menangkap lima ekor ikan dalam waktu lima menit. Berapa burung yang dibutuhkan untuk menangkap 100 ikan dalam waktu 100 menit?</p>','b',5),(91,36,'<p>Sebuah boneka seharga Rp 24.000,- sedang diinginkan 3 orang sahabat</p>\n<p>Moni : &ldquo;Dengan uang jajanku dan Bebe bisa beli boneka itu dalam 3 minggu.&rdquo;</p>\n<p>Nani : &ldquo;aku dan Bebe bisa beli hanya dalam 2 minggu.&rdquo;</p>\n<p>Bebe : &ldquo;kalian berdua bisa beli itu dalam 6 minggu.&rdquo;</p>\n<p>Asumsi tiap jajan diberikan setiap minggu. Berapa uang jajan Moni?</p>','e',5),(92,37,'<p>Bakteri Cyno-X adalah bakteri yang akan membelah diri setiap 1 menit. Pada pukul 15:00 dimasukan seekor bakteri Cyno-X ke dalam sebuah gelas kaca. Bakteri tersebut terus berkembang biak. Pada pukul 15:15 setengah dari gelas kaca tersebut sudah terpenuhi bakteri. Pada pukul berapakah gelas kaca tersebut penuh dengan bakteri tersebut?</p>','a',5),(93,38,'<p>Terdapat deretan bilangan:</p>\n<p>101 202 404 808....</p>\n<p>147 1482 5682&nbsp; 5730....</p>\n<p>99 198 1782 5742....</p>\n<p>Bila angka pertama deret berikutnya adalah 123, bagaimana jadinya deret tersebut ?</p>','a',5),(94,39,'<p>Terdapat suatu bilangan. apabila bilangan tersebut dikali x, maka selisih dari bilangan tersebut dengan hasil&nbsp; perkaliannya adalah 10 kalinya. berapakah nilai x?</p>','c',5),(95,40,'<p>Goku adalah seorang anak yang kuat dalam bertarung. Dia harus latihan untuk tournamen besok, namun lusa ada ulangan. Ulangan akan dianggap lulus selama nilai diatas 65. Jika bahan ulangan adalah sebanyak 7 bab dan ia tahu bahwa ulangan akan keluar sebanyak 5 soal yang tiap soal adalah bab yang berbeda dan berbobot nilai sama, berapa bab yang harus ia pelajari supaya ia bisa memiliki waktu berlatih untuk turnamen secara maksimal?</p>','e',5),(97,1,'<p>1</p>','a',7),(98,1,'<p>sdaasdasd</p>','a',8),(99,2,'<p>s</p>','a',8),(106,1,'<ol>\n<li>Manakah yang paling besar hasilnya?</li>\n</ol>\n<p>I. &nbsp; 999^9&nbsp;&nbsp; mod 200</p>\n<p>II. &nbsp;9^999&nbsp;&nbsp; mod 200</p>\n<p>III. 200^9&nbsp;&nbsp; mod 999</p>\n<p>IV. 200^999 mod 9&nbsp;</p>','c',12),(107,2,'<p>Pada sebuah kotak terdapat 7 kartu biru 3 kartu hijau 8 kartu merah dan 4 kartu pink. berapa minimal banyak kartu yang diambil agar setidaknya pasti mendapatkan 5 kartu berwarna sama?</p>','d',12),(108,3,'<p>Sebuah lingkaran akan dibagi menjadi beberapa bidang menggunakan 5 buah garis lurus. berapa banyak bidang yang dapat terbentuk maksimal?</p>','d',12),(109,4,'<p>Diberikan deret 3, 13, 1113, 3113, 132113, 1113122113, ... di suku ke berapa kah angka 4 pertama kali muncul?</p>','e',12),(110,5,'<p>Jika x = 0.725, y = &radic;0.724, z = (0.723)<sup>2</sup>, manakah pernyataan berikut yang paling benar?</p>','e',12),(111,1,'<p>jwban: b</p>','b',13),(112,2,'<p>jwban: e</p>','e',13),(113,1,'<p>jawaban a</p>','a',14),(114,2,'<p>jawaban b</p>','b',14),(115,1,'<p>Scotland Yard menerima sebuah surat dari Lupin, isi surat tersebut adalah sebuah daftar dari Lupin yang nantinya akan di curi, berikut adalah isi surat tersebut:</p>\n<p>-&nbsp;&nbsp; Liberty</p>\n<p>-&nbsp;&nbsp; Eiffel</p>\n<p>-&nbsp;&nbsp; Borobudur</p>\n<p>-&nbsp;&nbsp; Monas</p>\n<p>-&nbsp;&nbsp; Macan Singapura</p>\n<p>-&nbsp;&nbsp; Colosseum</p>\n<p>&nbsp;</p>\n<p>Karena dikira surat palsu Scotland Yard membiarkan surat itu. Pada keesokan harinya, Borobudur telah menghilang. Scotland yard menyadari surat itu ternyata serius lalu berusaha mencari tahu apa yang akan di curi selanjutnya. Kepolisian Scotland Yard memutuskan untuk memberi arahan untuk polisi Indonesia untuk siaga di monas, namun pada keesokan harinya macan singapuralah yang hilang. Sekali lagi Scotland Yard berusaha menemukan pola pencurian Lupin, dan menentukan Piramida, ternyata keesokan harinya Liberty yang menghilang. Karena tidak bisa menebak lagi Scotland yard meminta bantuan Sherlock Holmes, dan dalam hitungan detik Sherlock holmes tertawa dan bilang &ldquo;Dari dulu sampai sekarang sama saja. Ayo tangkap Lupin!&rdquo; kemanakah Sherlock pergi untuk menangkap Lupin?<span style=\"text-decoration: underline;\"><br /></span></p>','a',15),(116,2,'<p>Ada 5 rumah, masing-masing rumah memelihara seekor binatang. Perhatikan fakta-fakta berikut ini :</p>\n<p>-&nbsp;&nbsp; Orang yang memelihara Anjing bertetangga dengan orang yang memelihara tikus.</p>\n<p>-&nbsp;&nbsp; Orang yang memelihara ular berada di paling kanan.</p>\n<p>-&nbsp;&nbsp; Orang yang memelihara Kucing berada tepat di sebelah kiri orang yang memelihara anjing.</p>\n<p>-&nbsp;&nbsp; Tetangga orang yang memelihara ular tidak memelihara tikus.</p>\n<p>Berdasarkan fakta-fakta diatas, Siapakah yang memelihara Ikan?</p>','e',15),(117,3,'<p>Diketahui premis-premis:</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Adi sedang bermain atau listrik mati</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jika listrik mati, Budi tidak pergi ke rumah Adi</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; iii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Budi pergi ke rumah Adi</p>\n<p>Kesimpulan yang benar adalah &hellip;.</p>','b',15),(118,4,'<p>Dua buah dadu dilempar secara bersamaan. Berapa peluang mendapatkan jumlah dadu ganjil tidak lebih dari 8?</p>','d',15),(119,5,'<p>a dan b adalah bilangan prima terbesar dan terkecil yang dapat membagi habis 5005. Berapakah selisih a dan b?</p>','b',15),(120,6,'<p>Di kebun binatang terdapat 112 ekor binatang berkaki empat dan berkaki dua. Total kaki a bintang berkaki empat ditambah b binatang berkaki dua adalah 310. Berapakah a x b?</p>','d',15),(121,7,'<p>Adi memiliki persegi ajaib berukuran 4 x 4. Sayangnya persegi tersebut belum lengkap.</p>\n<table style=\"width: 150px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">4</p>\n</td>\n<td valign=\"top\" width=\"42\">\n<p align=\"left\">A</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">5</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">14</p>\n</td>\n<td valign=\"top\" width=\"42\">\n<p align=\"left\">&nbsp;</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">11</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">C</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">&nbsp;</p>\n</td>\n<td valign=\"top\" width=\"42\">\n<p align=\"left\">6</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">&nbsp;</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">3</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">1</p>\n</td>\n<td valign=\"top\" width=\"42\">\n<p align=\"left\">B</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">8</p>\n</td>\n<td valign=\"top\" width=\"36\">\n<p align=\"left\">13</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>Jika persegi ajaib tersebut diisi bilangan bulat dari 1 sampai dengan 16&nbsp; total bilangan-bilangan dalam setiap kolom / baris / diagonal adalah sama, maka A + B + C = ...</p>','a',15),(122,8,'<p>Di dalam sebuah kotak terdapat 2 buah bola kuning, 5 buah bola biru, dan 8 buah bola hitam. Berapa minimal bola yang perlu diambil dari kotak tersebut agar kita pasti mendapatkan setidakanya 5 bola berwarna sama?</p>','c',15),(123,9,'<p>Palindrome adalah bahasa dimana sebuah kata dibaca dari depan dan belakang sama (co. &ldquo;aka&rdquo;, &ldquo;akka&rdquo;, dsb). Waktu juga bisa dibaca secara palindrome, seperti pukul 12.21 dimana dibaca dari depan dan belakang sama. Berapa jarak waktu paling kecil diantara 2 waktu palindrome? Contoh antara pk 11:11 dan 12:21 jarak waktunya adalah 1 jam 10 menit.</p>','b',15),(124,10,'<p>Di sebuah desa yang sangat-sangat terpencil dimana tidak ada alat-alat elektronik maupun aliran listrik. Terdapat 10 anak di dalam rumah dimana masing-masing mempunyai aktivitas sebagai berikut :</p>\n<p>Anak ke &ndash; 1 : menyiram bunga di taman</p>\n<p>Anak ke &ndash; 2 : membetulkan atap rumah</p>\n<p>Anak ke &ndash; 3 : masak makan malam</p>\n<p>Anak ke &ndash; 4 : baca komik</p>\n<p>Anak ke &ndash; 5 : mengerjakan tugas sekolah</p>\n<p>Anak ke &ndash; 6 : bermain catur</p>\n<p>Anak ke &ndash; 7 : tidur sambil mendengkur</p>\n<p>Anak ke &ndash; 8 : bersih-bersih rumah</p>\n<p>Anak ke &ndash; 9 : sedang berada di toilet</p>\n<p>Apa yang sedang dilakukan anak ke &ndash; 10?</p>','d',15),(125,11,'<p>Seutas kabel serat optik yang panjangnya 200 meter diketahui terputus didalamnya tepat di satu posisi. Karena secara fisik tidak terlihat adanya tanda-tanda dimana lokasi yang putus itu, kabel dipotong-potong sbb.</p>\n<ul>\n<li>Pertama kabel dipotong ditengah, lalu masing-masing diperiksa,</li>\n<li>Bagian yang baik disimpan untuk disambung-sambungkan kembali nanti,</li>\n<li>Sementara yang di dalamnya terputus kembali dipotong ditengahnya, hingga potongan sudah terlalu kecil, langsung dibuang.</li>\n</ul>\n<p>Potongan-potongan kabel yang baik kemudian disambung-sambungkan kembali dengan biaya penyambungan 25 ribu per sambungan. Kabel yang sudah disambung-sambungkan itu nanti masih dapat dijual seharga 5 ribu per meter. Asumsikan bahwa tidak terjadi perubahan panjang sebelum dan setelah penyambungan, berapa banyak sambungan yang dibuat agar nilai penjualan setelah dikurangi biaya penyambungannya adalah sebesar-besarnya?</p>','c',15),(126,12,'<p>Sebuah tangki air memiliki enam buah kran air di bagian dasarnya. Jika semua kran dibuka maka tangki yang terisi penuh akan habis isinya dalam 8 jam. Berapa jam-kah yang dibutuhkan untuk menghabiskan isi tangki bila hanya 4 buab kran yang dibuka?</p>','d',15),(127,13,'<p>Seutas tali dibagi menjadi 5 bagian dengan membentuk suatu barisan geometri. Jika tali yang paling pendek adalah 16 cm dan tali yang paling panjang adalah 81cm, maka panjang semua tali yang memiliki panjang genap adalah &hellip;</p>','e',15),(128,14,'<p>Seorang duda dan janda baru menikah. Mereka kemudian menjadi ayah dan ibu dari anak-anak mereka. Sang duda mempunyai 2 orang anak laki-laki. Sang janda juga mempunyai 2 orang anak laki-laki. Setiap anak laki-laki sang janda dan duda mempunyai serorang adik perempuan. Berapa jumlah anggota keluarga mereka sekarang?</p>','b',15),(129,15,'<p>Sebuah pintu sihir akan terbuka jika seseorang dapat mengerti apa yang dimaksudkan oleh pintu tersebut. tiap hari ada penyihir yang masuk ke pintu tersebut. jika hari pertama pintu tersebut berkata &ldquo;Sembilan&rdquo; maka penyihir menjawab &ldquo;delapan&rdquo;. Hari kedua pintu berkata &ldquo;enam&rdquo; penyihir berkata &ldquo;empat&rdquo;. Jika hari ketiga pintu berkata &ldquo;tujuh&rdquo; dan penyihir berkata &ldquo;lima&rdquo;, maka pada hari ke 4 pintu berkata&rdquo;dua&rdquo; penyihir harus berkata apa?</p>','a',15),(130,16,'<p>Sebuah tanaman eceng gondok menggandakan luas area yang ditinggali menjadi 2 kali lipat dalam waktu 24 jam. Jika dalam 60 hari sungai yang ditinggali eceng gondok tersebut menjadi penuh, maka berapa hari yang diperlukan eceng gondok tersebut untuk mengisi setengah bagian dari sungai tersebut?</p>','c',15),(131,17,'<p>Budi ingin mengambil sepasang kaos kaki yang berwarna sama. Di dalam lacinya terdapat 4 pasang kaos kaki berwarna biru, 5 pasang kaos kaki berwarna hitam, 6 pasang kaos kaki berwarna merah. Kaos kaki tersebut terletak berantakan di dalam laci, jika lampu mati sehingga ruangan gelap total, berapakah jumlah kaos kaki minimum yang harus diambil agar pasti mendapat 2 buah kaos kaki yang berwarna sama?</p>','c',15),(132,18,'<p>Jumlah berat sebuah apel, jeruk, dan semangka adalah 170kg. dimana berat semangka 100kg lebih berat dari berat apel ditambah jeruk. Jika berat apel 60% lbh ringan dari berat jeruk. Maka berapa berat buah apel,jeruk dan semangka secara berurutan?</p>','e',15),(133,19,'<p>Terdapat 2 buah segitiga. Segitiga manakah yang memiliki luas lebih besar jika digambar di sebuah kertas, jika segitiga 1 memiliki dimensi 30cm,40cm,70cm dan segitiga 2 memiliki dimensi 30cm,40cm,50cm?</p>','b',15),(134,20,'<p>Seorang ayah akan dibelikan rumah dan mobil oleh 4 orang anaknya. Anak sulung akan membayar 1/3 dari totalnya. Ketiga adiknya akan membayar masing-masing 1/3 dari sisanya. Apabila total uang anak sulung dan bungsu sebanyak 6 milyar, Berapa total rumah dan mobil untuk ayah mereka?</p>','a',15),(135,21,'<p>Jumlah 5 digit pertama dari hasil 8<sup>10012 </sup>x 5<sup>30003</sup> adalah</p>','b',15),(136,22,'<p>(Untuk Nomor 22-25)</p>\n<p>Kepala sekolah sedang memilih sebuah tim untuk mengikuti sebuah perlombaan. Siswa yang memenuhi syarat untuk menjadi anggota adalah: Jeni, Dena, Erwin, Lukman, Mirna, Putri, dan Anita. Berikut adalah kondisi untuk memilih anggota yang akan dikirim mengikuti perlombaan.</p>\n<p>-&nbsp;&nbsp; Jika Anita dipilih, maka Erwin harus dipilih juga</p>\n<p>-&nbsp;&nbsp; Jika Erwin dan Dena dipilih bersama, maka Jeni tidak boleh dipilih</p>\n<p>-&nbsp;&nbsp; Apabila Dena dan Jeni dipilih bersama, maka Mirna tidak boleh dipilih.</p>\n<p>-&nbsp;&nbsp; Apabila Jeni dipilih, maka hanya Lukman atau Putri yang boleh dipilih.</p>\n<p>-&nbsp;&nbsp; Salah satu dari Lukman atau Mirna harus dipilih</p>\n<p>&nbsp;</p>\n<p>Jika Lukman atau Putri tidak ada yang dipilih, berapa jumlah maksimum anggota yang dikirim?</p>','b',15),(137,23,'<p>Jika Jeni dan Anita terpilih maka berapa jumlah maksimum anggota yang dikirim?</p>','a',15),(138,24,'<p>Jika Jeni dan Mirna terpilih, dari pernyataan-pernyataan berikut yang pasti salah?</p>\n<ol>\n<li style=\"list-style-type: none;\"><ol>\n<li>&nbsp;Erwin terpilih</li>\n<li>&nbsp;Dena terpilih</li>\n<li>&nbsp;Putri terpilih</li>\n</ol></li>\n</ol>','b',15),(139,25,'<p>Jika kepala sekolah hanya diperbolehkan mengirim 5 siswi dimana salah satunya Putri.Siapa 4 siswa lainnya yang ikut dipilih bersama Putri?</p>','a',15),(140,26,'<p>Budi berjanji bertemu teman di rumahnya, namun karena hujan Budi terlambat pulang. Di jalan budi melihat temannya membawa 8 istri, tiap istrinya membawa 8 kandang, tiap kandang terdapat 8 kucing dewasa, dan tiap kucing dewaasa memiliki 8 anak kucing. Berapa total makhluk hidup yang pergi ke rumah Budi saat itu?</p>','d',15),(141,27,'<ol>\n<li>Setiawan baru saja naik pangkat menjadi pimpinan sebuah perusahaan, ia menetapkan peraturan pada bawahannya sedemikian rupa sehingga ada peraturan yang membatalkan peraturan lainnya. Peraturan yang ditetapkan adalah sebagai berikut:</li>\n</ol>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Berlaku</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Berlaku</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; iii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Batalkan peraturan vi</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; iv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Batalkan peraturan i</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; v.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Batalkan peraturan iii</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vi.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Batalkan peraturan v</p>\n<p>Peraturan mana sajakah yang masih berlaku?</p>','c',15),(142,28,'<p>Berapa jumlah pertandingan yang dibuthkan untuk menentukan pemenang dalam sebuah turnamen catur bila ada 65 orang yang berpartisipasi dengan asumsi metode yang digunakan adalah sistem gugur/single elimination system</p>','e',15),(143,29,'<p><img src=\"/asset/2015/img/soal/logic1.jpg\" alt=\"\" width=\"134\" height=\"113\" />disamping ini adalah gambar jarring-jaring kubus,ketika dilipat menjadi kubus maka bidang nomor&nbsp; 5 akan berhadapan dengan bidang nomor ..</p>','c',15),(144,30,'<p>Setiawan sedang bermain petak umpet dengan Valentino,kini giliran Setiawan untuk mencari Valentino. Valentino yang sangat cerdik menaruh 3 buah tanda pada 3 buah pintu untuk mengelabui Setiawan agar ia salah masuk ruangan dan tidak menemukan dirinya yang sedang bersembunyi di salah satu ruangan tersebut. Tanda tersebut bertuliskan</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ruang 1: &ldquo;Aku tidak ada di ruangan ke 3&rdquo;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ruang 2: &ldquo;Aku ada diruangan ini</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; iii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ruang 3: &ldquo;Aku tidak ada disini&rdquo;</p>\n<p>Jika paling tidak ada 1 tanda yang ditulis adalah benar dan 1 tanda adalah salah, dimanakah Valentino bersembunyi?</p>','a',15),(145,31,'<p>Berapakah angka satuan dari dari 3^123456789 ?</p>','e',15),(146,32,'<p>bilangan x apabila dibagi dengan 6561 menghasilkan sisa 265. apabila bilangan tersebut dibagi dengan 243, maka akan menghasilkan sisa?</p>','a',15),(147,33,'<p>Penduduk Mesir membuat sebuah piramid dengan batu. Batu paling atas adalah 1, kemudian dibawahnya 3, dan dibawahnya lagi adalah 9, dan seterusnya berlanjut dengan kelipatan 3. Bila terdapat 1010 susun dari tumpukkan batu, berapa angka satuan batu yang ada di paling bawah?</p>','c',15),(148,34,'<p>Sebuah perusahaan kipas angin dapat membuat 200 kipas dalam waktu 41 hari. Berapakah kipas angin yang dihasilkan dalam waktu 30 hari?</p>','b',15),(149,35,'<p>Harga sewa mobil di sebuah persewaan mobil adalah Rp 375.000/24 jam pertama, sedangkan kelebihan dua jam berikutnya dikenai denda Rp 25.000. Jika suatu hari, Jerry menyewa sebuah mobil dan diharuskan membayar Rp 625.000, berapa lama Jerry menyewa mobil tersebut?</p>','a',15),(150,36,'<p>Dadang bekerja sebagai kurir di sebuah perusahaan pengiriman barang di Bandung selama 5 jam per hari dan 6 hari dalam seminggu. Danang mendapat upah sebesar Rp 3.500 per jam dan uang lembur sebesar Rp 5.000/ jam. Jika dalam 4 minggu Danang menerima uang sebesar Rp 650.000, berapakah lama lemburnya?</p>','d',15),(151,37,'<p>Suatu keluarga terdiri dari Ayah, ibu dan 3 anaknya, Anto, Bagas, dan Candi. Ayah dan ibu menikah pada tahun 1994. Sekarang tahun 2014 ini, Jumlah umur Bagas dan Candi sama dengan umur dari ayah pada saat menikah, dan umur Candi dikurangi dua kali dari umur Bagas 3 tahun lalu sama dengan umur ibu 5 tahun sebelum menikah. BIla selisih umur ayah dan ibu adalah 4 tahun dan tiga kali umur candi sama dengan jumlah umur ayah dan Bagas sekarang, maka berapa umur Bagas dan Candi?</p>','a',15),(152,38,'<p>Sebuah toko menjual permen dengan harga Rp. 724,00, sedangkan coklat Rp. 1976,00. Suatu hari toko itu mengadakan promo beli 4 buah coklat akan mendapatkan 1 buah permen dan beli 6 buah permen akan mendapatkan 1 buah coklat. Adi ingin membeli 10 coklat dan Dimas ingin membeli 21 permen. Mereka memutuskan untuk membelinya bersama. Berapa uang minimal yang harus mereka bayarkan?</p>','e',15),(153,39,'<p>Jika 8@ adalah 8+7*6+5*4+3*2+1 dan hasilnya adalah 77 maka hasil dar 15@ adalah ..</p>','e',15),(154,40,'<p>Manakah yang memiliki nilai paling besar?</p>','d',15),(155,1,'<p>AsdaAsdaAsdaAsdaAsdaAsdaAsdaAsda</p>','e',16),(156,2,'<p>DasdaDasdaDasdaDasdaDasdaDasdaDasda</p>','a',16),(157,1,'<p>2a+3b=6</p>\r\n<p>c=2a+10</p>\r\n<p>6b=a-2c</p>\r\n<p>Tentukan 7a+3b-c!</p>','e',17),(158,2,'<p>Suatu jalan dilewati oleh 3 kendaraan, yaitu becak, sepeda motor dan mobil. Becak melewati&nbsp;jalan itu tiap 1 menit, sepeda motor tiap 30 detik dan mobil tiap 40 detik. Berapa kali 3&nbsp;kendaraan itu melewati jalan itu secara bersamaan dari jam 6.00 &ndash; 17.32?</p>','b',17),(159,3,'<p>Suatu keluarga terdiri dari Ayah, ibu dan 3 anaknya, Anto, Bagas, dan Candi. Ayah dan ibu&nbsp;menikah pada tahun 1994. Sekarang tahun 2014 ini, Jumlah umur Bagas dan Candi sama dengan&nbsp;umur dari ayah pada saat menikah, dan umur Candi dikurangi dua kali dari umur Bagas 3 tahun&nbsp;lalu sama dengan umur ibu 5 tahun sebelum menikah. BIla selisih umur ayah dan ibu adalah 4&nbsp;tahun dan tiga kali umur candi sama dengan jumlah umur ayah dan Bagas sekarang, maka&nbsp;berapa umur Bagas?</p>','b',17),(160,1,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di dalam suatu peternakan bebek, terdapat 1000 ekor bebek yang sangat unik. Ada bebek yang bisa terbang, bebek yang bisa jungkir balik, dan bebek yang bisa memangsa manusia. Bebek yang bisa terbang berjumlah 595 ekor bebek. Bebek yang bebek yang bisa jungkir balik berjumlah 595 ekor, dan bebek yang bisa memangsa manusia berjumlah 550 ekor. Namun, ada juga bebek yang bisa terbang dan memangsa manusia, yang berjumlah 350 ekor, bebek yang bisa terbang dan jungkir balik berjumlah 395 ekor, dan bebek yang bisa jungkir balik dan memangsa manusia sebanyak 400 ekor. Adapun bebek yang bisa ketiganya berjumlah 250 ekor. Berapakah jumlah bebek yang tidak bisa terbang, tidak bisa jungkir balik, dan tidak bisa memangsa manusia?</span></p>','e',18),(161,2,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Berdasarkan narasi dari nomor 1, Berapakah jumlah bebek yang hanya bisa terbang?</span></p>','b',18),(162,3,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">1 + 2 = 5 </span><br /><span style=\"font-size: 12pt;\">5 + 3 = 23 </span><br /><span style=\"font-size: 12pt;\">3 + 2 = 11 </span><br /><span style=\"font-size: 12pt;\">8 + 8 = 80 </span><br /><span style=\"font-size: 12pt;\">10 + 11 = ?</span></p>','d',18),(163,4,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Seorang profesor punya cara unik sendiri untuk masuk ke dalam labnya. Di tanggal 3 bulan 4, ia akan memasukkan angka 49. Di tanggal 7 bulan 2, ia akan memasukkan angka 81. Pada tanggal 21 bulan 9, ia akan memasukkan angka 900. Lalu, angka berapakah yang akan profesor masukkan pada tanggal 8 bulan 10?</span></p>','e',18),(164,5,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Berikut adalah hasil wawancara dari tiga orang bersaudara yang bernama A, B, dan C:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A: &ldquo;Saya memiliki seorang kakak laki-laki dan tiga adik perempuan.&rdquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">B: &ldquo;Saya memiliki dua kakak laki-laki dan dua adik perempuan.&rdquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">C: &ldquo;Saya memiliki tiga kakak laki-laki dan seorang adik perempuan.&rdquo; </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Jika ketiga orang bersaudara tersebut termasuk dalam sebuah keluarga yang memiliki seorang ayah dan seorang ibu, maka berdasarkan hasil wawancara ketiganya berapakah jumlah anggota keluarga tersebut?</span></p>','d',18),(165,6,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sebuah kereta api yang memiliki panjang 100 m membutuhkan waktu 30 detik untuk menyeberangi suatu jembatan yang panjangnya 400 m (kereta api sudah dalam posisi tidak menyentuh jembatan). Asumsikan kecepatan kereta api adalah konstan, berapa kecepatan kereta api tersebut dalam km/h? (hasil dibulatkan ke pilihan terdekat)</span></p>','e',18),(166,7,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ekspresi \"<strong><span style=\"font-family: \'courier new\',courier,monospace;\">not((X and not(Y)) or (not(X) | (X and not(Y))))</span></strong>\" akan bernilai TRUE jika X dan Y bernilai ...</span></p>','d',18),(167,8,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Suatu hari, Sohir membeli sebuah pulpen di sebuah toko buku. Harga pulpen tersebut adalah Rp3000,- dan kebetulan, pada saat itu toko buku tersebut memberikan diskon sebesar 10% kepada Sohir. Sohir pun membeli pulpen tersebut, dan menjualnya ke teman dekatnya dengan harga 10% lebih mahal dari harga beli pulpen tersebut. Berapakah keuntungan/kerugian yang didapat Sohir?</span></p>','b',18),(168,9,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Seorang penjelajah melihat sebuah batu raksasa berada tepat di kanannya. Jika ia melihat di kompasnya dia mengarah tepat menuju Timur. Lalu ia lanjut berjalan, ia tersesat dan bertemu dengan batu besar itu lagi. Dari posisinya berdiri batu itu ada di arah jam 4 dan jika ia melihat kompasnya maka batu besar tersebut tepat berada di timur, selanjutnya ia berputar 660 derajat searah jarum jam maka sekarang batu itu berada dimana?</span></p>','b',18),(169,10,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sebuah bus memiliki jalur dan jadwal operasi dari kota A ke kota B lalu ke kota C dan kembali lagi ke kota A melalui kota B. Setiap kota memiliki kelompok penumpang yang memiliki tujuan yang berbeda-beda. 10 orang ingin pergi dari kota A ke kota B, 25 orang ingin pergi dari kota A ke kota C, 12 orang ingin pergi dari kota B ke kota C, 14 orang ingin pergi dari kota B ke kota A, 17 orang ingin pergi dari kota C ke kota A dan 19 orang ingin pergi dari kota C ke kota B. Saat kembali ke kota A dari kota C, bus hanya menurunkan penumpang ke kota B, tidak mengambil penumpang. Jika bus beroperasi dengan kecepatan 40 km/jam dari jam 07.00 sampai 21.00 lalu jarak dari kota A ke B 14 km dan kota B ke C 17 km, Berapa penumpang yang sedang di dalam bus saat bus berhenti beroperasi?</span></p>','d',18),(170,11,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Dalam sebuah kompetisi sepak bola, terdapat total 128 tim yang ikut berkompetisi. Kompetisi tersebut menerapkan sistem 2 fase, yaitu fase grup dan fase knockout. Kompetisi dimulai dengan fase grup, dimana terdapat 32 grup (A1-A32) dengan masing-masing grup terdiri dari 4 tim. Kompetisi ini tidak hanya mencari juara 1 dan 2, tetapi mencari juara 3 dan 4 juga. Pada saat fase grup, tiap tim melakoni 2 laga (Home &amp; Away) terhadap masing-masing kompetitor dalam grupnya, sedangkan pada fase knockout hanya melakukan 1 laga saja (tidak ada Home &amp; Away) Bila diketahui yang dapat masuk babak selanjutnya adalah 2 tim teratas di dalam masing-masing grup, tentukanlah jumlah pertandingan yang diselenggarakan pada kompetisi tersebut!</span></p>','c',18),(171,12,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tentukan sisa pembagian 13 pangkat 2015 oleh 10</span></p>','d',18),(172,13,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Suatu hari, Iskandar sedang berkeliling di London. Ia melihat seorang kakek yang merupakan orang asli Inggris sedang duduk di suatu kafe. Iskandar pun menyapanya dan menanyakan berapa umur kakek itu. Berikut pembicaraan dari keduanya:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Iskandar: &ldquo;Halo, namaku Iskandar. Aku berumur 22 tahun. Berapa umurmu?&rdquo; </span><br /><span style=\"font-size: 12pt;\">Kakek: &ldquo;Umurku? Hmm, selesaikan teka-teki ini. Aku berumur seperti kamu,&nbsp;ditambah dengan setengah dari umurku.&rdquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tidak sampai 5 detik, Iskandar sudah bisa menebak berapa umur kakek tersebut. Kakek tersebut berumur&hellip;</span></p>','b',18),(173,14,'<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Perhatikan gambar berikut!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\"><span style=\"mso-spacerun: \'yes\'; font-family: Calibri; mso-fareast-font-family: ??; font-size: 12.0000pt; mso-font-kerning: 1.0000pt;\"><img src=\"/asset/gambar_logika/penyisihan14.jpg\" alt=\"Soal No 14\" width=\"222\" height=\"223\" /></span><u></u></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Berapakah perbandingan luas segiempat berwarna biru dengan segiempat berwarna merah?</span></p>','c',18),(174,15,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sebuah tangki air setinggi 2.5 m diisi selama 8 jam dalam sehari, dimulai setiap jam 9 pagi. Setelah diisi selama 8 jam, tinggi air di dalam tangki tersebut selalu bertambah 60 cm. Namun, setiap pukul 9 malam, tinggi air berkurang sebanyak 20 cm. Jika kejadian ini terus berulang setiap hari, pada hari keberapakah tangki tersebut kelebihan air (overflow)?</span></p>','c',18),(175,16,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Putu ingin memberikan bunga kepada masing-masing istrinya, yang berjumlah 7 orang. Ia pun merencanakan pertemuan dengan semua istri-istrinya untuk memberikan bunga-bunga tersebut. Salah satu istrinya mengatakan bahwa ia pasti akan menghadiri pertemuan itu, namun sisanya masih meragukan kehadiran mereka. Berapakah jumlah bunga yang harus dibawa oleh Putu, agar pada saat dibagikan masing-masing istri yang datang mendapatkan jumlah bunga yang sama dan tidak ada sisa bunga?</span></p>','e',18),(176,17,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Setumpuk kartu remi berjumlah 52 kartu biasa ditambah 1 kartu joker tersebar diatas meja dalam keadaan tertutup. Jika ILO membuka satu per satu kartu-kartu tersebut dengan catatan kartu yang telah dibuka tidak akan ditutup lagi, berapa peluang keempat kartu as terbuka terlebih dahulu sebelum kartu joker?</span></p>','a',18),(177,18,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di dalam sebuah liga sepakbola, terdapat 6 klub yang berpartisipasi, yaitu Arema, Persebaya, Persija, Persib, Sriwijaya, dan PSTK. Di dalam liga ini, setiap klub akan melawan setiap lawan sebanyak 1 kali saja. Sejauh ini, Arema sudah memainkan 1 laga, Persebaya sudah memainkan 2 laga, Persija sudah memainkan 3 laga, Persib sudah memainkan 4 laga, dan Sriwijaya sudah memainkan 5 laga. Berapa laga yang telah dimainkan oleh PSTK?</span></p>','b',18),(178,19,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">ILO baru saja pulang ke apartemennya. Apartemen ILO terdiri dari 8 lantai, dan sialnya kamar ILO berada di lantai 8. Waktu yang dibutuhkan ILO untuk naik dari lantai 1 ke lantai 4 adalah 48 detik. Berapa detik waktu yang dibutuhkan ILO untuk naik dari lantai 4 ke lantai 8?</span></p>','d',18),(179,20,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sebuah markas angkatan laut yang dipimpin oleh seorang admiral sedang melakukan konstruksi kapal. Sang admiral hanya memberikan sejumlah bahan pembuatan yang terbagi menjadi 4, Oli, Amunisi, Besi, dan Bauksit. Namun sang admiral tidak ikut mensupervisi konstruksi sehingga ia tidak tahu kapal apa yang ia akan dapat. Jika ada 10 kapal&nbsp; yang mungkin jadi dan hanya ada satu kapal besar yang diinginkan oleh sang admiral. Berapa persen besar kemungkinan sang admiral mendapatkan kapal tersebut jika admiral mencoba hingga 200 kali?</span></p>','a',18),(180,21,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Dalam sebuah tumpukan kartu remi, terdapat 52 buah kartu, terdiri dari 26 kartu hitam dan 26 kartu merah (no Joker). Ketika ILO mengacak dan berusaha membagi tumpukan kartu-kartu tersebut, tumpukan kartu itu terbagi menjadi 23 kartu di tangan kiri ILO dan sisanya di tangan kanan ILO. Berapakah perbedaan jumlah kartu merah di tangan kiri ILO dengan jumlah kartu hitam di tangan kanan ILO?</span></p>','c',18),(181,22,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pak Andri mempunyai uang Rp 2.700.000 dan berniat untuk membeli TV. Harga TV tersebut sebelum didiskon adalah Rp 2.400.000, sedangkan besar diskonnya adalah 35% untuk member. Selain itu pak Andri juga belanja bulanan untuk keperluan rumah sebesar Rp 230.000. Berapakah sisa uang pak Andri saat ini?</span></p>','a',18),(182,23,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Diketahui suatu susunan angka sebagai berikut</span><br /><span style=\"font-size: 12pt;\"> 87768 = 5</span><br /><span style=\"font-size: 12pt;\"> 88188 = 8</span><br /><span style=\"font-size: 12pt;\"> 45565 = 1</span><br /><span style=\"font-size: 12pt;\"> 32173 = 0</span><br /><span style=\"font-size: 12pt;\"> Maka tentukan</span><br /><span style=\"font-size: 12pt;\"> 66666 = ?</span></p>','b',18),(183,24,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Seorang pedagang ingin menjual bola kepada anak-anak, tapi bola itu tercampur pada suatu wadah tertutup. Didalam wadah itu terdapat 5 bola merah, 7 bola kuning, 2 bola biru dan 9 bola putih. BIla seorang anak ingin membeli bola berwana kuning, berapa pengambilan minimal bola oleh pedangang hingga mendapatkan 1 bola kuning?</span></p>','d',18),(184,25,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di suatu hutan lindung, sedang terjadi perburuan liar. Para penjaga hutan sudah berusaha menangkap pemburu liar tersebut setiap harinya, namun terus menerus gagal. Menurut laporan dari penjaga hutan yang menjaga pos di bagian tengah hutan tersebut, ia mendengar suara tembakan setiap harinya. Urutan arah suara tembakan dari hari pertama terdengarnya tembakan sampai hari ke-5 sekarang adalah sebagai berikut: Utara, Selatan, Tenggara, Barat Laut, Barat. Bantulah para penjaga hutan ini untuk menangkap pemburu liar ini pada hari ke-6 dengan memberikan posisi yang benar kepada para penjaga hutan.</span></p>','b',18),(185,26,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Jika nilai X dan Y masing-masing adalah bilangan bulat positif 2-digit dengan X*Y = 555, maka berapakah hasil X+Y?</span></p>','e',18),(186,27,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sepuluh orang petualang sedang berusaha untuk menyeberangi sungai di suatu hutan. Kebetulan sekali, mereka menemukan sebuah sampan di pinggir sungai dan hanya salah satu dari mereka yang bisa mengayuh dayung. Namun, sampan tersebut hanya dapat menampung dua orang sekaligus. Waktu yang dibutuhkan untuk satu kali menyeberangi&nbsp; sungai tersebut adalah satu menit pada penyeberangan pertama. Pada penyeberangan kedua, karena di pendayung mulai lelah, maka waktu yang dibutuhkan untuk menyeberangi sungai bertambah menjadi 2 menit. Pada penyeberangan ketiga membutuhkan tiga menit, dan seterusnya. Berapa waktu tercepat yang dibutuhkan untuk menyeberangi sungai tersebut?</span></p>','d',18),(187,28,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">20162016 * 20162016 - 20162017 * 20162015 = ?</span></p>','b',18),(188,29,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Jack dan kekasihnya pergi berlibur ke suatu tempat. Pada saat perjalanan menuju tempat liburan, Jack menyetir hingga sejauh 180 km, lalu penyetiran mobil dilanjutkan oleh kekasihnya hingga sampai tujuan. Pada saat perjalanan pulang, sang kekasih menyetir hingga 150 km, lalu dilanjutkan oleh Jack hingga mencapai tempat asal mereka. Berapakah perbedaan total jarak yang ditempuh oleh Jack dan kekasihnya?</span></p>','a',18),(189,30,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Di suatu kota, ada seorang anak kecil yang selalu mengumpulkan botol bekas setiap harinya. Setiap harinya, ia mengumpulkan jumlah botol yang berbeda-beda. Pada senin minggu pertama, ia mengumpulkan 20 botol. Pada selasa minggu pertama, ia mengumpulkan 40 botol. Pada jumat minggu kedua, ia mengumpulkan 100 botol. Dan pada jumat minggu ketiga, ia mengumpulkan 33 botol. Berapa yang ia kumpulkan pada hari jumat minggu ke empat?</span></p>','e',18),(190,31,'<p class=\"MsoNormal\"><span style=\"font-size: 12pt;\">Pada gambar berikut, jika segitiga ABC dan PQR adalah segitiga sama sisi, tentukan sudut yang dibentuk CXY!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: Calibri; mso-fareast-font-family: ??; font-size: 12.0000pt; mso-font-kerning: 1.0000pt;\"><img src=\"/asset/gambar_logika/penyisihan31.png\" alt=\"\" width=\"182\" height=\"156\" /></span></p>','e',18),(191,32,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Buatlah kesimpulan dari peryataan-peryataan berikut:</span><br /><span style=\"font-size: 12pt;\"> -Andi main bola jika tidak hujan</span><br /><span style=\"font-size: 12pt;\"> -Hari hujan jika berawan</span><br /><span style=\"font-size: 12pt;\"> -Hari ini berawan</span><br /><span style=\"font-size: 12pt;\"> Maka dari pernyaan diatas, Andi...?</span></p>','b',18),(192,33,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">3 ekor kuda mengikuti sebuah balapan di sebuah track berbentuk oval. Kuda A bisa melaju sebanyak tepat 2 lap/menit, kuda B melaju tepat 3 lap/menit, dan kuda C tepat 4 lap/menit. Jika pada awalnya ketiga kuda tersebut berdiri sejajar pada sebuah starting line, berapa menitkah waktu yang dibutuhkan agar ketiga kuda tersebut kembali berdiri sejajar pada starting line saat perlombaan?</span></p>','a',18),(193,34,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sohir dan Iskandar masing-masing memiliki beberapa apel. Jika Sohir memberikan 1 apel kepada Iskandar, maka mereka berdua akan mempunyai jumlah apel yang sama. Namun, apabila pada awalnya Iskandar memberikan 2 apel ke Sohir, maka Sohir akan memiliki 3 kali lipat jumlah apel yang dimiliki Iskandar. Berapakah jumlah awal apel yang dimiliki Iskandar?</span></p>','c',18),(194,35,'<p><span style=\"font-size: 12pt;\">Sebuah jam digital diletakkan di sebuah tembok di penginapan. Hitung berapa kali angka 1 muncul dari jam 00.00 sampai 02.00?</span></p>','d',18),(195,36,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ada suatu masa dimana umur Ayah Sonny 2 kali umur Ibu Sonny. Namun, di tahun selanjutnya umur Ayah Sonny menjadi 1.5 kali umur Ibu Sonny. Jika umur ayah Sonny saat ini adalah 44 tahun, berapakah umur Ibu Sonny saat ini?</span></p>','e',18),(196,37,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sekelompok anak sekolah dasar yang berjumlah 3 orang sedang membahas banyak permen yang mereka miliki.</span><br /><span style=\"font-size: 12pt;\"> A: &ldquo;B memiliki permen paling banyak!&rdquo;</span><br /><span style=\"font-size: 12pt;\"> B: &ldquo;Jika C memberiku satu permen saja, maka jumlah permenku akan menjadi 2 kali jumlah permen A.&rdquo;</span><br /><span style=\"font-size: 12pt;\"> C: &ldquo;Jika B memberiku 2 permen, maka kita semua akan memiliki jumlah permen yang sama.&rdquo;</span><br /><span style=\"font-size: 12pt;\"> Berapa total jumlah permen yang dimiliki oleh A, B, dan C?</span></p>','c',18),(197,38,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Suatu kelompok mafia berisi 5 orang (A, B, C, D, E) saling pinjam-meminjam uang satu sama lain. Semua orang di kelompok itu meminjam ataupun meminjamkan uang dari dan ke teman kelompoknya. Diketahui setiap orang tidak pernah meminjamkan uang ke 2 atau lebih orang, dan juga tidak pernah meminjam dari 2 atau lebih orang. Tidak ada satupun dari mereka yang meminjam uang dari orang yang telah dipinjamkan uang oleh mereka sendiri. Berikut beberapa fakta mengenai kasus pinjam-meminjam uang mereka:</span><br /><span style=\"font-size: 12pt;\"> -B meminjam uang dari A</span><br /><span style=\"font-size: 12pt;\"> -E tidak meminjamkan uang ke A</span><br /><span style=\"font-size: 12pt;\"> -C meminjamkan uang ke D</span><br /><span style=\"font-size: 12pt;\"> Dari siapa A meminjam uang?</span></p>','d',18),(198,39,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Terdapat 2 orang kakak beradik, Sohir dan Sahrir. Jika umur Sohir dikurangi 2 dan umur Sahrir ditambah 2, maka umur Sahrir akan menjadi 2 kali umur Sohir. Sedangkan jika umur Sohir dikurangi 3 dan umur Sahrir ditambah 3, maka umur Sahrir akan menjadi 3 kali umur Sohir! Berapakah umur Sohir yang sebenarnya?</span></p>','c',18),(199,40,'<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Jika 2 bulan lagi adalah April, hari ini tanggal 17, pada bulan April tanggal 17 adalah hari Sabtu, dan jika tahun lalu adalah tahun kabisat, maka pada tanggal dan bulan yang sama dengan hari ini, hari apakah itu di tahun depan?</span></p>','d',18),(200,1,'<p>Perhatikan gambar berikut!</p>\r\n<p><img src=\"/asset/gambar_logika/8UTrialLogika$01.jpg\" alt=\"\" width=\"221\" height=\"221\" /></p>\r\n<p>Berapakah perbandingan luas segiempat berwarna biru dengan segiempat berwarna merah?</p>','c',19),(201,2,'<p>Pada gambar berikut, jika segitiga ABC dan PQR adalah segitiga sama sisi, tentukan sudut yang dibentuk CXY!</p>\r\n<p><img src=\"/asset/gambar_logika/4GTrialLogika&amp;02.jpg\" alt=\"\" width=\"182\" height=\"156\" /></p>','e',19),(202,3,'<p>Ekspresi &ldquo;not((X and not(Y)) or (not(X) or (X and not(Y))))&rdquo; akan bernilai TRUE jika X dan Y bernilai&hellip;</p>','c',19),(203,4,'<p>Sepuluh orang petualang sedang berusaha untuk menyeberangi sungai di suatu hutan. Kebetulan sekali, mereka menemukan sebuah sampan di pinggir sungai dan hanya salah satu dari mereka yang bisa mengayuh dayung. Namun, sampan tersebut hanya dapat menampung dua orang sekaligus. Waktu yang dibutuhkan untuk satu kali menyeberangi &nbsp;sungai tersebut adalah satu menit pada penyeberangan pertama. Pada penyeberangan kedua, karena di pendayung mulai lelah, maka waktu yang dibutuhkan untuk menyeberangi sungai bertambah menjadi 2 menit. Pada penyeberangan ketiga membutuhkan tiga menit, dan seterusnya. Berapa waktu tercepat yang dibutuhkan untuk menyeberangi sungai tersebut?</p>','d',19),(204,5,'<p>Pada bangun datar di bawah, ABCD adalah sebuah persegi panjang dengan AB = 12 dan BC = 18. Persegi panjang AEFG terbentuk dari bangun datar ABCD yang diputar sebanyak 30o, dengan A sebagai titik putarnya. Berapakah total luas bangun datar yang berwarna biru?</p>\r\n<p><img src=\"/asset/gambar_logika/67TrialLogika%5E05.jpg\" alt=\"\" width=\"255\" height=\"175\" /></p>','a',19),(205,4,'<p>test<img src=\"data:image/jpeg;base64,\" alt=\"\" /></p>','a',17),(206,1,'<p>Ada berapa banyak bilangan dari 1 hingga 2017 yang mengandung angka 4?</p>','e',20),(207,2,'<p>(1/2) + (1/6) + (1/12) + (1/20) + ... + (1/10100) = ?</p>','a',20),(208,3,'<p>Pada suatu ketika, Anto berkendara dari kota A ke kota B.</p>\r\n<p style=\"padding-left: 30px;\">- Hari pertama, Anto berkendara 1/3 dari total jarak tempuh</p>\r\n<p style=\"padding-left: 30px;\">- Hari kedua, Anto berkendara sejauh 1/2 dari sisa jarak tempuh</p>\r\n<p style=\"padding-left: 30px;\">- Hari ketiga, Anto berkendara sejauh 2/3 dari sisa jarak tempuh</p>\r\n<p style=\"padding-left: 30px;\">- Hari keempat, Anto berkendara sejauh 3/4 dari sisa jarak tempuh dan menyisakan 5 km lagi untuk sampai ke kota B</p>\r\n<p>Berapa km Anto telah berkendara?</p>','d',20),(209,4,'<p>Seekor semut hendak melangkah ke makanan yang berada sejauh 10 satuan di depannya. Semut tersebut sedang mendapatkan hukuman, ia hanya boleh melangkah ke depan sebanyak kelipatan 3 satuan dan selebihnya harus melangkah ke belakang. Tentukan banyaknya cara melangkah agar bisa mencapai makanan, jika ia harus melangkah tidak lebih dari dua puluh langkah.</p>\r\n<p><br />(Catatan : jika semut melangkah dua kali dimana masing-masing melangkah sekali ke belakang, maka dianggap sama saja dengan dua langkah ke belakang.)</p>','d',20),(210,5,'<p>Enam orang mahasiswa Ubaya sedang membahas mimpinya dalam membuat konsep Artificial Intelligence seperti tokoh Jarvis pada film Iron Man. Keenam mahasiswa tersebut berunding dalam 3 meja bundar, dan setiap meja tersebut pasti diduduki mahasiswa. Banyak cara duduk yang mungkin adalah...</p>','c',20),(211,6,'<p>Sebuah pola bilangan yang disusun seperti piramida memiliki bilangan-bilangan seperti di bawah ini pada 5 baris pertamanya:</p>\r\n<p><img src=\"/asset/gambar_logika/XU34PenyisihanLogika!06.jpg\" alt=\"\" width=\"212\" height=\"117\" /></p>\r\n<p>Berapakah hasil penjumlahan dari bilangan-bilangan pada baris yang memiliki angka 400?</p>','b',20),(212,7,'<p>Suatu bilangan X memenuhi tiga syarat berikut:</p>\r\n<p style=\"padding-left: 30px;\">- X lebih besar atau sama dengan 1000 dan lebih kecil dari 10000.</p>\r\n<p style=\"padding-left: 30px;\">- X terdiri dari 4 buah digit yang berbeda-beda&nbsp;yang merupakan&nbsp;4 digit yang berurutan, namun posisinya boleh acak.</p>\r\n<p style=\"padding-left: 30px;\">- X habis dibagi 3.</p>\r\n<p>Berapa banyak kemungkinan bilangan X?</p>','d',20),(213,8,'<p>Seekor semut yang berada di pojok kiri bawah ingin pergi ke bagian pojok kanan atas labirin berikut melalui titik-titik sudutnya.</p>\r\n<p><img src=\"/asset/gambar_logika/TU09PenyisihanLogika!08.JPG\" alt=\"\" width=\"237\" height=\"237\" /></p>\r\n<p>Berapa banyak cara terpendek semut jalan melalui labirin tersebut?</p>','a',20),(214,9,'<p>Banyaknya bilangan bulat yang memenuhi n adalah...</p>\r\n<p>(n-1)(n-3)(n-5)&hellip;(n-2017) = n(n+2)(n+4)&hellip;(n+2016)</p>','a',20),(215,10,'<p>Bruce memiliki sebuah kue tar berbentuk kubus dengan panjang n, dimana n adalah bilangan bulat positif. Tiga dari enam sisi kue tar tersebut diberi pewarna sehingga menjadi warna hijau dan ketiga sisi tersebut saling bersampingan satu sama lain, sedangkan sisanya berwarna coklat seperti warna kue tar pada umumnya. Suatu hari, Bruce memotong kue tarnya hingga menjadi n<sup>3</sup> potongan yang berbentuk kubus, dimana 125 diantaranya tidak memiliki sisi yang berwarna hijau. Berapakah nilai n?</p>','b',20),(216,11,'<p>Sohir menjalankan sebuah bisnis lahan parkir di daerah UBAYA. Berikut adalah grafik lahan parkir milik Sohir:</p>\r\n<p><img src=\"/asset/gambar_logika/QM18PenyisihanLogika!11.JPG\" alt=\"\" width=\"447\" height=\"246\" /></p>\r\n<p>Dari gambar di atas, berapakah keliling lahan parkir tersebut?</p>','c',20),(217,12,'<p>Game Master membuat suatu perlombaan, dimana tiga monster akan dimasukkan ke dalam suatu sangkar. Di dalam sangkar tersebut, terdapat tiga buah angka unik yang menyatakan letak masing-masing monster yang dimasukkan ke dalam sangkar tersebut. Lalu, sangkar ditutup dan letak tiap monster diacak, kemudian peserta akan disuruh menebak letak mereka satu persatu. Dari 24 peserta, 8 menebak ketiganya dengan benar, dan 10 lainnya hanya menebak satu monster dengan benar. Berapakah peserta yang tidak mendapat tebakan benar sama sekali?</p>','b',20),(218,13,'<p>Diberikan sebuah segi delapan beraturan ABCDEFGH. Berapakah perbandingan luas ABCD : DEFGHA ?</p>','c',20),(219,14,'<p>Jika diketahui:</p>\r\n<p>2 + 3 + 6 = 453,</p>\r\n<p>3 + 4 + 8 = 844,</p>\r\n<p>3 + 5 + 7 = 964, dan</p>\r\n<p>2 + 5 + 7 = 846</p>\r\n<p>Maka berapakah hasil dari 1 + 4 + 7 ?</p>','a',20),(220,15,'<p style=\"text-align: justify;\">Nathan Drake adalah seorang petualang yang hobinya mencari artefak kuno untuk dijual dengan harga tinggi. Dalam perjalanannya, ia seringkali menemukan berbagai macam kode yang harus ia pecahkan untuk bisa melanjutkan perjalanannya. Suatu hari, ia menemukan sebuah tulisan di sebuah pintu yang terkunci. Pintu itu bertuliskan huruf: &ldquo;Untuk bisa membuka pintu ini, Anda harus menjawab pertanyaan berikut terlebih dahulu: Jika diketahui (abc)<sub>10</sub> = 2*(abc)<sub>7</sub>, berapa banyak kemungkinan nilai abc, dimana 1 &lt;= a, b, c &lt;= 6 ?&rdquo;. Karena Nathan Drake pernah belajar basis bilangan saat SMA, maka ia pun tahu bahwa &ldquo;(abc)<sub>z</sub>&rdquo; maksudnya adalah abc merupakan bilangan berbasis z. Ia juga tahu, untuk mengubah (abc)<sub>z</sub> ke bilangan berbasis 10, maka caranya adalah dengan menghitung a*z<sup>2</sup> + b*z<sup>1</sup> + c*z<sup>0</sup> . Berapakah angka yang harus dijawab oleh Nathan Drake untuk bisa membuka pintu ?</p>','c',20),(221,16,'<p>Aleiksandher adalah seorang mahasiswa yang tidak tahu membagi waktu untuk mengerjakan tugas-tugasnya. Ia selalu salah memprediksi waktu penyelesaian suatu tugas yang ia dapatkan dari dosennya, dimana waktu pengerjaan yang sebenarnya bisa jadi lebih cepat ataupun lebih lambat dari waktu pengerjaan yang ia prediksikan. Pada saat ia memprediksi bahwa ia bisa menyelesaikan suatu tugas dalam waktu 24 jam, pada kenyataanya ia menyelesaikannya dalam waktu 20 jam. Pada saat ia memprediksi bahwa ia dapat mengerjakan suatu tugas dalam waktu 39 jam, pada kenyataannya ia menyelesaikannya dalam waktu 90 jam! Dalam kasus lain, pada saat ia memprediksi bahwa ia dapat mengerjakan suatu tugas dalam waktu 64 jam, pada kenyataannya ia menyelesaikannya dalam waktu 52 jam. Suatu hari, setelah melalui 12 (baca: Dua Belas) semester masa perkuliahan, akhirnya ia bisa mengambil Tugas Akhir. Ia memprediksikan, bahwa ia dapat menyelesaikan skripsi dalam waktu 99 jam. Dengan melihat prediksi-prediksinya yang selalu salah, berapa lama Aleiksandher akan menyelesaikan skripsinya?</p>','a',20),(222,17,'<p>Bruce dan Clark masing-masing memiliki sebuah kantong berisi 9 buah bola Kristal. Bola-bola Kristal di kantong-kantong tersebut diberi nomor 1 sampai 9. Suatu hari, Bruce dan Clark membuang satu bola Kristal dari kantong bola mereka. Misalkan sebuah variable b menyatakan hasil penjumlahan dari semua nomor bola Kristal di kantong bola milik Bruce, dan variable c menyatakan hasil penjumlahan dari semua nomor bola Kristal di kantong bola milik Clark, maka berapakah probabilitas |b &ndash; c| menghasilkan kelipatan 4?</p>','d',20),(223,18,'<p>Bilangan n terbesar sehingga 8<sup>n</sup> membagi 44<sup>44</sup> adalah...</p>','e',20),(224,19,'<p>Di antara lima orang gadis, Arinta, Elsi, Putri, Rita, dan Venny, dua orang memakai dress merah dan tiga orang memakai dress biru. Arinta dan Putri mengenakan warna dress yang sama. Warna dress Putri dan Elsi berbeda, demikian pula dengan Elsi dan Rita. Kedua gadis yang memakai dress merah adalah &sdot;&sdot;&sdot;&sdot;</p>','e',20),(225,20,'<p>Pada zaman paleolitikum dibutuhkan waktu sekitar 1 jam untuk dapat menempuh 5km dengan menggunakan tenaga seekor naga darat. Namun waktu yang ditempuh dapat diminimalisir &nbsp;sebanyak 2 kali lipat dengan menambahkan naga darat sebanyak 2 kali lipat. Namun sang raja tak mau tau, dia ingin bisa segera sampai ke Hutan Besar yang berjarak 20 km dari kediamannya dan dalam waktu tepat 15 menit. Maka berapa banyak naga darat yang diperlukan oleh raja?</p>','c',20),(226,21,'<p>674 * x! = 4044 , berapa nilai x dalam biner?</p>','d',20),(227,22,'<p>Seekor katak dapat melompat sejauh satu meter. Jika katak tersebut melompat sebanyak 3 kali, dan arah lompatannya acak (utara, selatan, barat, atau timur), maka berapa persen probabilitas posisi akhir katak berada 3 meter dari tempatnya berada?</p>','d',20),(228,23,'<p>Suatu hari John ingin melayat ke kuburan temannya yang benama Marry. John pergi dari rumahnya ke kuburan dengan berjalan kaki. Setelah berjalan sejauh 500 meter, John kelupaan untuk membeli bunga, sehingga ia harus berbalik arah untuk pergi ke toko bunga. Setelah selesai membeli bunga, John melanjutkan perjalanannya ke kuburan. Setelah selesai dengan urusannya, John langsung pulang dengan jalur yang sama tanpa singgah ke manapun. Jika diketahui jarak antara toko Bunga dan kuburan adalah 800 meter, maka berapakah total jarak tempuh John?</p>','a',20),(229,24,'<p>Diketahui &nbsp;2<sup>2x</sup> + 2<sup>-2x</sup> = 2. Nilai 2<sup>x</sup> + 2<sup>-x</sup> &nbsp;= ...</p>','d',20),(230,25,'<p>Perhatikan potongan program berikut!</p>\r\n<p><img src=\"/asset/gambar_logika/FG75PenyisihanLogika!2526.JPG\" alt=\"\" width=\"572\" height=\"210\" /></p>\r\n<p>Berapakah output dari program tersebut ?</p>','d',20),(231,26,'<p>Perhatikan potongan program berikut!</p>\r\n<p><img src=\"/asset/gambar_logika/FG75PenyisihanLogika!2526.JPG\" alt=\"\" width=\"572\" height=\"210\" /></p>\r\n<p>Berapakah nilai x sehingga output program tersebut adalah 24?</p>','c',20),(232,27,'<p>Ada 10 orang, lima laki-laki dan lima perempuan, termasuk sepasang pengantin. Seorang tukang foto yang bukan salah satu di antara 10 orang tersebut akan mengambil gambar enam orang di antara mereka termasuk kedua pengantin, dengan tidak ada dua laki-laki maupun dua perempuan yang berdekatan. Banyaknya cara adalah &hellip; (kedua pengantin tidak harus saling berdekatan)</p>','b',20),(233,28,'<p>Suatu deret geometri terdiri dari 20 bilangan, dengan keterangan sebagai berikut:</p>\r\n<p style=\"padding-left: 30px;\">- Hasil penjumlahan dari 2 bilangan pertamanya adalah 40</p>\r\n<p style=\"padding-left: 30px;\">- Hasil penjumlahan dari 3 bilangan pertamanya adalah 76</p>\r\n<p style=\"padding-left: 30px;\">- Hasil penjumlahan dari 4 bilangan pertamanya adalah 130</p>\r\n<p>Berapa banyak bilangan bulat yang terdapat pada deret geometri tersebut?</p>','e',20),(234,29,'<p>Di dalam sebuah kotak terdapat 18 bola yang identik (berbentuk sama), 5 berwarna hitam, 6 berwarna putih dan 7 berwarna ungu. Jika diambil dua bola secara acak, maka peluang yang terambil bola berwarna sama adalah ....</p>','b',20),(235,30,'<p>Hasil penjumlahan semua bilangan bulat antara 2130<sup>1/3</sup> dan 2020<sup>1/2</sup> &nbsp;adalah</p>','b',20),(236,31,'<p>Di Hongkong, Sohir dibunuh oleh seorang penjahat terkenal. Penjahat ini telah membunuh banyak sekali orang dari berbagai negara. Polisi di seluruh dunia tidak dapat menangkapnya karena setiap kali ia membunuh seseorang ia akan langsung menghilang tanpa jejak. Namun, Sohir sebelum terbunuh berhasil melihat wajah pembunuh itu dan mengenalinya, sehingga Sohir meninggalkan secarik kertas yang berisikan kode berikut : <strong>wltibubo hkhsho zvypo.</strong></p>\r\n<p>Selain kode itu, ia menuliskan angka 7 menggunakan darahnya karena tinta bolpennya sudah habis. Polisi sangat yakin bahwa pesan yang ditinggalkan oleh Sohir sangatlah akurat. Siapakah pembunuh Sohir?</p>','a',20),(237,32,'<p>Berapakah nilai X dari deretan angka di bawah ini</p>\r\n<p>84, 155, 258, X , 584, 819</p>','c',20),(238,33,'<p>Dalam suatu lomba, satu tim yang terdiri dari 10 orang masing-masing menempati suatu ruangan. Masing masing orang diberikan satu kertas. Kertas tersebut berisikan satu huruf serta urutan huruf tersebut. Huruf-huruf tersebut dapat disusun menjadi kata sandi dengan menggabungkan semua huruf lain yang didapatkan teman setimnya. Setiap orang harus dapat mengetahui kata sandi agar dapat lolos ke babak selanjutnya. Satu-satunya alat untuk berkomunikasi antar ruangan adalah telepon yang terletak di sudut ruangan. Asumsikan telepon tersebut hanya bisa melakukan panggilan antar dua orang (tidak bisa group call), berapa kali minimum panggilan yang dibutuhkan sebelum akhirnya semua anggota kelompok dapat mengetahui kata sandi tersebut?</p>','a',20),(239,34,'<p>Dalam sebuah perlombaan, A, B, C, D, E, F, G, dan H menempati urutan 8 besar. Panitia meminta mereka untuk menebak siapa pemenang pertama perlombaan tersebut.</p>\r\n<p>A : &ldquo; Peringkat pertama adalah &nbsp;F atau H&rdquo;</p>\r\n<p>B : &ldquo; Saya adalah peringkat pertama&rdquo;</p>\r\n<p>C : &ldquo; G adalah yang pertama&rdquo;</p>\r\n<p>D : &ldquo; Yang menempati peringkat pertama bukanlah B&rdquo;</p>\r\n<p>E : &ldquo; A salah&rdquo;</p>\r\n<p>F : &ldquo; Saya dan H bukanlah yang pertama&rdquo;</p>\r\n<p>G : &ldquo;C bukanlah yang pertama&rdquo;</p>\r\n<p>H : &ldquo;Saya setuju dengan A&rdquo;</p>\r\n<p>Panitia mengatakan bahwa 3 dari tebakan mereka benar. Siapa yang menduduki peringkat pertama ?</p>\r\n<p>&nbsp;</p>','e',20),(240,35,'<p>O Q L H R</p>\r\n<p>I &nbsp;J &nbsp;F E Q<br /><span style=\"text-decoration: underline;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; _</span></p>\r\n<p>F G &nbsp;F C ?</p>\r\n<p>&nbsp;</p>\r\n<p>Huruf apa yang seharusnya ada di bagian (?) ?</p>','d',20),(241,36,'<p>Seekor monster yang pintar yang bernama Escapamon telah kabur dari penjara ! Polisi yang menangkapnya berhasil mengulik informasi, bahwa monster tersebut dibantu oleh seekor monster lain. Pada akhirnya, polisi berhasil meringkus 4 tersangka yang diduga adalah rekan si monster. Salah satu monster tersebut adalah komplotan dari Escapamon, dan selalu berbohong demi membantu Escapamon. Dua dari monster tersebut tidak bersalah dan selalu berkata jujur,. Namun, ada satu monster lagi yang telah dibayar oleh Escapamon untuk membantu rekannya dengan ikut berkata bohong. Berdasarkan pernyataan masing &ndash; masing monster, manakah yang merupakan monster bayaran Escapamon?</p>\r\n<p>Patamon : &ldquo;Gabumon adalah komplotan dari Escapamon&rdquo;</p>\r\n<p>Greymon : &ldquo;Yang diucapkan Palmon adalah bohong&rdquo;</p>\r\n<p>Palmon : &ldquo;Patamon berbohong&rdquo;</p>\r\n<p>Gabumon : &ldquo;Greymon &nbsp;bukanlah orang yang dibayar Escapamon&rdquo;</p>','d',20),(242,37,'<p>Banyaknya kemungkinan pasangan bilangan bulat positif (p, q) dimana p + q &lt;= 100 dan memenuhi persamaan (p+q<sup>-1</sup>)/(p<sup>-1</sup>+q) = 17 adalah&hellip;</p>','e',20),(243,38,'<p>Perhatikan bangun datar persegi panjang berikut!</p>\r\n<p><img src=\"/asset/gambar_logika/HJ62PenyisihanLogika!38.JPG\" alt=\"\" width=\"120\" height=\"99\" /></p>\r\n<p>Dapat dilihat, persegi panjang tersebut terbagi menjadi 4 bagian, yaitu w, x, y dan z. Keliling dari w, x dan y berturut-turut adalah 2, 3 dan 5. Berapakah keliling dari z?</p>','c',20),(244,39,'<p>Dono memiliki enam kartu. Setiap kartunya ditulis satu bilangan bulat positif. Untuk setiap putaran, Dono mengambil 3 kartu secara acak dan menjumlahkan ketiga bilangan yang ada pada kartu-kartu tersebut. Setelah melakukan 20 kemungkinan dalam memilih 3 dari 6 kartu, Dono mendapatkan angka 16 sebanyak 10 kali dan angka 18 sebanyak 10 kali. Bilangan terkecil yang terdapat pada kartu-kartu yang dimiliki Dono adalah&hellip;</p>','b',20),(245,40,'<p>Jika berlaku persamaan (x-y)/(z-y) = -10, maka berapakah hasil dari (x-z)/(y-z) ?</p>','d',20),(246,1,'<p>Jawabannya A</p>','a',21),(247,1,'<p class=\"ListParagraph1CxSpFirst\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; mso-list: l1 level1 lfo1;\"><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span><!--[endif]--><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri;\">Perhatikan gambar berikut!</span></p>\r\n<p class=\"ListParagraph1CxSpMiddle\" style=\"text-align: justify; text-justify: inter-ideograph;\"><!-- [if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_8\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\r\n style=\'width:165.75pt;height:165.75pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:/Users/wojia/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\"\r\n  o:title=\"\"/>\r\n</v:shape><![endif]--><!-- [if !vml]--><img src=\"file:///C:/Users/wojia/AppData/Local/Temp/msohtmlclip1/01/clip_image001.png\" alt=\"\" width=\"221\" height=\"221\" /><img src=\"data:image/png;base64,\" alt=\"\" /><!--[endif]--></p>\r\n<p class=\"ListParagraph1CxSpMiddle\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-family: Calibri;\">Berapakah perbandingan luas segiempat berwarna biru dengan segiempat berwarna merah?</span></p>\r\n<p class=\"ListParagraph1CxSpMiddle\" style=\"margin-left: .75in; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.25in; mso-list: l0 level1 lfo2;\"><!-- [if !supportLists]--></p>','c',22),(248,2,'<p>Pada gambar berikut, jika segitiga ABC dan PQR adalah segitiga sama sisi, tentukan sudut yang dibentuk CXY!</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>','e',22),(249,3,'<p>Ekspresi &ldquo;not((X and not(Y)) or (not(X) or (X and not(Y))))&rdquo; akan bernilai TRUE jika X dan Y bernilai&hellip;</p>','c',22),(250,4,'<p>Sepuluh orang petualang sedang berusaha untuk menyeberangi sungai di suatu hutan. Kebetulan sekali, mereka menemukan sebuah sampan di pinggir sungai dan hanya salah satu dari mereka yang bisa mengayuh dayung. Namun, sampan tersebut hanya dapat menampung dua orang sekaligus. Waktu yang dibutuhkan untuk satu kali menyeberangi&nbsp; sungai tersebut adalah satu menit pada penyeberangan pertama. Pada penyeberangan kedua, karena di pendayung mulai lelah, maka waktu yang dibutuhkan untuk menyeberangi sungai bertambah menjadi 2 menit. Pada penyeberangan ketiga membutuhkan tiga menit, dan seterusnya. Berapa waktu tercepat yang dibutuhkan untuk menyeberangi sungai tersebut?</p>','d',22),(251,5,'<p>Pada bangun datar di bawah, ABCD adalah sebuah persegi panjang dengan AB = 12 dan BC = 18. Persegi panjang AEFG terbentuk dari bangun datar ABCD yang diputar sebanyak 30<sup>o</sup>, dengan A sebagai titik putarnya. Berapakah total luas bangun datar yang berwarna biru?5. Pada bangun datar di bawah, ABCD adalah sebuah persegi panjang dengan AB = 12 dan BC = 18. Persegi panjang AEFG terbentuk dari bangun datar ABCD yang diputar sebanyak 30o, dengan A sebagai titik putarnya. Berapakah total luas bangun datar yang berwarna biru?</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>','a',22),(252,1,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box;\">Berapakah 2 digit terakhir dari 2401<sup>2018<sub></sub>&nbsp;</sup>?</span></p>','a',23),(253,2,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12a2-331b-8127-48497addf86e\" style=\"box-sizing: border-box;\"><img style=\"box-sizing: border-box; border: none; vertical-align: middle; transform: rotate(0rad);\" src=\"https://lh5.googleusercontent.com/2-hJeDk3GNINUEiha5odHIndWv6cLO4bQOFq0SEnvWnVkPmZBLfjGHIFGS22CsYiknYueBnaeYpEXTFsgDWsMlEX6SiyFuEFofBTN0BaM_pwYRqdnGG3rs_ZeczcIarkAs7cVRgQ\" alt=\"\" width=\"202\" height=\"209\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Ada berapa segitiga pada gambar tersebut?</span></p>\r\n<p><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>','c',23),(254,3,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px; text-align: justify;\"><span id=\"docs-internal-guid-fa5fa16d-12a5-5a81-850d-9a0fea8140b1\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Saat Andi masuk ke pabrik barunya, ia menyadari pabrik tersebut memiliki 10000 lampu yang diberi nomor 1-10000 dan memiliki 10000 sakelar yang diberi nomor 1-10000. Saat itu semua lampu mati, apabila Andi menekan sakelar nomor 1, seluruh lampu bernomor kelipatan 1 akan menyala apabila sedang mati dan akan mati apabila sedang menyala. Apabila Andi menekan sakelar nomor 2, seluruh lampu bernomor kelipatan 2 akan menyala apabila sedang mati dan akan mati apabila sedang menyala dan seterusnya. Karena Andi masih bingung, ia menekan semua sakelar secara berurutan dari nomor 10000 hingga nomor 1. Berapakah lampu yang menyala?</span></span></p>','a',23),(255,4,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12a5-d7be-a550-970ad508121f\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Bilangan asli terkecil lebih dari 2018 yang bersisa 1 jika dibagi 2, 3, 4, 5, 6, 7, 8, 9, dan 10 adalah ...</span></span></p>','e',23),(256,5,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12a6-346f-3c9e-c141b3018031\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Berapa digit satuan dari </span><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">2018<sup>2017</sup></span> <span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">+ 2017?</span></span></p>','e',23),(257,6,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px; text-align: justify;\"><span id=\"docs-internal-guid-fa5fa16d-12a6-df92-2ca4-2e54b34edf2a\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Untuk mengikuti suatu lomba pemrograman terdapat 4 orang siswa laki-laki, 3 orang siswi perempuan dan 2 orang guru pendamping yang akan dibagi ke dalam 2 kelompok masing-masing 4 orang. Tentukan berapa banyak kemungkinan pembagian kelompok yang ada apabila setiap kelompok harus mencakup minimal 1 orang siswa laki-laki, 1 orang siswi perempuan dan 1 orang guru pendamping!</span></span></p>','b',23),(258,7,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12a7-2d78-d8e9-29cf70581124\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Banyak bilangan 3 digit yang semua digitnya berbeda, serta digit terakhir merupakan jumlah dari kedua digit di depannya adalah ...</span></span></p>','c',23),(259,8,'<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>','b',23),(260,9,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px; text-align: justify;\"><span id=\"docs-internal-guid-fa5fa16d-12aa-1d2d-60f5-2d125946e845\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Seorang bajak laut pencari harta karun menemukan 2018 koin di dalam suatu peti. Di peti tersebut tertuliskan &ldquo;hanya satu koin di dalam peti ini yang asli, yang paling berat diantara semuanya&rdquo; Kebetulan saat tu kapal sang bajak laut sedang penuh sehingga ia tidak mau membawa semua koin ke dalam kapalnya. Untungnya ia membawa sebuah neraca, berapakah penimbangan minimal yang harus dilakukan sang bajak laut untuk mendapatkan koin asli?</span></span></p>','d',23),(261,10,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12aa-64a4-f0de-0281f4225696\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Berapakah total garis diagonal yang dapat dibentuk pada segi 2018 beraturan?</span></span></p>','b',23),(262,11,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-fa5fa16d-12ab-1290-ce97-f5f01912788e\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Berapakah digit yang paling sedikit muncul bila kita menuliskan secara berurutan angka dari 1 sampai 1000, yaitu 1, 2, 3, 4, ..., 1000?</span></span></p>','a',23),(263,12,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-bcd080c9-12ab-db81-ba6e-40ad2cd599d6\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Perhatikan gambar berikut. </span></span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-51948c56-12ab-e664-7fce-d819721f4207\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"box-sizing: border-box; border: none; vertical-align: middle; transform: rotate(0rad);\" src=\"https://lh3.googleusercontent.com/7wwKgsxYeDcc-wtpU9XOSikfEe6xIMJ5PzgmQ3F2aFZNQfijQHV-L22WqahhuAJwsYPz2aao6yCBQIMI13MmjosoeqNMdzLUbkdwjIPxJd0OG08fR-aT8lsYOqq3QeJcljAAAk4n\" alt=\"C:\\Users\\Varianto\\AppData\\Local\\Microsoft\\Windows\\INetCache\\Content.Word\\Image_a637009.jpg\" width=\"382\" height=\"236\" /></span></span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-51948c56-12ab-e664-7fce-d819721f4207\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"box-sizing: border-box; background-color: transparent; font-size: 12pt;\">Pada step 101, berapa banyak kucing yang ada di baris ke 9?</span></span></span></p>','d',23),(264,13,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; background-color: transparent; font-family: Cambria; font-size: 12pt; white-space: pre-wrap; text-align: justify;\">Andrew adalah seorang peternak dan mempunyai beberapa ekor ayam. Suatu hari, dia membawa sekeranjang telur segar ke pasar untuk dijual. Orang pertama membeli setengah dari semua telur di keranjang dan satu telur. Orang kedua membeli setengah dari sisa telur dan setengah telur. Orang ketiga membeli setengah dari sisa telur. Sekarang, hanya tersisa 1 butir telur di keranjang Andrew. Jika tidak ada telur yang rusak, berapa telur yang dia miliki di keranjangnya?</span></p>','c',23),(265,14,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">Ada seorang pemain sepak bola perofesional asal Brazil yang lahir di tahun 1900an. Semisal pada abad ke-21 ini, pemain ini berkata bahwa &ldquo;Saat usia ku adalah x tahun aku akan pensiun pada tahun x</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: super; white-space: pre-wrap;\">2 </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">.&rdquo; &nbsp;Maka pada tahun berapakah ia lahir?</span></p>','c',23),(266,15,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; background-color: transparent; font-family: Cambria; font-size: 12pt; white-space: pre-wrap;\">Terdapat istilah Full House yaitu kondisi dimana seseorang memiliki 3 kartu dengan nilai X dan 2&nbsp;&nbsp;kartu dengan nilai Y, di mana X tidak sama dengan Y. Berapa banyak kemungkinan Full House yang ada?</span></p>','e',23),(267,16,'<p>Bila diketahui potongan program sebagai berikut :</p>\r\n<p>&nbsp;</p>\r\n<p>Integer find(String input, String data)</p>\r\n<p>{</p>\r\n<p style=\"padding-left: 30px;\">If (input == data)</p>\r\n<p style=\"padding-left: 60px;\">return 1;</p>\r\n<p style=\"padding-left: 30px;\">else</p>\r\n<p style=\"padding-left: 30px;\">{</p>\r\n<p style=\"padding-left: 60px;\">If (input.length &gt; data.length)</p>\r\n<p style=\"padding-left: 90px;\">input = input.substring(0, input.length);</p>\r\n<p style=\"padding-left: 60px;\">else if (input.length &lt; data.length())</p>\r\n<p style=\"padding-left: 90px;\">data = data.substring(0);</p>\r\n<p style=\"padding-left: 60px;\">&nbsp;else</p>\r\n<p style=\"padding-left: 90px;\">return 1;</p>\r\n<p style=\"padding-left: 60px;\">Return find(input, data) + 1;</p>\r\n<p style=\"padding-left: 30px;\">}</p>\r\n<p>}</p>\r\n<p>&nbsp;<span style=\"font-weight: 400;\">Berapakah nilai dari find(&ldquo;ILPC2018&rdquo;, &ldquo;ILPC&rdquo;)?</span></p>\r\n<p><span style=\"font-weight: 400;\">Catatan :&nbsp;</span></p>\r\n<ol>\r\n<li><span style=\"font-weight: 400;\">substring(x,y) berarti substring mulai dari index awal x(inclusive) hingga index akhir y(exclusive)</span></li>\r\n<li>substring(x) berarti substring mulai dari index awal x(inclusive) hingga index akhir string tersebut.</li>\r\n</ol>','c',23),(268,17,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: \'times new roman\', times, serif;\">Berdasarkan potongan program pada nomor 16,&nbsp;</span><span id=\"docs-internal-guid-51948c56-12b2-1650-60e8-58cf7f4859db\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; background-color: transparent; font-size: 12pt; white-space: pre-wrap; text-align: justify; font-family: \'times new roman\', times, serif;\">Berapakah nilai dari find(&ldquo;ini siapa ya&rdquo;, &ldquo;nama saya felix&rdquo;)?</span></span></p>','d',23),(269,18,'<p>Perhatikan potongan program berikut</p>\r\n<p>&nbsp;</p>\r\n<p>int result = 0;</p>\r\n<p>int[] primes = {2,3,5}</p>\r\n<p>for (int i = 1; i &lt; n; i++)</p>\r\n<p>{</p>\r\n<p style=\"padding-left: 30px;\">for(int j = 0; j &lt; primes.length; j++)</p>\r\n<p style=\"padding-left: 30px;\">if(i % primes[j] == 0)</p>\r\n<p style=\"padding-left: 30px;\">{</p>\r\n<p style=\"padding-left: 60px;\">result += j;</p>\r\n<p style=\"padding-left: 60px;\">break;</p>\r\n<p style=\"padding-left: 30px;\">}</p>\r\n<p>}</p>\r\n<p>&nbsp;</p>\r\n<p>Apabila n = 331, berapakah nilai result?</p>\r\n<p>Catatan: primes.length adalah panjang/besar array, yang berarti banyaknya elemen dalam array tersebut.</p>','b',23),(270,19,'<p>Misalkan n<span style=\"font-size: xx-small;\">1</span>,n<span style=\"font-size: xx-small;\">2</span>,n<span style=\"font-size: xx-small;\">3</span>&nbsp;... adalah bilangan asli yang membentuk barisan aritmatika. Banyaknya nilai di himpunan {1,2,3,...,1000}yang mungkin menjadi nilai n<sub>n1</sub>&nbsp;- n<sub>n2</sub> adalah ...</p>','e',23),(271,20,'<p>Apabila terdapat potongan program :&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>String result = &ldquo;ILPC18&rdquo;;</p>\r\n<p>for (Int i = 0; i &lt; result.length; i++)</p>\r\n<p>{</p>\r\n<p style=\"padding-left: 30px;\">If (i == result.length / 3)</p>\r\n<p style=\"padding-left: 60px;\">result += result.cc(result);</p>\r\n<p style=\"padding-left: 30px;\">If (i % 3 != 0)</p>\r\n<p style=\"padding-left: 60px;\">result = result.ss(i , result.length);</p>\r\n<p>}</p>\r\n<p>Berapakah hasil akhir dari result setelah program dijalankan?</p>\r\n<p>&nbsp;</p>\r\n<p>Contoh penggunaan cc: misalkan s = \"I\". Maka, program s = s.cc(\"L\").cc(\"P\").cc(\"C\") akan menjadikan String s menjadi \"ILPC\".</p>\r\n<p>Contoh penggunaan ss: misalkan s = \"ILPC\". Maka, program s = s.ss(1, 3); akan menjadikan s = \"LP\".</p>\r\n<p>Catatan : function ss memiliki 2 parameter, parameter pertama adalah index awal dan parameter kedua adalah index akhir. Program akan mereturn sebuah String, yang valuenya adalah huruf mulai dari index awal(<strong>inclusive</strong>) hingga index akhir(<strong>exclusive</strong>) sebuah String.</p>','e',23),(272,21,'<p>Diketahui dari 100 orang mahasiswa Universitas Surabaya, 42 mahasiswa memilih kuliah multimedia, 68 mengambil kuliah teknik informatika, 54 mengambil kuliah sistem informasi , 22 mengambil kuliah multimedia dan sistem informasi, 25 mengambil kuliah multimedia dan teknik informatika 7 mengambil kuliah sistem informasi tetapi tidak mengambil kuliah multimedia maupun teknik informatika, 10 mengambil kuliah multimedia, teknik informatika dan sistem informasi serta 8 mahasiswa tidak mengambil satupun kuliah multimedia, teknik informatika atau sistem informasi.</p>\r\n<p>Bila seorang mahasiswa dipilih secara acak, cari peluangnya bahwa seseorang yang mengambil kuliah teknik informatika mengambil matakuliah teknik informatika, multimedia dan sistem informasi ?</p>','c',23),(273,22,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">Segitiga </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; font-style: italic; vertical-align: baseline; white-space: pre-wrap;\">ABC</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\"> mempunyai panjang sisi AB = 20, AC = 21, dan BC = 29. Apabila terdapat 2 titik, D dan E yang terletak pada segmen garis BC sehingga BD = 8 dan EC = 9, besar sudut </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; font-style: italic; vertical-align: baseline; white-space: pre-wrap;\">DAE </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">adalah?</span></p>','b',23),(274,23,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">Terdapat persegi </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; font-style: italic; vertical-align: baseline; white-space: pre-wrap;\">ABCD </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">yang memiliki panjang sisi 1. Titik K dan L berturut-turut terletak pada segmen garis BC dan DC sehingga keliling segitiga </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; font-style: italic; vertical-align: baseline; white-space: pre-wrap;\">KCL </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">adalah 2. Luas minimum dari segitiga </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; font-style: italic; vertical-align: baseline; white-space: pre-wrap;\">AKL </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">adalah &hellip;</span></p>','b',23),(275,24,'<p style=\"text-align: justify; box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"color: #333333; font-family: Calibri;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Suatu deret bilangan (2, 5, 10, 50, 500, &hellip;) berisi 20 buah bilangan, dimana bilangan ke-n adalah hasil perkalian dari bilangan ke-(n-2) dan (n-1). Jika bilangan ke-15 pada deret bilangan tersebut memiliki n buah angka 0, berapakah n? </span></span></p>','d',23),(276,25,'<p>Tiga monster sedang mengikuti duel. Mereka menyerang pada saat yang bersamaan dalam suatu ronde. Jika tiap monster masing-masing menyerang salah satu dari dua monster lain secara acak dan berhasil mengenainya, berapa probabilitas paling sedikit salah satu monster tidak terkena serangan ?</p>','c',23),(277,26,'<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p>Jumlah dari semua bilangan bulat x yang memenuhi persamaan&nbsp;<sup>2</sup>log(x<sup>2</sup>-4x-1) = m, dengan m elemen bilangan bulat adalah ...</p>','d',23),(278,27,'<p>Sebuah lingkaran yang berpusat di O memiliki tali busur AB yang berjarak 5cm dari O. Serta, tali busur AC yang berjarak 5&radic;2cm dari O. Dimana garis tinggi dari segitiga OAC <strong>TIDAK MEMOTONG</strong> garis AB. Jika jari-jari lingkaran adalah 10 cm, berapakah BC<sup>2</sup>?</p>','b',23),(279,28,'<p>Misalkan S(n) merupakan faktor prima terbesar dari n, dan t(n) merupakan faktor prima terkecil dari n. Banyaknya bilangan asli n{1,2,3,...,100}sehingga t(n) + 1 = s(n) adalah &hellip;</p>','b',23),(280,29,'<p>Berapa banyak bilangan bulat positif x yang kurang dari 2017 dan tepat mempunyai x/2 bilangan yang kurang dari x serta relatif prima terhadap x?</p>','c',23),(281,30,'<p style=\"text-align: justify;\">Di suatu pulau hanya terdapat 5 orang kesatria, yang selalu berkata jujur, dan para penjahat yang selalu berbohong. Pada suatu hari di pulau tersebut ada 10 penduduk asli pulau itu berdiri secara melingkar. Setiap orang berkata: &ldquo;Kedua orang disebelahku adalah penjahat&rdquo;. Dari 10 orang dalam lingkaran tersebut, berapa kemungkinan jumlah minimum kesatria?</p>','e',23),(282,31,'<p>Enam orang mahasiswa Ubaya sedang membahas mimpinya dalam kelompok untuk membuat konsep Artificial Intelligence seperti Jarvis pada film Iron Man. Mahasiswa tersebut berunding dalam 3 meja bundar, dan setiap meja tersebut pasti diduduki mahasiswa. Banyak cara duduk yang mungkin adalah ...</p>','a',23),(283,32,'<p>Pak Umar menaruh barang berharganya di sebuah brankas (lemari besi) dengan kunci kombinasi 7 digit setiap digit adalah bilangan 0 sampai dengan 9. Supaya tidak mudah kelupaan, ia men-set 3 digit berharga 0 (tidak tahu digit yang mana) sedangkan digit lainnya seperti sebelumnya maksimum hanya muncul 1 kali dalam kode (kecuali yang 0 tsb). Anda berancang-ancang kalau suatu ketika Pak Umar lupa kembali maka anda berhitung ada berapa kemungkinan kombinasi yang nanti harus dicoba.</p>','d',23),(284,33,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">Diketahui a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">1</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">,a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">2</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">,a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">3</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">, &hellip; , a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">n </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">adalah bilangan bulat yang membentuk barisan aritmatika. Nilai dari &nbsp;a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">1</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\"> + a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">2</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\"> + a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">3</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\"> + a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">4</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\"> + a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">5 </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">= 680. Misal beda barisan tersebut adalah x dimana x adalah kuadrat jumlah 3 bilangan ganjil berurutan. Diketahui hasil kali ketiga bilangan sama dengan 7 kali jumlah ketiga bilangan tersebut. Berapakah nilai dari a</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 7.2pt; vertical-align: sub; white-space: pre-wrap;\">1</span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">?</span></p>','e',23),(285,34,'<p>Wayne memiliki sebuah gambar bangun datar sebagai berikut:</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span id=\"docs-internal-guid-51948c56-12fe-bdaf-4605-77d06583d8aa\" style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 12pt; font-family: Cambria; color: #4a86e8; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><img style=\"box-sizing: border-box; border: none; vertical-align: middle; transform: rotate(0rad);\" src=\"https://lh3.googleusercontent.com/ADESbN7VByvL0LhrDJS8J-9zaWk2ZUBR7056pQ_OdN8raTskVJ2k1I9Zxxle9v3ISmFT83LPY27_5nGA3lpM8lr-pVJRya6DfAjJUKBKgWhKFYEyi23PAVoWno7J-dRJO-f8qOCz\" alt=\"\" width=\"224\" height=\"134\" /></span></span></p>\r\n<p>Jika diketahui panjang dari garis AB adalah 1 cm, berapakah panjang garis AH?</p>\r\n<p>&nbsp;</p>','c',23),(286,35,'<p style=\"text-align: justify;\">Suatu hari, karena tidak ada pekerjaan yang menuntut, Bruce dan Clark bermain lempar koin. Di dalam permainan itu mereka menggunakan 3 buah koin yang memiliki sisi angka dan sisi garuda. Pertama, Bruce akan melempar ketiga koin tersebut secara berurutan. Apabila hasil lemparannya adalah angka, maka Bruce akan membuang koin tersebut (tidak digunakan di permainan itu lagi). Setelah Bruce selesai melempar ketiga koin tersebut, Clark akan melempar n koin dimana n menyatakan sisa koin yang telah dilempar Bruce (0 &lt;= n &lt;= 3). Berapa peluang Clark menghasilkan lemparan angka tepat satu kali dari n lemparan yang Ia lakukan?</p>','e',23),(287,36,'<p style=\"text-align: justify;\">Apabila diketahui persamaan 34x - 51y = 2012z dengan x,y,z adalah bilangan prima. Maka, berapakah nilai x + y + z?</p>','c',23),(288,37,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\">Misalkan |P| adalah banyaknya anggota himpunan P. Jika |P &cup; L| = 10 dan |P| = 4, maka salah satu nilai yang mungkin untuk |L| adalah</p>','e',23),(289,38,'<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Montserrat, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; vertical-align: baseline; white-space: pre-wrap;\">Diketahui </span><span style=\"box-sizing: border-box; text-align: justify; background-color: transparent; font-family: Cambria; font-size: 12pt; text-decoration-line: underline; vertical-align: baseline; white-spa